INSERT INTO `videos` VALUES (1,'HOW-TO: Conceal','http://www.youtube.com/embed/3RZp98_EbMg',NULL,'http://img.youtube.com/vi/3RZp98_EbMg/0.jpg','1',106,'2013-11-14 04:39:53','2014-01-01 18:05:54','3RZp98_EbMg','Products used:\nNars Radiant Creamy Concealer\nBobbi Brown Spot Treatment Corrector\nPicasso Voyage 56043\nMac Brush 187\nOlive Young Sponge\n\nIG@dahyeshka',182,0,NULL,'2013-11-09 10:45:38',1,'how-to-conceal'),(2,'HOW-TO: Foundation','http://www.youtube.com/embed/Yr-8OeoyBR4',NULL,'http://img.youtube.com/vi/Yr-8OeoyBR4/0.jpg','1',55,'2013-11-14 04:39:53','2014-01-02 01:12:34','Yr-8OeoyBR4','In this tutorial I\'m showing how to apply foundation using different applicators.\n\nProducts Used:\nBobbi Brown Protective Face Base\nSulwhasoo CC Emulsion\nNars Radiant Cream Compact Foundation\nBobbi Brown Foundation Brush\nMac Brush 187\nOlive Young Sponge\n\nIG@dahyeshka',184,0,NULL,'2013-11-07 12:40:37',1,'how-to-foundation'),(3,'Holiday Look with Chanel Rouge Allure.','http://www.youtube.com/embed/ShOVC3drxdA',NULL,'http://img.youtube.com/vi/ShOVC3drxdA/0.jpg','1',19,'2013-11-14 04:39:53','2014-01-02 02:04:32','ShOVC3drxdA','Hi guys, It\'s Dahye!\nSome of you asked me for english tutorial, so finally I made it! Yay!!\nIt\'s my first tutorial in english and it can be not easy to get my english for you, but hope you like it XX\n\nProducts used in video:\nBobbi Brown Long-Wear Cream Shadow Black Pearl\nBobbi Brown Eyeshadow Hot Stone\nBobbi Brown Eyeshadow Desert Sand\nBobbi Brown Long-Wear Gel Eyeliner Black Ink\nMaybelline The Magnum Mascara\nBobbi Brown Blush Almond\nChanel Rouge Allure #135 Énigmatique\nChanel Rouge Allure #129 Surprenante\nChanel Rouge Allure #126 Équivoque\nChanel Rouge Allure #131 Etonnante\nChanel Le Vernis #595 Rouge Moire\nChanel Le Vernis #539 Rose Moire\n\nIG @dahyeshka\nhttps://www.facebook.com/dahyeshkablog',200,0,NULL,'2013-11-05 18:58:14',1,'holiday-look-with-chanel-rouge-allure'),(4,'HOW-TO: Everyday Skin Care Routine Basics.','http://www.youtube.com/embed/2wRuf5agy9Q',NULL,'http://img.youtube.com/vi/2wRuf5agy9Q/0.jpg','1',21,'2013-11-14 04:39:53','2013-12-30 06:11:17','2wRuf5agy9Q','The most important thing for a perfect base makeup is skin care. \nSo I made this video for beginners, who don\'t know what product to use, where and how. \nHope you like it X\n\nProducts:\nNARS Multi-Action Hydrating Toner\nZymogen Pore Tightening Serum\nBobbi Brown Hydrating Eye Cream\nOrigins Mega Mushroom Skin Relief\nBobbi Brown Vitamin Enriched Face Base\nBobbi Brown Protective Face Base\n\nIG @dahyeshka',183,0,NULL,'2013-11-02 12:53:07',1,'how-to-everyday-skin-care-routine-basics'),(5,'3 Ways to Apply CLIO Lipnicure.','http://www.youtube.com/embed/3ZbsS0iuv9k',NULL,'http://img.youtube.com/vi/3ZbsS0iuv9k/0.jpg','1',47,'2013-11-14 04:39:53','2014-01-01 16:44:45','3ZbsS0iuv9k','Used Products.\n\nBobbi Brown Blush - Nude Peach.\nBobbi Brown Long-Wear Cream Shadow Stick - Golden Pink\nBobbi Brown Eyeshadow - Hot Stone\nBobbi Brown Long-Wear Gel Eyeliner - Black Ink\nMaybeline The Magnum Mascara\nClio Lipnicure Tension Red, Guilty Pink, Rumor Coral.\nBenefit Clear Gloss.\n\n\nIG @dahyeshka',235,0,NULL,'2013-10-31 17:36:40',1,'3-ways-to-apply-clio-lipnicure'),(6,'Bad Girl Makeup','http://www.youtube.com/embed/drySvyxEtp4',NULL,'http://img.youtube.com/vi/drySvyxEtp4/0.jpg','1',11,'2013-11-14 04:39:53','2014-01-01 22:02:55','drySvyxEtp4','IG @dahyeshka',151,0,NULL,'2013-08-28 03:39:20',1,'bad-girl-makeup'),(7,'Red Lips for Fall','http://www.youtube.com/embed/tgZRuguQIHo',NULL,'http://img.youtube.com/vi/tgZRuguQIHo/0.jpg','1',10,'2013-11-14 04:39:53','2014-01-02 02:03:35','tgZRuguQIHo','Used Products:\nBenefit Fakeup\nBenefit Hello Flawless Oxygen Wow Foundation\nBenefit Sugarbomb\nBenefit Creasless Cream Shadow Bikini-Tini\nNars Galapacos\nBenefit Badgal Liner Waterproof Black\nPicasso Eyelash 37\nBenefit Badgal Mascara Waterproof\nBenefit Hydra Smoothlip Color Dare Me\n\nIG @dahyeshka',210,0,NULL,'2013-08-26 14:25:39