tJD5Q',NULL,'http://img.youtube.com/vi/OtrkavtJD5Q/0.jpg','2',24,'2013-11-14 04:41:20','2014-01-02 01:55:55','OtrkavtJD5Q','발칙한루루의 레드 립 메이크업 2\n전에 보여드린 샤넬 레드 립 메이크업(http://www.youtube.com/watch?v=VaC8Tm3W_vw&feature=share&list=UU1dyfwcbZHLGMGd5HshY4fA)과는 살짝 다른 느낌의 레드 립 메이크업이에요. ㅎ 제가 좀 레드 립스틱을 좋아하는 것 같은데요. ㅋㅋ;;;\n\n오늘은 조성아22의 신기한 파우더 팩트로 베이스를 해주고, 샤넬의 한정 아이섀도우에다가 토니모리 제품들로 아이메이크업! 그리고 캐트리스 틴트로 볼터치를 가볍게 해준다음, 조르지오 아르마니의 2가지 립 제품으로 레드 립을 연출해봤어요. 레드 립은 저의 칙칙한 입술을 감춰주고, 피부톤을 환하게 만들어줘서 정말 좋아요! \n\n____________________\n\nFace\n조성아22 멜팅 파우더 팩트 1호\n\nEye\n샤넬 일뤼지옹 동브르 827 INITINATION\n샤넬 일뤼지옹 동브르 837 FATAL\n토니모리 백젤 아이라이너 15호 LATTE BROWN\n토니모리 더블니즈 팡팡 마스카라 03호 롱롱래쉬\n\nCheek\n캐트리스 블러시 틴트 010호 ROSE FLUSH\n\nLip\n조르지오 아르마니 루즈 엑스터시 402호 TEATRO\n조르지오 아르마니 립 마에스트로 400호 THE RED',744,0,NULL,'2013-11-01 13:41:20',1,'red-lip-makeup-2-22'),(25,'(CHANEL) 샤넬 레드 립 메이크업 by 발칙한루루','http://www.youtube.com/embed/VaC8Tm3W_vw',NULL,'http://img.youtube.com/vi/VaC8Tm3W_vw/0.jpg','2',18,'2013-11-14 04:41:20','2014-01-01 22:42:17','VaC8Tm3W_vw','CHANEL Red Lip Makeup \n샤넬 루쥬 알뤼르 135번 컬러가 메인이 되는 메이크업이에요. 레드 컬러도 정말 다양하잖아요. 샤넬 루쥬 알뤼르 135 ENIGMATIQUE (엔니그마티끄) 는 강렬한 브라운 빛 레드 컬러로, 요즘 뜨고 있는 버건디 컬러의 느낌도 나요. 은은하고 신비로운 광채가 마음에 드는 립스틱이더라고요. \n\n그리고 또 네일 컬러도 매력적인 걸 발견했어요. 샤넬 르 베르니 595번 LOUGE MOIRE 컬러인데요. 립 컬러와 네일 컬러를 비슷하게 맞춰줄 수 있어서 더 마음에 들었던 것 같아요. ㅎ 다음엔 섀도우 컬러도 같은 느낌으로 맞춰서 메이크업 해봐야겠어요. \n\n제품들에 대한 자세한 설명은 발칙한루루의 블로그 http://rudelulu.blog.me 에서 곧 만나보실 수 있답니다. 놀러오세용~ :D\n\n__________________\n\nFace \n샤넬 레 베쥬 헬씨 글로우 크림 10호\n샤넬 뿌드르 위니베르셀 리브르 77 MOON LIGHT\n\nCheek\n샤넬 쥬 꽁뜨라스뜨 84 ACCENT\n\nEye\n샤넬 르 쑤르씰 드 샤넬 20 BRUN\n샤넬 레 꺄트르 옹브르 43 MYSTERE\n샤넬 린느 그라피끄 드 샤넬 117 BRONZE\n샤넬 르 볼륨 드 샤넬 40 KHAKI BRONZE\n\nLip\n샤넬 루쥬 알뤼르 135 ENIGMATIQUE\n\nNail\n샤넬 르 베르니 595 ROUGE MOIRE',874,0,NULL,'2013-10-31 03:15:16',1,'chanel-by'),(26,'TONYMOLY) 토니모리 소녀핑크 메이크업 by 발칙한루루','http://www.youtube.com/embed/7NlTnMH-nXk',NULL,'http://img.youtube.com/vi/7NlTnMH-nXk/0.jpg','2',19,'2013-11-14 04:41:20','2014-01-02 00:46:22','7NlTnMH-nXk','TONYMOLY Girl Pink Makeup \n토니모리 제품들을 이용한 소녀핑크 메이크업입니다. \n촉촉한 CC밤으로 피부 표현해주고, 핫한 로즈핑크 컬러의 블러셔로 볼에 생기를~ 그리고 브라운 컬러의 아이라이너 두 가지를 이용해서 아이메이크업을 해주었어요. 마무리는 소녀핑크 컬러 립스틱 바르기! \n\n메이크업 이름은 소녀핑크지만, 전 숙녀?? 언니?? 소녀라고 하기엔 저도 민망해요. 그냥 립스틱 이름이 소녀핑크라는 거~ ㅋㅋㅋㅋㅋㅋ;;; 관련 리뷰는 곧 발칙한루루의 블로그 http://rudelulu.blog.me에 공개될 예정입니다. 보러오세요~ :D',869,0,NULL,'2013-10-29 19:16:46',1,'tonymoly-by'),(28,'캐트리스 버건디 메이크업 (Catrice Burgundy Makeup) by 발칙한루루','http://www.youtube.com/embed/vLp7MLUyjTk',NULL,'http://img.youtube.com/vi/vLp7MLUyjTk/0.jpg','2',31,'2013-11-14 04:41:20','2014-01-01 23:43:06','vLp7MLUyjTk','Catrice Burgundy Makeup\n요즘 대세 컬러 버건디를 활용한 메이크업이에요. \n버건디 컬러를 눈에도 사용하고 입술에도 사용하지만, 그래도 더 자연스러운 느낌은 입술에 사용했을때가 아닌가 그렇게 생각하는데요. 가을이니까 브라운 컬러도 사용하고 싶고! 그래서 눈엔 브라운으로 그윽하게. 입술엔 버건디 립스틱으로 섹시(?)하게 메이크업을 해주고 있답니다. 오늘 사용한 제품들은 모두 캐트리스 제품! 전 캐트리스 C!styler 이니까요. ^^\n\n\n(사용제품 및 관련 링크)\n\nBase : 캐트리스 무스 파운더 011 - http://rudelulu.blog.me/20187755618\nEye :  캐트리스 앱솔루트 누드 팔레트 010 - http://rudelulu.blog.me/20194976926\nTint : 캐트리스 리퀴드 립 틴트 030 - http://rudelulu.blog.me/20191974600\nLipstick : 캐트리스 얼티메이트 컬러 160 - http://rudelulu.blog.me/20191574213',301,0,NULL,'2013-10-23 01:19:58',1,'catrice-burgundy-makeup-by'),(31,'가을메이크업 part2 : 초코브라운&라벤더 아이메이크업 (토니모리 & 스킨푸드)','http://www.youtube.com/embed/4Ncai5XsyHo',NULL,'http://img.youtube.com/vi/4Ncai5XsyHo/0.jpg','2',12,'2013-11-14 04:41:20','2014-01-01 23:01:03','4Ncai5XsyHo','루루의 가을 메이크업 \nDAY MAKE UP part2 : 초코브라운&라벤더 아이메이크업 + 립메이크업 \n10분 내내 얼굴 윤곽만 잡아주다가 두 번째 영상으로 넘어왔어요. 이번엔 메이크업의 꽃! 아이메이크업인데요. ㅎㅎ 스킨푸드 퀸스베이킹 아이 팔레트 요즘 제가 많이 아끼고 있거든요. 라벤더 컬러는 부담스러워서 손이 잘 안 갔는데, 막상 사용해보니까 라벤더와 초코브라운의 조합이 괜찮더라고요. 그리고 립메이크업 할 때 립스틱 전에 틴트를 살짝 발라주면 립스틱 지속력도 높아지고, 또 발색도 더 잘 되는 것 같아서 저는 틴트 바르고, 립스틱을 발라주곤 한답니다.\n\n* 사용제품 : 스킨푸드 퀸스베이킹 초코 스모키 아이 팔레트 4호 디저트 초코 / 아리따움 월드 글램 코팅 틴트 2호 비엔나 / 샤넬 루즈 코코 57 미스티크',649,0,NULL,'2013-09-26 18:45:44',1,'part2'),(32,'가을메이크업 part1 : 윤곽메이크업 + 눈썹 그리기 (토니모리 & 스킨푸드)','http://www.youtube.com/embed/Gv5xZRDLyBw',NULL,'http://img.youtube.com/vi/Gv5xZRDLyBw/0.jpg','2',52,'2013-11-14 04:41:20','2013-12-31 05:08:58','Gv5xZRDLyBw','루루의 가을 메이크업 \nDAY MAKE UP part1 : 윤곽메이크업 + 눈썹 그리기 \n오늘 메이크업 영상은 토니모리와 스킨푸드 제품들을 이용한 가을 메이크업 영상이에요. 가을에 하는 메이크업이니까 어떻게 하든 다 가을메이크업이겠지만, 조금 더 분위기있다고나 할까? 브라운 컬러를 사용하면 더욱 더 가을 느낌이 나는 것 같아요. 거기다 얼굴 윤곽을 잡아주는 음영메이크업을 해주면, 은근슬쩍 얼굴이 조금은 작아보이는 효과가 있더라고요. \n\n* 사용제품 : 토니모리 루미너스 생기광채 씨씨크림 / 스킨푸드 퀸스베이킹 비타 컨투어링 피니쉬 2호 웜베이지 / 스킨푸드 퀸스베이킹 초코 스모키 듀얼 브로우 01 라이트 브라운',575,0,NULL,'2013-09-26 17:35:02',1,'part1'),(33,'[CHANEL] 샤넬 메이크업 2013 가을 컬렉션 신제품으로 한 FW 메이크업','http://www.youtube.com/embed/RzPahCf-6KA',NULL,'http://img.youtube.com/vi/RzPahCf-6KA/0.jpg','2',11,'2013-11-14 04:41:20','2014-01-02 01:10:29','RzPahCf-6KA','CHANEL 2013 FALL MAKEUP\n샤넬의 2013년 가을 메이크업 컬렉션 - \'수퍼스티션 컬렉션\'\n가을 컬렉션 답게 시크하면서도 우아한 여성미가 넘치는 것이 특징인데요. 우아하기만 하진 않아요. 립과 블러셔는 컬러에서 경쾌함이 느껴져요. 카키와 브론즈 컬러로 완성한 눈매, 그리고 오렌지 애프리콧 컬러로 표현한 볼과 입술. 그리고 손끝에서는 차콜 그레이가 살짝 가미된 카키와 메탈릭 효과가 더해진 카키골드 컬러의 네일이 함께합니다. 좀 더 디테일한 사진은 블로그에 곧 개시될 예정입니다. \n\n발칙한루루의 블로그\nhttp://rudelulu..blog.me',352,0,NULL,'2013-08-04 14:27:01',1,'chanel-2013-fw'),(35,'간단한 아이 메이크업으로 또렷한 눈매 만들기','http://www.youtube.com/embed/ho5K5CrTIj8',NULL,'http://img.youtube.com/vi/ho5K5CrTIj8/0.jpg','2',12,'2013-11-14 04:41:20','2014-01-01 23:08:38','ho5K5CrTIj8','EYE MAKE-UP\n간단한 아이 메이크업으로 또렷한 눈매 만들기\n마스카라랑 아이라이너는 아이 메이크업에서 절대 빠질 수 없는 아이템인데요. 이 두 가지면 간단하게 또렷한 눈매로 변신 가능! 너무 간단한 거 올렸나 싶어요. ㅎ\n\n블로그에도 놀러오세요.\nhttp://rudelulu.blog.me',94,0,NULL,'2013-07-21 06:29:03',1,'--2'),(42,'Eyebrow Make-up : 눈썹 그리기 완전 기초','http://www.youtube.com/embed/EXa5lh7tYdU',NULL,'http://img.youtube.com/vi/EXa5lh7tYdU/0.jpg','2',24,'2013-11-14 04:41:20','2013-12-29 12:45:09','EXa5lh7tYdU','Eyebrow Make-up Basic\n눈썹 그리기 완전 기초\n\n숱이 많아 보였으면 하는 모나리자 눈썹을 가진 발칙한루루의 눈썹 그리기 영상이에요. 요즘엔 그나마 눈썹 반영구 시술을 받아서 숱이 조금은 생긴 건데, 그래도 눈썹 중간중간이 비어 보이기 때문에 아이브로우 메이크업은 메이크업 필수 코스! 그렇다고 숱댕이 눈썹은 어색해서 정말 가볍게 가볍게 터치터치 하는 방법으로 눈썹을 그려준답니다. 그리고 펜슬로만 그려도 좋긴 한데, 눈썹 마스카라를 사용하다보니 안쓰면 허전하더라구요. 헤어 컬러와 비슷한 컬러의 제품들을 쓰는 것도 좋지만, 너무 빈약할 때는 살짝 짙은 컬러로 바탕을 깔아주는 것도 좋은 것 같아요.\n\n발칙한루루 Blog - http://rudelulu.blog.me',36,0,NULL,'2013-07-11 05:27:49',1,'eyebrow-make-up'),(45,'동공미인 메이크업 part1 베이스 메이크업 with 라비다(LAVIDA)','http://www.youtube.com/embed/n2kLtJUqQws',NULL,'http://img.youtube.com/vi/n2kLtJUqQws/0.jpg','2',14,'2013-11-14 04:41:20','2014-01-01 23:40:08','n2kLtJUqQws','동공미인 메이크업 part1 베이스 메이크업\n\n조성아22와 라비다 제품을 이용한 메이크업이예요. (밤에 한 잔 하고 잤더니 얼굴 부은게 빠지질 않아서 얼굴이 땡땡해서 거북 ㅠㅡㅠ 이해해주시고용~ ㅋ) 라비다 비비크림 팩트는 CC크림도 곁들이고 있어서 더 촉촉하고 화사한 것 같더군요. 게다가 사선모양의 브러쉬는 초보자도 쉽게 사용할 수 있는 메이크업브러쉬라서 쓰기 좋았어요. 쉽지만 피부표현은 제대로 할 수 있는 제품들이 아니었나 하는 생각이 듭니다. ^^ 관련 제품 리뷰는 발칙한루루의 블로그 http://rudelulu.blog.me 에 곧 업로드할 예정이예요. 놀러오세용. ㅎ\n\n*사용제품 : 라비다 바이탈 리커버리 비비 크림 팩트 위드 씨씨 베이스 / 라비다 파운데이션 브러쉬 바이 김하늘 / 라비다 루미너스 솔루션 듀얼 컨실러',490,0,NULL,'2013-05-29 08:27:02',1,'part1-with-lavida'),(46,'동공미인 메이크업 part2 아이 메이크업 with 조성아22','http://www.youtube.com/embed/-VLXIu2QZBg',NULL,'http://img.youtube.com/vi/-VLXIu2QZBg/0.jpg','2',20,'2013-11-14 04:41:20','2014-01-01 22:12:16','-VLXIu2QZBg','동공미인 메이크업 part2 아이 메이크업\n\n동공미인(瞳孔美人) 메이크업은 조성아22 제품명에서 따온 이름이예요. 네이밍 센스에 감탄! ㅋ 조성아22 제품들을 활용한 메이크업을 해보고 싶어 시도했는데요. 과감하게는 못해보고 음영섀도우 정도만 써봤어요. 동공미인 락키트에 들어있는 형광펜 모양의 볼륨마스카라는 비 오는 축축한 날씨에도 번짐이나 흐트러짐이 없더군요. 여름 메이크업에 사용해도 좋을 그런 제품인 것 같아요. 사용제품들에 대한 자세한 후기는 발칙한루루의 블로그 http://rudelulu.blog.me 에 업로드할 예정입니다. 나중에 놀러오세요~:D\n\n*사용제품 : 조성아22 동공미인 락킹 볼륨 마스카라 블랙 / 조성아22 핑거 플레이 키트 13 #04 Peanut Butter & #05 Cotton Blossom & #03 Full Moon Party (글리터) / 아리따움 워터프루프 다이아몬드 아이 펜슬 #스윗 카카오',591,0,NULL,'2013-05-29 08:27:01',1,'part2-with-22'),(47,'동공미인 메이크업 part3 눈썹마스카라 & 립스틱 with 조성아22 & 라비다(LAVIDA)','http://www.youtube.com/embed/AeviX4YSX4c',NULL,'http://img.youtube.com/vi/AeviX4YSX4c/0.jpg','2',13,'2013-11-14 04:41:20','2014-01-01 23:24:42','AeviX4YSX4c','동공미인 메이크업 part3. 인상을 좌우하는 눈썹, 그리고 입술\n\n2번째 영상까지 봐도 얼굴이 엄청 이상했을거예요. 그..쵸?? 저처럼 눈썹이 없는 분들은 눈썹 없이 밖에 나가기가 많이 꺼려지실 텐데요. 마지막 세 번째 영상에서는 드디어! 눈썹을 그려줍니다. 다른 메이크업을 했어도 눈썹이 없으면 이상한데, 눈썹 마스카라를 이용해서 눈썹을 빗어주고, 빈 부분을 채워주면 사람 다워져요. 사용한 제품은 조성아 22 동공미인 브로우 메이커 브라운 컬러입니다. 브러쉬가 독특하게 생겼죠? 워터프루프 제품이라 여름에 쓰기에도 좋아요.\n\n그리고 모든 메이크업에서 빠지면 이상한 것 또 하나! 바로 입술에 컬러를 더해줘야 합니다. 라비다 글램 3 익스트림 소프트 립스틱 #10 글램 핑크 컬러를 사용해줬어요. 전 이렇게 강렬한 컬러가 좋아요.♡ 자세한 사용후기는 역시 저의 블로그 http://rudelulu.blog.me 에서 확인해주세요.\n\n*사용제품 : 조성아22 동공미인 브라우 메이커 #브라운 / 라비다 글램3 익스트림 소프트 립스틱 #10 글램핑크',466,0,NULL,'2013-05-29 08:26:59',1,'part3-with-22-lavida'),(48,'샤넬 헬씨 글로우 메이크업 part2 아이&립 메이크업 샤넬 헬씨 글로우 메이크업 part2 아이&립 (CHANEL LES BEIGES HEALTHY GLOW MAKE-UP)','http://www.youtube.com/embed/JIltoFKDnCc',NULL,'http://img.youtube.com/vi/JIltoFKDnCc/0.jpg','2',11,'2013-11-14 04:41:20','2014-01-01 23:59:09','JIltoFKDnCc','CHANEL\nLES BEIGES HEALTHY GLOW MAKE-UP \npart2. eye & lip make-up\n\n샤넬의 신상 레 베쥬 라인 두 가지 제품을 활용해서 건강하고 윤기있는 피부로 베이스 메이크업을 해 준 다음, 메이크업을 마무리해야겠죠? 기본적인 아이메이크업에 립스틱 하나 바르고 헬씨 글로우 메이크업은 마무리짓습니다. \n\n*사용제품 : 아리따움 다이아몬드 아이펜슬 워터프루프 #스윗카카오 / 블링크 튜브 마스카라 / 샤넬 루즈 코코 샤인 #79 SAGA',405,0,NULL,'2013-05-27 05:20:21',1,'part2-part2-chanel-les-beiges-healthy-glow-make-up'),(49,'샤넬 헬씨 글로우 메이크업 part1 베이스 메이크업 (CHANEL LES BEIGES HEALTHY GLOW MAKE-UP)','http://www.youtube.com/embed/cOsNXU7oKUc',NULL,'http://img.youtube.com/vi/cOsNXU7oKUc/0.jpg','2',12,'2013-11-14 04:41:20','2014-01-01 22:56:22','cOsNXU7oKUc','CHANEL\nLES BEIGES HEALTHY GLOW MAKE-UP \npart1. base make-up\n\n샤넬의 신상 레 베쥬 라인 두 가지 제품을 활용해서 건강하고 윤기있는 피부로 베이스 메이크업을 해봤습니다. 별 다른 기술이 없어도 샤넬 레 베쥬를 바르면 피부에서 건강함이 느껴지는 빛이 나더라구요. 쉽게 아웃도어 메이크업이 가능한 제품들이라서 아주 마음에 든답니다. ^^ 자세한 사용 후기는 발칙한루루 블로그 - http://rudelulu.blog.me/20188002714 에서 확인하실 수 있어요.\n\n*사용제품 : 샤넬 레 베쥬 올인원 헬씨 글로우 크림 (베이지크림/아시아한정출시) & 샤넬 레 베쥬 헬씨 글로우 쉬어 파우더 (베이지 컴팩트)',477,0,NULL,'2013-05-27 04:59:25',1,'part1-chanel-les-beiges-healthy-glow-make-up'),(53,'Pony\'s Beauty Diary -- Sandara makeup (with English subs) 산다라박메이크업          ','http://www.youtube.com/embed/-TXdEwPZA3w',NULL,'http://i1.ytimg.com/vi/-TXdEwPZA3w/hqdefault.jpg','3',13,'2013-11-14 04:42:14','2014-01-01 23:13:56',NULL,NULL,NULL,NULL,NULL,NULL,1,'pony-s-beauty-diary-sandara-makeup-with-english-subs'),(54,'Pony\'s Beauty Diary -- Interview makeup (with