6-12i9G8',NULL,'http://img.youtube.com/vi/pHC6-12i9G8/0.jpg','22',24,'2013-11-14 08:38:25','2014-01-02 01:16:20','pHC6-12i9G8','[BEAUTYMEETS * Beautystar] Beauty blogger 김다혜\n\n뷰티밋츠의 세 번째 뷰티스타, 뷰티블로거 김다혜 님이 추천하는 레드메이크업 셀프 튜토리얼 영상이에요. 여성분들의 로망인 레드립스틱을 활용한 섹시한 메이크업입니다. \n\n온라인 튜토리얼과 오프라인 클래스를 통해 메이크업 노하우를 가진 메이크업 아티스트, 뷰티 블로거를 만나서, 더 쉽고 재밌게 메이크업을 배우고 예뻐지세요 :D\nwww.beautymeets.com\n\n\n▶ 김다혜 님의 뷰티밋츠 페이지에 방문하기\nhttp://www.beautymeets.com/stars/3',207,0,NULL,'2013-03-12 02:44:23',1,'beautymeets-beautystar-beauty-blogger-dahyeshka-makeup-tutorial'),(624,'컴플렉스 박멸 시리즈#3: 링클케어 - Bye-bye Complex Series#3: Daily Wrinkle Prevention!','http://www.youtube.com/embed/XTjz-XS7Nlg',NULL,'http://img.youtube.com/vi/XTjz-XS7Nlg/0.jpg','23',14,'2013-11-14 08:53:16','2014-01-01 22:14:56','XTjz-XS7Nlg','시간 날 때마다 조금씩 하면 빛을 발하는 링클케어! \n정샘물 아티스트 그룹이 애용하는 데일리 링클케어 비법을, 정샘물 인스피레이션의 엄아영 아티스트가 직접 공유합니다 ;) \n\nToday, we share a short, simple beauty routine Jungsaemmool Artist Group practices in their daily lives.\nJust like any other practices, Jungsaemmool Artists pursue soft, gentle application on the skin; especially true when it comes to wrinkle care. Here, Jungsaemmool Makeup Artist, Um Ah-Young demonstrates this preventive-anti-aging massage, derived from acupuncture-practices, herself. \n*One-word summary: gently press-uplift diagonally opposite to the wrinkle\'s direction!',123,0,NULL,'2013-11-07 13:19:34',1,'3-bye-bye-complex-series-3-daily-wrinkle-prevention'),(625,'Celebrity Style#5: 아만다 사이프리드 - Yet-Another Beautiful: Amanda Seyfried','http://www.youtube.com/embed/GEM8mWySDgw',NULL,'http://img.youtube.com/vi/GEM8mWySDgw/0.jpg','23',16,'2013-11-14 08:53:16','2014-01-02 00:54:20','GEM8mWySDgw','과감한 연기 도전을 꺼리지 않는 그녀, 또다른 배우의 드라마틱한 인생을 그리다. \n당돌하고 호기심 많은 섬마을 소녀에서 치명적 팜므 파탈로. 사랑에 고민하는 현대의 줄리엣들에게 격려를 보내는 따뜻한 작가 지망생에서, 만들어진 이미지와 실제 \'나\' 의 간극에 고민하던 여배우, 러브레이스로 거듭난 아만다 사이프리드. 그녀의 시그니처 룩을 재현했습니다 :)\n\nFrom a daring-sweet-darling bride-to-be girl, to femme fatale seducing a doubtful housewife. Then, yet another warm, questioning wanna-be-writer who writes back to the letters sent to Juliet. Now, returning as the actress who suffered between expected-self and true-self. Recreating one of her many, incomparable all-too-beautiful images: Amanda Seyfried. :)',255,0,NULL,'2013-11-04 23:10:56',1,'celebrity-style-5-yet-another-beautiful-amanda-seyfried'),(626,'새로운 발견 시리즈#1: 면봉, 이렇게도 쓸 수 있다! - the Hyde-Side Of...Series#1: the Hyde-Side of Cotton Buds/Swab','http://www.youtube.com/embed/pKlFn0kQRNs',NULL,'http://img.youtube.com/vi/pKlFn0kQRNs/0.jpg','23',31,'2013-11-14 08:53:16','2014-01-01 22:10:30','pKlFn0kQRNs','\"명장은 연장 탓하지 않는다\"~! 최고의 메이크업 도구가 풀셋트로 갖춰져 있더라도, 때로는 가장 필요했던 바로 그 툴이 하필이면 빠져 있을 때도 있지요! 그럴 때, 주어진 환경과 자원을 센스있게 활용하는 프로 메이크업 아티스트의 재치만점 노하우를 공유하는, 새로운 발견 시리즈! 그 첫번째, \"브러시 대신 면봉\" 활용법을 공개합니다! :) \n+팁: 위급상황! 구원투수인 면봉조차도 똑 떨어지고, 딱 한 개밖에 안 남았다면? 머리 부분, 넓은 면, 막대 등, 면봉의 부분부분을 십분백분 활용해보기! \n\n\"Like Dr. Jekyll, there are many faces to a single tool...\"\nOnce in a while, there is an occasion a professional makeup artist is short of the very tool/resource s/he planned to use to create a look. Most common example: bringing the wrong brush-set X0! \nToday, we Jungsaemmool Artist Group came back with Episode \"Cotton Bud/Swab\" of the new series, \"The Hyde-Side Of...\", sharing the real-life cases in which MUAs had to improvise and make use of whatever is available on the scene, turning common tools into full makeup assistance :)',114,0,NULL,'2013-10-31 12:07:15',1,'1-the-hyde-side-of-series-1-the-hyde-side-of-cotton-buds-swab'),(627,'Celebrity Style#4: 남상미 결혼의 여신 메이크업 - Nam, Sang-Mi\'s \"Goddess of Marriage\" Song, Ji-Hye Makeup','http://www.youtube.com/embed/KcgR8dEQS9Y',NULL,'http://img.youtube.com/vi/KcgR8dEQS9Y/0.jpg','23',36,'2013-11-14 08:53:16','2014-01-02 00:31:32','KcgR8dEQS9Y','*Correction Announcement:\ndear friends, as some sharp eyes have noticed, the image of the mascara used has been inserted incorrectly; the main mascara used is \"Good-bye Black Smudge Waterproof Mascara\", #2, from VOV. Thank you for pointing out!\n\n지적이고 당찬 라디오 작가의 당당한 멋에서 사랑과 시련으로 그윽해진 여인까지, 변화하는 아름다움을 보여주는 \"결혼의 여신\"의 그녀, 남상미! \n단정한 베이스에 은은한 깊이감, 선명한 립으로 확고한 존재감을 주장하는 그녀의 메이크업을 공개합니다!\n\nFrom simple and edgy to sophisticated and elegant - Nam, Sang-Mi, playing the role of Song, Ji-Hye, shows it all throughout a single drama, \"Goddess of Marriage.\" Today, her very own Makeup Artist, Kwon, Hee-Sun, reproduces Song, Ji-Hye\'s signature look. \n\nP.S: to our friends especially curious about the lip color / product name Nam, Sang-Mi used...YES, we Jungsaemmool Artist Group open it-up ALL... \n\nSkip 02:37 if you can\'t wait anymore to find out! ;)',182,0,NULL,'2013-10-23 14:34:42',1,'celebrity-style-4-nam-sang-mi-s-goddess-of-marriage-song-ji-hye-makeup'),(628,'컴플렉스 박멸 시리즈#2: 얇은 입술 보정법 - Bye-bye Complex Series#2: Plump-up Lips!','http://www.youtube.com/embed/5oPc9bSvn3E',NULL,'http://img.youtube.com/vi/5oPc9bSvn3E/0.jpg','23',15,'2013-11-14 08:53:16','2014-01-02 01:01:18','5oPc9bSvn3E','평범한 민자 모양의 입술이 밋밋해서 불만이었다면? 컨실러와 센터-볼륨을 통한 플럼프-립!\n\n입술의 형태가 납작해서 립 메이크업을 해도 입체적이거나 생기 있어 보이지 않는 분들을 위해 준비한 컴플렉스 박멸 시리즈#2, 얇은 입술 보정 튜토리얼입니다 :) \n*간편 팁: 완성하고 싶은 입술 모양을 떠올리고, 생각하고 있는 입매에 맞도록 립 컨실러로 깔끔하게 입매를 정돈하는 것은 필수! ;)  \n\nBye-bye, Complex Series#2! \nFor those who may have thought \'Yes, overall, there is no PROBLEM with the lip shape. I know. But...\'\nSome worry about the overall-flat-shaped lip, which flattens the lip makeup whatever color is put. Yes, there is no OBVIOUS problem with the lip, but, if you don\'t like the look, here is how to control the complexion: utilize lines, colors, and texture of makeup product to draw a lip shape to your likings ;)  \nShort tip: fill-in the lips throughly with lip pencil first, and add extra gloss on the inner corner of the lips to build the PLUMP-effect!',133,0,NULL,'2013-10-12 10:45:38',1,'2-bye-bye-complex-series-2-plump-up-lips'),(629,'Celebrity Style#3.5: 스피카 Tonight 헤어 팁 - SPICA\'s M/V Tonight Hair Tip','http://www.youtube.com/embed/zE9e1Hxw1rM',NULL,'http://img.youtube.com/vi/zE9e1Hxw1rM/0.jpg','23',17,'2013-11-14 08:53:16','2014-01-02 00:20:06','zE9e1Hxw1rM','스타일, 음악, 삶...새로운 도전을 시작한 스피카의 지난주 M/V \"Tonight\" 메이크업 팁에 이어, 동일 M/V에서 선보인 헤어 팁입니다. \n\nCelebrity Style#3.5: SPICA\'s M/V \"Tonight\" Tip! \nFollowing the previous clip comes the hair tip SPICA presented on the same M/V! Find out how to apply the it-product of the year, color chalk, to give vibrant color effects! (The same product has been heavily used to create the jewel-like looks of SNSD\'s M/V, \"I got a Boy\", as well!)',92,0,NULL,'2013-10-08 03:06:22',1,'celebrity-style-3-5-tonight-spica-s-m-v-tonight-hair-tip'),(630,'Celebrity Style#3: 스피카 Tonight 메이크업 - SPICA\'s M/V Tonight Makeup','http://www.youtube.com/embed/XqoYFOMmChE',NULL,'http://img.youtube.com/vi/XqoYFOMmChE/0.jpg','23',63,'2013-11-14 08:53:16','2014-01-02 04:25:00','XqoYFOMmChE','X-언니, 이효리의 세심한 어드바이스와 함께 새로운 도전을 시작한 스피카! 자유롭고 당당하며 따뜻한 감성을 가진 그녀들의 모습을 담아낸 M/V, \"Tonight\"의 깊고 부드러운 메이크업입니다. \n\nCelebrity Style#3: SPICA\'s M/V \"Tonight\" Makeup! \nFollowing the previous Celebrity Style#2: Lee Hyori\'s X-sister Makeup, comes her junior-sisters SPICA! Consulted and produced by Hyori herself, let\'s see how Hyori\'s junior-fellow-artist (from the same agency) style and makeup evolved, following Hyori\'s advice and Jungsaemmool Artist Group\'s assistance!',253,0,NULL,'2013-10-02 09:43:07',1,'celebrity-style-3-tonight-spica-s-m-v-tonight-makeup'),(631,'컴플렉스 박멸 시리즈#1: 붕어눈 커버 - Bye-bye Complex Series#1: Makeup for Swollen-looking Eyes','http://www.youtube.com/embed/HO6LGMaj2AM',NULL,'http://img.youtube.com/vi/HO6LGMaj2AM/0.jpg','23',11,'2013-11-14 08:53:16','2014-01-02 02:03:12','HO6LGMaj2AM','크고 진한 쌍커풀을 부러워하는 사람들에게는 말 못할 혼자만의 고민, 붕어눈! \n둥글고 겹이 진 눈매로 인해, 졸리고 둔해 보이는...엣지있는 메이크업을 해도 잘 살아나지 않아 속상했던 분들을 위해 준비한 컴플렉스 박멸 시리즈#1, 붕어눈 커버 튜토리얼입니다 :) \n*간편 팁: 원래 눈의 쌍커풀이 라인이 두껍다면, 아이라인은 최대한 얇게, 점막 쪽에 밀착하듯이! \n\nBye-bye, Complex Series#1! \nMany people wish to have wide, clear-cut double lids. But sometimes, it is that very same facial feature that makes some girls suffer from looking sleepy and swollen. Here\'s an easy guide those girls on which point of the eye to concentrate when putting makeup. Short tip: fill-in very thin and closely to the waterline, and extra mascara on the inner corner of the eye!',116,0,NULL,'2013-09-26 01:43:30',1,'1-bye-bye-complex-series-1-makeup-for-swollen-looking-eyes'),(632,'Celebrity Style#2: 이효리의 X언니 메이크업 - Lee Hyori\'s X-sister Makeup','http://www.youtube.com/embed/3Zi3KJTykfQ',NULL,'http://img.youtube.com/vi/3Zi3KJTykfQ/0.jpg','23',11,'2013-11-14 08:53:16','2014-01-02 00:35:40','3Zi3KJTykfQ','후배 아티스트 SPICA와 함께 인생의 \"스타일\"을 찾아내고 업그레이드하는 방식을 공유한 멋진 언니, 이효리! 당당하면서 소탈하고, 멋지지만 친근한 그녀가 후배들에게 몸소 보여준 그녀다운 스타일, X-언니 메이크업을 공유합니다 :) \n\nTHE artist who fellow-and-junior artist turn to when they are lost in their journey towards STYLE: Lee Hyori! Never hesitating in sharing, advising, and SHOWING her thoughts about art, life, fashion, beauty and SELF, Jungsaemmool Artist Group presents Lee Hyori\'s \"X-sister Makeup\", which she wore during guiding her fellow artist group, SPICA, in the beauty-show \"X-Sister\". \n\nIf you are curious how well her \"students\" improved in terms of style, getting her very personal style lectures, check out SPICA\'s new single MV, \"Tonight\"! ;)   \n\n*SPICA\'s \"Tonight\" Official M/V link: \nhttp://youtu.be/6VSpBPqBJF8',228,0,NULL,'2013-09-20 05:46:59',1,'celebrity-style-2-x-lee-hyori-s-x-sister-makeup'),(633,'Celebrity Style#1: 미란다 커 메이크업 - Miranda Kerr Makeup','http://www.youtube.com/embed/OaT_TEDjHLo',NULL,'http://img.youtube.com/vi/OaT_TEDjHLo/0.jpg','23',34,'2013-11-14 08:53:16','2014-01-01 22:59:33','OaT_TEDjHLo','결혼해도, 아이를 낳아도, 변함없이 스타일리시하고 아름다운 그녀, 미란다 커! 얼마 전 방한 시에도 빅토리아 시크릿 모델 출신다운 스타일과 멋진 룩을 보여준 미란다 커의 메이크업을 정샘물 아티스트 그룹이 재현합니다 :) \n\nAmong most beloved-global stars in Korea, Miranda Kerr has an outstanding presence for her glamorous, stylish, unique looks. Celebrating her visits to Korea, Jungsaemmool Artist Group recreated one of her signature looks.',244,0,NULL,'2013-09-14 02:10:01',1,'celebrity-style-1-miranda-kerr-makeup'),(634,'브론징 메이크업 Healthy Bronzing Makeup','http://www.youtube.com/embed/M6_cGzLdAdI',NULL,'http://img.youtube.com/vi/M6_cGzLdAdI/0.jpg','23',18,'2013-11-14 08:53:16','2014-01-01 22:09:31','M6_cGzLdAdI','선선한 바람이 불어오지만 아직도 뜨거운 햇볕 아래서, 여름의 마지막 느낌을 만끽하는 건강하고 자연스러운 브론징 메이크업을 공유합니다. 여름을 마무리하는 마지막 연휴 동안 바다로 떠날 계획이 있다면, 정샘물 아티스트 그룹의 최대균 부원장님이 선보이는 헬시 브론징 메이크업을 강!추!드려요~:)\n\nKorea\'s summer is coming towards its end: the grand FINALE - event would be the lunar thanksgiving holidays! If you have plans to enjoy the final sun-kiss-and-waves during the lunar holidays, here\'s THE look Jungsaemmool Artist Group recommends to wear on site: a healthy, natural bronze-sun-kissed face presented by Tche, Daekyoun, the V.Chief Makeup Artist of Jungsaemmool Inspiration EAST. \n\nHappy Lunar Thanksgiving Holidays to all who celebrate the event! :)',174,0,NULL,'2013-09-03 01:31:50',1,'healthy-bronzing-makeup'),(635,'3D 입체윤곽 베이스 - 3D Face Base-Makeup','http://www.youtube.com/embed/_Er81g52h1Q',NULL,'http://img.youtube.com/vi/_Er81g52h1Q/0.jpg','23',20,'2013-11-14 08:53:17','2014-01-02 01:42:25','_Er81g52h1Q','자연스럽게 작고 입체적인 얼굴을 연출하는 베이스 테크닉! 얼굴이 작아보이는 베이스 메이크업의 핵심 포인트와 터치를 정확히 짚어주는 정샘물 아티스트 그룹의 팁이 온전히 담긴 3D 입체윤곽 베이스 튜토리얼입니다 :) \n\nOne of the key - makeup techniques professionals-only could tell: base makeup. This tutorial, based on the KOD7 \"Thin & Thick\" of Jungsaemmool Artist Group, guides the key parts and the optimal amount/touch to create an even face.',112,0,NULL,'2013-08-28 08:16:14',1,'3d-3d-face-base-makeup'),(636,'아이스 멀티 틴트 - Introducing the Ice-Multi Tint','http://www.youtube.com/embed/uh0U3vViTWo',NULL,'http://img.youtube.com/vi/uh0U3vViTWo/0.jpg','23',36,'2013-11-14 08:53:17','2014-01-02 05:10:43','uh0U3vViTWo','2013년 뮬의 여름 신상품! 립과 치크에 톡톡, 발라서 완성하는 썸머 컬러 - 미스코리아 레드, 미란다 오렌지의 \"아이스 멀티 틴트\" 룩을 소개합니다 :) \n\nIntroducing the simple color suggestions for MULE\'s summer makeup! The 3-multi-tint colors - Miss Korea Red, Miranda Orange, Twiggy Pink (2 of them used in this tutorial) - that  can be used on cheek, lips and eyes as well :) \n\nCompleting the makeup with the new extra-summer Aqua Fixer from MULE would enable an untainted face that lasts through sweat and heat! :)',162,0,NULL,'2013-08-20 02:04:56',1,'introducing-the-ice-multi-tint'),(637,'한혜진 웨딩 메이크업 - Actress Han Hyejin\'s Bridal Makeup','http://www.youtube.com/embed/QvjVszbMK4A',NULL,'http://img.youtube.com/vi/QvjVszbMK4A/0.jpg','23',19,'2013-11-14 08:53:17','2014-01-02 00:40:45','QvjVszbMK4A','7월 1일, 기성용 선수와 웨딩마치를 올린 배우 한혜진 씨! 행복한 그 날, 그녀의 투명하고 단아한 아름다움을 살린 웨딩 메이크업을 재현했습니다 :) \n\nCongratulating her happy marriage to soulmate Ki Sungyong on July 1st, Jungsaemmool Inspiration has created actress Han Hyejin\'s bridal makeup for her wedding photo and her wedding days :) Hereby we share the beautiful look of that day and the how-to with our friends on youtube. Please enjoy!',190,0,NULL,'2013-08-11 02:18:54',1,'actress-han-hyejin-s-bridal-makeup'),(639,'수지 메이크업 - Korea\'s Sweet-heart Look','http://www.youtube.com/embed/Z3QqBikO_Xw',NULL,'http://img.youtube.com/vi/Z3QqBikO_Xw/0.jpg','23',23,'2013-11-14 08:53:17','2014-01-02 00:18:18','Z3QqBikO_Xw','귀여운 국민 여동생에서, 순수한 첫사랑...그리고 사랑스럽고도 당당한 무예교관까지, 팔색조의 매력을 보여주는 missA의 수지! 맑고 깨끗한 수지의 매력을 살려주는 퓨어하고 또렷한 메이크업 노하우를 공유합니다 :)\n\nSuzie from missA, also known as THE girl of her age, distinguishes herself by keeping up her pure, lovely looks, among more fierce, sexy idol groups around her age. We, Jungsaemmool Artist Group strongly encourage our friends and fans to wear makeup in a way that she/he feels most comfortable about her/himself - but just for your information -- this look of Suzie was and IS voted as the no.1 look wanted by guys on their girlfriends :)',214,0,NULL,'2013-07-31 15:07:16',1,'korea-s-sweet-heart-look'),(640,'입체 베이스 만들기- Small-Face Trick Using Foundation ONLY','http://www.youtube.com/embed/Vxx_MhJQGzw',NULL,'http://img.youtube.com/vi/Vxx_MhJQGzw/0.jpg','23',19,'2013-11-14 08:53:17','2014-01-01 22:35:13','Vxx_MhJQGzw','바쁜 아침, 차가운 숟가락으로도 얼굴 붓기가 채 가시지 않을 때...오로지 파운데이션만으로 얼굴을 반쪽으로 만드는 기적의 트릭, 정샘물 아티스트 그룹의 \"입체 트릭 베이스 메이크업\"을 공유합니다! 여기에 브론즈 파우더를 살짝 더해준다면 여름의 태양에 걸맞는 건강한 피부 태닝 효과까지 누릴 수 있겠죠? ;) \n\nWondered how Jungsaemmool Artist Group made Martina\'s sharp face when transforming her into \"BAD GIRL\"? Here\'s the wonder Makeup Artist Kim, Yoon-Young plays: drawing out the beauty of one\'s own facial lines dramatically, JUST using foundation ONLY. Click to see how Jungsaemmool Artist Group make the face small and shine!',115,0,NULL,'2013-07-23 10:12:20',1,'small-face-trick-using-foundation-only'),(641,'워터프루프 메이크업- Ultimate Waterproof Makeup','http://www.youtube.com/embed/8Su0iztmQYE',NULL,'http://img.youtube.com/vi/8Su0iztmQYE/0.jpg','23',10,'2013-11-14 08:53:17','2013-12-30 05:42:01','8Su0iztmQYE','Summer in Asia seems to combine moisture and oiliness in the worst possible way -- over-humidity in the air, and grease in your face. This is why JSM Artist Group has to come up with sophisticated how-to-s to fight-off the oiliness and to keep the makeup fresh-all-day-long. Click to see how each elements work and build-up!',227,0,NULL,'2013-07-18 14:27:44',1,'ultimate-waterproof-makeup'),(642,'셀프모공케어 - Pore Care How-to','http://www.youtube.com/embed/VKvOtg5mbHg',NULL,'http://img.youtube.com/vi/VKvOtg5mbHg/0.jpg','23',44,'2013-11-14 08:53:17','2014-01-02 03:19:22','VKvOtg5mbHg','메이크업의 완성은 피부! 그 중에서도 깨끗하고 매끈한 모공이 필수라고 하죠  ;) 모공 깊숙이 클렌징하고 케어하는 모공 케어 루틴과 제품을 소개합니다. 단기간에 드라마틱한 효과를 보기보다는, 꾸준히 근본적으로 케어하는데 중점을 둔 루틴이랍니다 :)  \n\nThe key to all skin-care routines by Jungsaemmool Artist Group is \"heat-and-freeze\". With this clip, we present how we cleanse-and-tighten the skin using steam and ice, and how we combine products that help these processes. Recently, we make heavy use of a new skin-care brand, which focuses on cooling the skin as best as possible. Click to see what and how!',231,0,NULL,'2013-07-11 13:43:40',1,'pore-care-how-to'),(643,'김태희 썸머 메이크업 Blue Summer & Orange Sherbet Makeup','http://www.youtube.com/embed/7-3R72NgOhY',NULL,'http://img.youtube.com/vi/7-3R72NgOhY/0.jpg','23',11,'2013-11-14 08:53:17','2013-12-25 14:33:06','7-3R72NgOhY','봄의 뒤를 급히 쫓듯, 어느새 여름이 되어 버린 듯한 요즘의 날씨라면, 메이크업 역시 여름을 준비해야 할 듯 하네요. 보기만 해도 시원한 느낌을 줄, 쿨 블루와 상큼한 오렌지 셔벗 모티브의 메이크업 룩입니다 ;)\n\nAnother response to your request: re-creation of some of the most artistic looks shown at the intro of Jungsaemmool beauty tutorial clips. Today, we share the pearl-blue summer look of Kim, Tae-Hee, which was a close-tie to Koo, Hara\'s Lavender-makeup! Friends who voted for Hara\'s look; that look is most likely the candidate for next month\'s shooting, but we can\'t be sure...CL with \"The Baddest Female\" is following very closely these days! :)',194,0,NULL,'2013-07-08 12:15:10',1,'blue-summer-orange-sherbet-makeup'),(644,'수분탱탱 데일리 기초케어 - 홍조편 Fundamental Redness-treatment','http://www.youtube.com/embed/uQdtIGMI7d8',NULL,'http://img.youtube.com/vi/uQdtIGMI7d8/0.jpg','23',56,'2013-11-14 08:53:17','2014-01-02 02:32:50','uQdtIGMI7d8','메이크업으로 잘 가려지지도 않고...조금만 땀 흘리면 울긋불긋, 가렵기까지 한 홍조 트러블! 조금씩, 꾸준히, 근본적으로 피부 밑의 열을 잠재우고 산뜻한 메이크업을 돕는, 정샘물 아티스트 그룹의 스페셜 홍조 케어 비법을 공유합니다! \n\nAnother response clip! We have received many messages from friends who have difficulties with diverse skin care problems, like \"crater-like\" acne scars, wide pores, dark spots, etc...So here we have another skin care clip: 1) how to treat red face, and 2) how to care pores -- and both skin care routines\' keyword is COOLING. If you have other skin care troubles that get in the way of flawless makeup, let us know! :)\n\nLove, Jungsaemmool Artist Group',221,0,NULL,'2013-07-04 15:53:41',1,'fundamental-redness-treatment'),(645,'고준희 음영 메이크업 itGirl Ko, Joon-Hee\'s \"Just Married\" Makeup','http://www.youtube.com/embed/-Ma8kXjLM6M',NULL,'http://img.youtube.com/vi/-Ma8kXjLM6M/0.jpg','23',17,'2013-11-14 08:53:17','2014-01-01 23:01:39','-Ma8kXjLM6M','추적자, 야왕과 우리 결혼했어요, 를 통해 잇걸의 룩과 활약을 보여주는 고준희! 신혼 부부의 상큼함과 사랑스러움을 담아낸 우결의 메이크업 룩, 함께 따라 해 볼까요?  \n\nThe new IT-girl and face of MISSHA, Ko, Joon-Hee is well-known for her lovely-pop-looks, shown through the TV shows like \"Yawang\", \"the Chaser\", and \"Just Married\". Today, Jungsaemmool Artist Group brings her most-up-to-date look on \"Just Married\" -- see how her signature orange-brown hair and orange lips adds color and sweetness to this \"newly-wed\"  \n\nNote: just like BoA, Ko, Joon-Hee has become the new face of the brand MISSHA, which is why we have excluded product information. Thank you for noticing whenever the product info is missing, and especially BIG thanks to those kind friends who answer to other replies in our place. This kindness is a BIG help! \n\nLove, Jungsaemmool Artist Group',251,0,NULL,'2013-06-26 11:27:25',1,'itgirl-ko-joon-hee-s-just-married-makeup'),(646,'아이스 파운실러 메이크업_ MULE\'s Ice Founcealer Makeup','http://www.youtube.com/embed/sLWFED6VSOc',NULL,'http://img.youtube.com/vi/sLWFED6VSOc/0.jpg','23',11,'2013-11-14 08:53:17','2013-12-25 14:32:22','sLWFED6VSOc','아무리 공을 들이고 수정해도, 열기와 습기에 무너지고 답답해지는 메이크업...\n올 여름, 한여름 메이크업의 괴로움에 작별을 고하고, 산뜻함을 되찾아 줄 \n뮬의 신상품, \"아이스 파운실러\" 메이크업을 소개합니다. \n\nGOOD-bye to makeup that gives in to the heat and humidity of summer. Here, we present the BRAND NEW foundcealer that cools, covers, protects and LASTS throughout the melting blazes of the sun: the \"ICE-FOUNDCEALER\" of MULE.',143,0,NULL,'2013-06-17 09:03:26',1,'_-mule-s-ice-founcealer-makeup'),(647,'이효리 메이크업  _ \'LEE HYORI\' Make Up (5th Album Monochrome Jacket look)','http://www.youtube.com/embed/fhe0CkBaCp8',NULL,'http://img.youtube.com/vi/fhe0CkBaCp8/0.jpg','23',12,'2013-11-14 08:53:17','2014-01-02 01:04:52','fhe0CkBaCp8','\"미스 코리아\"와 \"Bad Girls\"로 돌아온 섹시퀸, 이효리! 쓸쓸한 듯, 아련하고 진한 룩에서 강렬하고 섹시한 룩까지, 다양한 느낌과 아름다움을 담아낸 그녀의 Monochrome 룩을 공유합니다.\n\nLee, Hyori\'s come-back album, \"Monochrome\". The look, the feeling and the beauty we have worked with her to show who she really is and what she really wants to share. Here we present -- the monochrome cover look. \n\nHer decade-long friends in her quest for true beauty -- the Jungsaemmool Artist Group',205,0,NULL,'2013-06-10 07:31:24',1,'_-lee-hyori-make-up-5th-album-monochrome-jacket-look'),(648,'웨딩 메이크업 - Bride of May','http://www.youtube.com/embed/AAtuczSbwhQ',NULL,'http://img.youtube.com/vi/AAtuczSbwhQ/0.jpg','23',15,'2013-11-14 08:53:17','2014-01-01 22:46:45','AAtuczSbwhQ','가장 아름다운 계절, 가장 아름다운 여성 - 5월의 신부를 위한 웨딩 메이크업입니다. \n\nMost beautiful lady during the queen-season: Bride of May, we say. But at the same time, May is the month where makeup and makeup artist have to fight off the most extreme weather fluctuation between humid rains and dry, dust-and-pollination-filled sun blazes. \n\nHere we present the essence of Jungsaemmool Artist Group\'s best efforts for the newly-weds on May-days. Hope you like it :)',277,0,NULL,'2013-06-01 03:22:00',1,'bride-of-may'),(649,'\"이효리 Bad Girls\" 메이크업: K-pop 파워블로거 EatYourKimchi 콜라보 프로젝트 - JSM & EYK  Lee Hyori\'s \"Bad Girls\"','http://www.youtube.com/embed/YkQtmZq8nBY',NULL,'http://img.youtube.com/vi/YkQtmZq8nBY/0.jpg','23',10,'2013-11-14 08:53:17','2013-12-25 14:47:23','YkQtmZq8nBY','유투브 K-pop 파워블로거, EatYourKimchi의 마티나와 함께 한 이효리 \"Bad Girls\" 메이크업 룩!    글로벌 돌풍을 일으키는 K-pop! K-pop 스타들의 음악, 스타일, 패션 그리고 메이크업에도 많은 관심을 기울이는 해외 팬들에게 드리는 특별 팁입니다. 이효리의 Bad Girls 룩을 만든 정샘물 인스피레이션의 홍성희 원장님의 족집게 노하우를 한 발, 한 발 따라 변신해볼까요? Bad, Bad, Bad, Bad Girl! \n\nK-pop, Makeup, and EatYourKimchi all-in-one! \nHope you enjoy Queen Hyori\'s ferocious transformation into \"Bad Girl\"!\n\nMore clips will follow on how to apply the most-beloved and up-to-date looks of K-pop Stars on non-Korean models. Many thanks to the nasty EYK Duo, Simon & Martina - we couldn\'t imagine anyone who fits better and nastier to this look :)\n\n+yes...we did not give up yet on inviting SIMON into this project next time. Nasty as they may be, they are one of the MOST responsive and interacting people we\'ve ever met, when it comes to fans\' & friends\' ideas. So let us show our strength by not giving up posting ideas, replies, tweets on how much we love guy-liner! :S\n\nLet\'s do this. right away. on the following link: \nhttp://youtu.be/V82CwQ5UD2E',199,0,NULL,'2013-05-25 07:07:28',1,'bad-girls-k-pop-eatyourkimchi-jsm-eyk-lee-hyori-s-bad-girls'),(651,'직장의 신 김혜수 헤어_Kim Hye-Soo\'s Hair Style from \"God of the Workplace\"','http://www.youtube.com/embed/MHnnVyZJ3-c',NULL,'http://img.youtube.com/vi/MHnnVyZJ3-c/0.jpg','23',15,'2013-11-14 08:53:17','2014-01-01 21:41:55','MHnnVyZJ3-c','힘, 능력, ...유연성과 쇼맨십! 무엇 하나 빠지지 않았던 미스 김과 함께 한 \"직장의 신\"도 이제 그랜드 피날레를 앞두고 있네요. 아쉬운 마음에 준비해봤습니다. 미스 김의 시그니처 헤어. \n\nMon/Tues drama, \"God of the Workplace\" is near the end. Not only her abilities, but her attitude and words have inspired and powered-up the many other Janes (or, \"Miss-Kim\", in Korean) of our daily lives. May wearing her hair style let us remind and power-up ourselves like her...:)\n\nJungsaemmool Artist Group',113,0,NULL,'2013-05-18 05:28:23',1,'_kim-hye-soo-s-hair-style-from-god-of-the-workplace'),(652,'이하이 로즈 메이크업_Lee Hai\'s \"Rose\" Makeup','http://www.youtube.com/embed/-Iqn1nn0Ezc',NULL,'http://img.youtube.com/vi/-Iqn1nn0Ezc/0.jpg','23',11,'2013-11-14 08:53:17','2013-12-29 07:09:52','-Iqn1nn0Ezc','로즈데이를 맞이하여, 꿈처럼 아름다운 장밋빛 메이크업은 어떨까요? 정샘물 아티스트 그룹 수석 메이크업 아티스트, 권희선 원장과 헤어의 성현 디자이너가 선보이는 몽환적인 핑크와 피치톤의 \"이하이 로즈 메이크업\" 입니다 :)\n\nThe long-awaited \"Rose\" Makeup from YG rookie Lee-Hai\'s music video! \nAnother response video upon our friends\' hair & look requests will come up next and the following weeks, \nand the latest requests have been jotted down and prepared for this month\'s filming. \n\nThe production will take place this Thursday; guess which requests have been voted top!\n(hints will be out soon...hehe XD...)\n\nThank you always for being with us and giving all the inspiring ideas! \n\n-With Love, Jungsaemmool Artist Group',252,0,NULL,'2013-05-14 12:35:33',1,'_lee-hai-s-rose-makeup'),(653,'멀티 밤을 활용한 홀케어 법 Jungsaemmool\'s Beauty Tip: Jungsaemmool\'s Personal Extra+1 Care Routine','http://www.youtube.com/embed/v4D-kEo7W6g',NULL,'http://img.youtube.com/vi/v4D-kEo7W6g/0.jpg','23',18,'2013-11-14 08:53:17','2014-01-02 07:19:05','v4D-kEo7W6g','이승연과 100인의 여자들에서 Live시연으로 공유했었던 정샘물 디렉터의 10살은 더 젊어보이는 클렌징의 모든 것! 그 중에서도 많은 분들이 신기해하셨던 \"홀 케어 비법\"을 공유하는 짧은 스킨 케어 클립입니다.\n\nAll of us are familiar with cleansing the \"face\" at the end of the day - cleanse-off with foam or oil cleanser, washing it off and moist-cleanse the skin surface with toner -...but do all parts get paid the even attention? \n\nToday\'s short beauty routine includes caring the parts that take quite a space on the face but did not get as much interest they deserve...recommended by Jungsaemmool Director herself, saying that this tiny extra effort at the end of cleansing routine makes huge differences in the end, telling from her personal experience. :)',212,0,NULL,'2013-05-02 06:54:39',1,'jungsaemmool-s-beauty-tip-jungsaemmool-s-personal-extra-1-care-routine'),(654,'[NYLON TV KOREA] beauty studio x 바비브라운','http://www.youtube.com/embed/g1DaPx7FZu4',NULL,'http://img.youtube.com/vi/g1DaPx7FZu4/0.jpg','24',16,'2013-11-14 08:54:46','2014-01-02 01:11:26','g1DaPx7FZu4','glam holiday, old hollywood \n\n관능적인 레드 립과 우아한 애티튜드. 레드카펫 위를 걷는 할리우드의 여배우처럼 변신하라. \n\nfeatured music 센티멘탈시너리 - Am 11:11\nmusic directed by Pastel Music   \n                                                                                    \nEDITOR  O DA HYE\nNYLON TV PD KIM SANG EUN\nFILMED BY OH BUM BIN(BBO digital film works)',180,0,NULL,'2013-11-14 06:57:13',1,'nylon-tv-korea-beauty-studio-x'),(655,'[NYLON TV KOREA] beauty studio x 메이블린 뉴욕','http://www.youtube.com/embed/bHGOQtjSYV8',NULL,'http://img.youtube.com/vi/bHGOQtjSYV8/0.jpg','24',16,'2013-11-14 08:54:46','2014-01-02 02:05:28','bHGOQtjSYV8','girls, become ladies\n\n소녀가 숙