W_E',NULL,'http://img.youtube.com/vi/GVhkoYKNW_E/0.jpg','25',10,'2013-11-14 12:23:00','2013-12-29 05:40:06','GVhkoYKNW_E',NULL,561,0,NULL,'2013-06-21 01:10:52',1,'--29'),(705,'[스타뷰티쇼] 스타 네일 따라잡기','http://www.youtube.com/embed/phUClZB6SLo',NULL,'http://img.youtube.com/vi/phUClZB6SLo/0.jpg','25',51,'2013-11-14 12:23:01','2014-01-01 23:06:30','phUClZB6SLo',NULL,169,0,NULL,'2013-06-13 05:52:36',1,'--30'),(708,'[스타뷰티쇼] 섹시롱헤어','http://www.youtube.com/embed/7cT4J7rHoV4',NULL,'http://img.youtube.com/vi/7cT4J7rHoV4/0.jpg','25',12,'2013-11-14 12:23:01','2014-01-01 09:07:39','7cT4J7rHoV4',NULL,203,0,NULL,'2013-06-03 01:38:05',1,'--31'),(709,'[스타뷰티쇼] 섹시미디엄헤어','http://www.youtube.com/embed/l2-RWobM7vQ',NULL,'http://img.youtube.com/vi/l2-RWobM7vQ/0.jpg','25',20,'2013-11-14 12:23:01','2013-12-29 22:27:49','l2-RWobM7vQ',NULL,227,0,NULL,'2013-06-03 01:31:35',1,'--32'),(710,'[스타뷰티쇼] 큐트미디움헤어','http://www.youtube.com/embed/TyA_2BFKU1o',NULL,'http://img.youtube.com/vi/TyA_2BFKU1o/0.jpg','25',15,'2013-11-14 12:23:01','2013-12-27 11:19:09','TyA_2BFKU1o',NULL,260,0,NULL,'2013-06-03 01:29:30',1,'--33'),(711,'[스타뷰티쇼] 큐트롱헤어','http://www.youtube.com/embed/NdjdITqnFxk',NULL,'http://img.youtube.com/vi/NdjdITqnFxk/0.jpg','25',11,'2013-11-14 12:23:01','2013-12-29 05:36:23','NdjdITqnFxk',NULL,182,0,NULL,'2013-06-03 01:26:22',1,'--34'),(714,'Korean straight eyebrows! 제가 일자눈썹 그리는 방법이에요! ♥','http://www.youtube.com/embed/22yg41d4IUk',NULL,'http://img.youtube.com/vi/22yg41d4IUk/0.jpg','26',174,'2013-11-14 12:27:27','2014-01-01 22:17:35','22yg41d4IUk','Like my FB page ♥  https://www.facebook.com/soyoungsbeautyroom\n안녕하세요~\n너무 오랜만에 비디오 올리게됬어요.ㅠㅠ\n제가 남편 일때문에 호주에 일주일 넘게 갔다 오느라 계속 늦어졌네요..ㅠㅠ 죄송해요♥\n가장 요청이 많았던 일자눈썹 그리기 비디오를 만들어봤는데요.\n사실 저 뿐만 아니라 다른 유투브 구루들도 눈썹그리는걸 어려워 하는 분들이 많더라구요.\n눈썹이 메이크업 중 가장 어려운 부분인것 같아요~\n여러분들도 제가 하는 방법 보시고 조금이라도 도움이 받으셨으면 좋겠어요~\n저도 사실 잘 못그리지만...ㅋㅋㅋ\n재밌게 보셨으면 좋겠어요~ 앞으로는 더 자주자주 올릴께요~ ♥ㅋㅋㅋ\n감사합니다~\n \n사용한 제품\n디올 파우더 아이브로우 펜슬 453 sable sand\n키스미 헤비 로테이션 아이브로우 마스카라\n\nHello!! everyone~\nIt\'s been quite a long time since I posted a video :( sorry\nI went to Australia with young and K-town crew for a club appearance in Melbourne and sydney.\nand I didnt have enough time to film :( \nSo i filmed as soon as I got here :)\nThis straight eyebrows tutorial video is the most requested video. \nI hope you guys enjoy~ Thank you and Luv you ♥\n\nProducts used in this video\n\nDIOR powder eyebrow pencil (453 sable sand)\nKissme heavy rotation coloring eyebrow #1',377,0,NULL,'2013-11-07 20:42:24',1,'korean-straight-eyebrows'),(716,'IU \"The red shoes\" Makeup Tutorial! 아이유 분홍신 메이크업 튜토리얼~','http://www.youtube.com/embed/29lE1olHoDA',NULL,'http://img.youtube.com/vi/29lE1olHoDA/0.jpg','26',23,'2013-11-14 12:27:27','2014-01-02 00:13:24','29lE1olHoDA','Instagram: soyoung0201\nFacebook: www.facebook.com/soyoung0201\n\n안녕하세요!\n오늘은 아이유의 새로운 뮤직비디오 분홍신 메이크업이에요~\n아이유는 처음엔 애기 같더니 점점 여성스럽게 너무 예뻐지는것 같아요~\n전 점점 늙어가는데.........-_-\n암튼 재밌게 보시고 공유, 코멘트, Thumbs up! 해주세요 ♥\n감사합니다~~~\n\nHello everyone!!\nI did IU\'s the red shoes music video makeup today~\nHope you guys enjoy!\nPlease share, comment, and thumbs up! if you liked this video \nThank you for watching! ♥',316,0,NULL,'2013-10-15 15:25:49',1,'iu-the-red-shoes-makeup-tutorial'),(717,'POP ART MAKEUP! 팝아트 메이크업 튜토리얼 (Halloween makeup)','http://www.youtube.com/embed/5rerr7kbepw',NULL,'http://img.youtube.com/vi/5rerr7kbepw/0.jpg','26',14,'2013-11-14 12:27:27','2014-01-01 23:15:00','5rerr7kbepw','Hi everyone!\nThis is Pop art makeup look which can be a perfect look for this halloween!\nI was looking thru Instagram and found this awesome makeup look, and I wanted to share it with you guys! :)\nHope you guys enjoy this video! \nThank you for watching! \n\n안녕하세요~\n오늘은 너무 특이한 팝아트 메이크업을 가지고 왔어요~\n인스타그램을 보다가 팝아트 메이크업이라는 걸 발견하고 여러분들한테 보여주고 싶어서 시도 해봤어요 :)\n할로윈때도 특별한 커스튬 없이 쉽게 할수있는 메이크업인거 같아요~\n재밌게 보시고 Thumbs up! 공유 부탁드려요~\n감사합니다. :D',450,0,NULL,'2013-10-12 21:19:42',1,'pop-art-makeup-halloween-makeup'),(719,'Korean night time skin care routine ♥ 지성 피부 저녁 스킨케어 단계~♥','http://www.youtube.com/embed/OkT5_RFmGAo',NULL,'http://img.youtube.com/vi/OkT5_RFmGAo/0.jpg','26',46,'2013-11-14 12:27:27','2014-01-02 06:20:33','OkT5_RFmGAo','*I have an oily skin :) and I used to get a lot of white heads when I don\'t exfoliate my skin often..\n안녕하세요~ 오늘은 저녁 스킨케어 비디오 가지고 왔어요~♥\n몇년전까지만 해도 성인여드름으로 고생했고 지금도 좀만 관리 안하면 \n좁쌀여드름이 잘 생기곤 해요.ㅠㅠ\n이 비디오 찍을때도 그날이라....... 피부 상태가 그리 좋진 않지만\n그래도 이제는 제 피부를 좀 더 잘 이해해서 예전보다는 피부도 많이 좋아졌다는 얘기도 많이 듣고\n여드름도 잘 안나는것 같아요. 제 피부에는 스크럽을 꾸준히 자주 해주는게 최고였던거 같아요.\n지금은 클라리소닉 쓰고 있는데 그 전에는 한국에서는 이미 유명한 스킨푸드 블랙슈가 스크럽을\n거의 이틀에 한번 사용했어요. \n저같은경우는 워낙 지성이라 클렌징을 꼼꼼히 해주는게 최고더라구요. 스크럽도 보통사람보다 자주하고.\n스크럽을 자주해서 피지가 모공을 막지 않게 하니까 자연스럽게 여드름도 안생기고\n모공도 줄어드는 것 같아요.\n보통 메이크업할때는 신경도 많이 쓰고 시간도 많이 걸리는데 지우는데는 너무 신경을 안쓰는것 같아요\n저도 마찬가지구요. ㅠㅠ\n로션같은 경우도 아무리 좋은것도 너무 많으면 모공을 막기때문에 당기지 않을정도로만 바르시구요 ^^\n다들 관리 잘 하시고~ 꿀피부 되세요 ♥',238,0,NULL,'2013-10-06 05:38:55',1,'korean-night-time-skin-care-routine'),(720,'Brown smokey makeup Ga-in inspired 가인 브라운 스모키 메이크업 튜토리얼','http://www.youtube.com/embed/-6JunkOcMnY',NULL,'http://img.youtube.com/vi/-6JunkOcMnY/0.jpg','26',19,'2013-11-14 12:27:27','2014-01-02 00:03:14','-6JunkOcMnY','****Click CAPTIONS for English subtitles :)\nMy VLOG channel : www.youtube.com/theyounguru\nFacebook: www.facebook.com/soyoungsbeautyroom\nInstagram : soyoung0201\n\n브라운아이드걸스의 가인 새롭게 바뀐 브라운 스모키 메이크업 해봤어요~\n재밌게 보시고 thumbs up! 눌러주세요 ♥♥♥♥♥\n\nHi! This look is Ga-in\'s new makeup look (bronze brown smokey makeup)\nThis was requested a lot of times and I finally did it :) hehe\nHope you guys enjoy this~\nThumbs up if you liked the video plz~~ ♥♥♥♥♥',432,0,NULL,'2013-09-14 03:32:38',1,'brown-smokey-makeup-ga-in-inspired'),(721,'Korean everyday makeup 매일매일 하기 좋은 데일리 메이크업 튜토리얼','http://www.youtube.com/embed/NNqi5fodz4s',NULL,'http://img.youtube.com/vi/NNqi5fodz4s/0.jpg','26',40,'2013-11-14 12:27:27','2014-01-01 21:27:33','NNqi5fodz4s','안녕하세요 :)\n이번에는 가장 요청이 많았던 데일리 메이크업을 해봤어요~\n화장 안하고 선크림만 바를 때도 있고 아침부터 화장 하고 싶을때는 \n브라운 스모키에 펄까지 막 바를때도 있는데요.ㅋㅋㅋ\n그 중에서 가장 자주하는 메이크업을 해봤어요. 거의 이 메이크업에 입술 색만 조금씩 바뀌는 정도?\n재밌게 봐주시고 이 다음 룩은 많이 리퀘스트 해주신 가인 브라운 스모키 할것같아요 ^^\n기초제품&클렌징 비디오도 생각 중이니\n다른 비디오 원하시는 거 있으시면 댓글 많이 많이 남겨주시고\n손가락 업! 표시 많이 눌러주세요~~~~♥\n항상 비디오 봐주시고 좋은 댓글 남겨주셔서 감사합니다!!!! :D ♥♥♥\n\nHi guys! :D\nThis everyday makeup look is one of the most requested looks.\nI sometimes wear only sunscreen, and I wear smokey eyes when I feel like wearing heavy makeup LOL\nBut I wear this makeup almost everyday with slightly different lip colors.\nI hope you guys enjoy this video.\nI am planning to do Gain\'s new bronze makeup look, IU\'s makeup, and skin care routine videos.\nPlease let me know if there is any specific look you want me to do.\nIf you liked the video, please thumbs up! \nThank you so much for watching~! :D',270,0,NULL,'2013-09-10 21:29:22',1,'korean-everyday-makeup'),(722,'FALL Makeup look (Rose red lips) 가을 메이크업 로즈레드 립 튜토리얼','http://www.youtube.com/embed/sZmHQ7UfSPo',NULL,'http://img.youtube.com/vi/sZmHQ7UfSPo/0.jpg','26',12,'2013-11-14 12:27:27','2013-12-25 14:54:12','sZmHQ7UfSPo','안녕하세요~\n제가 한달동안 한국에서 제주도, 부산, 대구 등등 여행다니고 가족,친구들이랑 시간 보내느라\n비디오를 계속 못 올렸어요 죄송해요 ㅠㅠ\n다들 여름 재밌게 잘 보내셨나요? ^^\n아쉽게도 벌써 여름이 지나고 가을이 오고 있어요... 가을 타는지 마음도 괜시리 쓸쓸해지고....ㅠㅠ\n그래서 오늘은 여름에 많이 발랐던 베이비핑크,오렌지,핫핑크를 버리고!!\n로즈레드로 그윽한 느낌의 메이크업을 해봤어요~\n요즘 화장품 샵들 그리고 잡지들마다 가을의 대표 색인 레드로 물들고 있더라구요\n한국에 있으면 단풍놀이도 가고 했을텐데 엘에이로 돌아오니까 아직도 여름처럼 햇빛 쨍쨍이네요...-_-\n내 마음은 가을인데...\n아무튼 가을 느낌 나는 메이크업! 재밌게 보시구요~\n혹시 원하시는 메이크업 룩이나 원하시는 비디오 있으시면 댓글에 남겨주세요~\n감사합니다!!! 쪽쪽쪽 :3 ♥♥♥♥♥\n\n\nHi everyone!!! :D\nI\'m finally backkk lol\nHow was your summer??? :)\nI was in Korea for a month traveling and spending time with my family and friends, and I wasn\'t able to upload any videos... Im soooo sorry :\'(\nNow Im back with the fall makeup look. hehe \nI hope you guys enjoy this look.\nThank you for watching ♥♥♥♥♥',270,0,NULL,'2013-09-08 22:52:28',1,'fall-makeup-look-rose-red-lips'),(723,'Summer coral peach makeup look 코랄 피치 메이크업 튜토리얼 (안젤라베이비 스타일)','http://www.youtube.com/embed/XcUL1XSXdcM',NULL,'http://img.youtube.com/vi/XcUL1XSXdcM/0.jpg','26',12,'2013-11-14 12:27:27','2014-01-01 22:48:41','XcUL1XSXdcM','안녕하세요!\n오늘은 안젤라베이비 메이크업 스타일의 코랄피치 메이크업을 해봤어요~\n태닝한 피부에도 잘 어울리고 하얀 피부에도 너무 잘어울리는 메이크업 인것 같아요~\n여름에 바캉스 가서나 평소에도 하면 너무 이쁜 메이크업이에요 ^^\n여름 화장이 오래가기 위해서는 프라이머나 세팅스프레이 이용하시면 되시구요!\n재밌게 보세요 감사합니다~~~♥\nHi!! Today I did peach makeup inspired by Angela baby.\nThis makeup look is perfect for summer tanned skin.\nThis look is one of my favorite go to look. I tend to use orangy peach colors more than pinky ones in summer.\nHope you guys enjoy this tutorial\nThank you for watching :D♥',358,0,NULL,'2013-07-31 22:41:15',1,'summer-coral-peach-makeup-look'),(724,'Get ready with me ♥ Korean Clubing Makeup 불금 불토 클럽 메이크업!! :D 같이 준비해요~♥♥','http://www.youtube.com/embed/HQt06SjirlU',NULL,'http://img.youtube.com/vi/HQt06SjirlU/0.jpg','26',11,'2013-11-14 12:27:27','2014-01-01 23:26:13','HQt06SjirlU','Check out my VLOG channel! www.youtube.com/theyounguru \nInstagram: soyoung0201\nLIKE!! my FB page ♥  https://www.facebook.com/soyoungsbeautyroom\nHello everyone!! \nI\'m in Korea right now and I was getting ready for girl\'s night out on saturday night here in Seoul :)\nHope you guys enjoy this video! :D\nThank you for watching!!! ♥\n\n안녕하세요~ \n1년만에 한국에 와서 친구들 만나서 불토를 즐기기 전! 준비하는 과정 찍었어요!! :)\n재밌게 봐주세요 ^^\n감사합니다!!♥\n\n\n*PRODUCTS USE IN THIS VIDEO*\nBENEFIT porefessional\nP.DIRECTION CC CREAM #01 complete care\nBENEFIT  erase paste #fair\nHANSKIN powder\nKevin aucoin celetial powder highlight\nBenefit hoola bronzer\nAnastasia brunette powder duo\nBennye pressed colour palette\nUrban decay naked palette\nLancome show hypnose doll lashes mascara\nNYX super skinny eye marker #carbonblack\nSephora rectactable eyeliner in black\nMAC viva glam nicki',313,0,NULL,'2013-07-15 21:13:04',1,'get-ready-with-me-korean-clubing-makeup-d'),(725,'2NE1 \"FALLING IN LOVE\" Sandara Park Makeup tutorial 산다라 박 메이크업 튜토리얼','http://www.youtube.com/embed/ZT-T1OQeUVs',NULL,'http://img.youtube.com/vi/ZT-T1OQeUVs/0.jpg','26',10,'2013-11-14 12:27:27','2013-12-29 08:10:27','ZT-T1OQeUVs','안녕하세요~ 오늘은 이번에 새로나온 2NE1의 \"Falling in love\" 뮤비에 나오는 \n산다라박메이크업을 해봤어요\n거의 다 워터프루프 제품을 써서 여름에 잘 지워지지도 않고 블루 아이섀도우와 오렌지 립스틱을 써서\n시원한 느낌을 주는것 같아요 ^^\n이번 노래 너무 좋아서 제 목소리 안 넣구 노래만 넣었어요~ 들을때마다 어디 섬나라로 여행가서\n피나콜라다 같은거 마시고 싶은 기분 :D ㅋㅋㅋ\n다들 시원한 여름 보내시구요~ 재밌게 보시구 손가락 UP! 눌러주세요 ♥\n\nHello everyone~ \nI finally did dara\'s makeup!!! ♥\nI love love love this new song \"falling in love\" from 2NE1!!\nIt makes me wanna go to some islands and drink pina colada lol\nMost of the products I used are waterproof so it will be perfect makeup look for the hot summer beach kinda days :)\nHope you guys enjoy this video \nOh I didnt put my voice in this video because I would love you guys to listen this song and feel the fun summer vibe while watching it :D\nThumbs up! if you like this video!!\nThank you so much!!! ♥',451,0,NULL,'2013-07-10 22:23:24',1,'2ne1-falling-in-love-sandara-park-makeup-tutorial'),(726,'Girl\'s day \"Female president\" Minah makeup 걸스데이 여자대통령 민아 메이크업 튜토리얼','http://www.youtube.com/embed/S-bOYsT1zIM',NULL,'http://img.youtube.com/vi/S-bOYsT1zIM/0.jpg','26',11,'2013-11-14 12:27:27','2013-12-25 14:45:45','S-bOYsT1zIM','Hope you guys enjoy the video :)\nThumbs up if you liked the video ♥\n이번 비디오 메인 화면 사진 동네 바보처럼 나온듯.ㅋㅋㅋㅋ 나름 민아 표정 따라한건데....\n\nProducts used in this tutorial! :) \n\nBenefit porefessional Primer\nDr Jart BB cream\nMAC sheertone shimmer blush (Peachtwist)\nkevyn aucoin celestial powder\nMaybelline master precise by eye studio eyeliner\nClio waterproof pencil eyeliner in black\nBen nye pressed colour palette\nUrban decay naked palette\nMaybelline volum\' Express The colossal mascara\nAnastasia brow powder duo\nMAC viva glam nicki\n\n\n\n\nMusic by Dan-O at DanoSongs.com',221,0,NULL,'2013-06-29 01:53:41',1,'girl-s-day-female-president-minah-makeup'),(727,'After School \"First Love\" NANA Makeup 에프터스쿨 첫사랑 나나 메이크업 튜토리얼 (requested)','http://www.youtube.com/embed