HYMMx1zs','♥  CLICK HERE FOR MORE INFO  ♥\n\nHey guys!! Today\'s look is my classic smokey eye!  I decided to do a soft smokey look so it\'s more wearable.  I used my Shu Uemura Exclusive Night Palette that I got to create as a collaboration with them!  It was so much fun picking out my four colors!  If you prefer a darker look, you can create a more dramatic smokey eye by applying more of the black shadow at the end and higher above the crease!  Hope you guys enjoy!! (I\'m breaking out right now.. boo~)\n\n\n\nPRODUCTS MENTIONED ♥ :\n\n\n- Shu Uemura Face Architect Illuminating Moisture Fluid Foundation #784 Fair Beige http://bit.ly/GB9Dix\n- Lioele Auto Brow Pencil\n- Urban Decay Primer Potion\n- Shu Uemura Night Palette http://bit.ly/Hwm40v\n- Shu Uemura Gel Liner http://bit.ly/1f8uKW9\n- Eyemazing Eyelashes http://www.imomoko.com\n- Tarte Mascara http://tartecosmetics.com/tarte-item-lights-camera-flashes-statement-mascara\n- NARS \"Deep Throat\" http://www.sephora.com\n- MAC \"Creme Cup\"\n\n\nMy Shu Uemura Night Palette! - http://bit.ly/Hwm40v\nDon\'t forget to enter \"BEAUTIFYXSHU\" at checkout to get a quad case for FREE!\n\n\n\n\nMUSIC - \"With You\" by my friend A.Song =)\n\n\n\nW A T C H  ♥ :\n\nHalloween Vlog - http://youtu.be/XtUSET55IKs\nRecent HAUL - http://youtu.be/duMA_sVjPO0\nRecent Hair Tutorial - http://youtu.be/XS5U-AGvaWk\nPrevious Makeup Tutorial - http://youtu.be/lnfD5QBDelQ\n\n\nDisclaimer :  I got to do an awesome collab with my favorite makeup brand, Shu Uemura!  My palette that I created was sent to me as a gift, but everything else used in this video was purchased by me! =)',284,0,NULL,'2013-11-01 18:19:01',1,'soft-classic-smokey-eye-tutorial'),(736,'Pink & Brown Makeup Tutorial 핑크 브라운 메이크업','http://www.youtube.com/embed/lnfD5QBDelQ',NULL,'http://img.youtube.com/vi/lnfD5QBDelQ/0.jpg','27',73,'2013-11-15 02:28:38','2013-12-31 12:00:22','lnfD5QBDelQ','♥  CLICK HERE FOR MORE INFO  ♥\n\nHey guys!! I have another makeup tutorial for you guys!\