ial.  Instead of doing a bun undo, she did an edgy ponytail instead so that it\'s more wearable!  She did the side fishtail braid exactly the same though from how she did it on Yunwoo\'s birthday party!  The updo one is great for special occasions!  Thank you so much Chonghee for doing my hair!  I would never be able to do this alone.  I watched the tutorial while editing it and it\'s still so difficult for me! I will practice practice practice~~! haha  Hopefully you or a friend can do this hair on you!  Enjoy ~~~ and more hair tutorials coming soon!! \n(Just realized I misspelled the word \"edgy\" in the video title! oops!)\n\n\nMusic By : My brother\'s Friend GeoFresh!\nhttp://www.youtube.com/user/GeoFreshProductions\n\n\n\n\n\nW A T C H  ♥ :\n\nYunwoo\'s Birthday Vlog - http://www.youtube.com/watch?v=RZANRD2YPVU&feature=c4-overview&list=UU-gljeiuxAOpxiB1j32pKpQ\nRecent HAUL - http://youtu.be/duMA_sVjPO0\nRecent Hair Tutorial - http://youtu.be/A2ZwHcRcRlo\nPrevious Makeup Tutorial - http://youtu.be/_RymanXZgUI\n\n\n\nOTHER SITES  ♥ :\n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : Video not sponsored',330,0,NULL,'2013-10-22 12:20:44',1,'braided-edgy-ponytail-tutorial'),(738,'Bright RED Lips Makeup Tutorial 빨간 입술 메이크업','http://www.youtube.com/embed/_RymanXZgUI',NULL,'http://img.youtube.com/vi/_RymanXZgUI/0.jpg','27',18,'2013-11-15 02:28:38','2014-01-01 21:46:09','_RymanXZgUI','♥  CLICK HERE FOR MORE INFO  ♥\n\nHey guys! I had this makeup look on my recent monthly favorites video, and so many people were requesting a tutorial on it and loved the lip color.. so I decided to film a tutorial on it!  I did a very light eye makeup so that the main focus is on the bright red lips.  This look is also great for a fall/autumn look! Hope you guys enjoy it~ more tutorial