esses in Korea like (loose, messy, natural).  I noticed that in America, the tighter bun is more popular.  Girls in Korea like to wear their bun loosely with a lot of volume at the top and loose at the button.  Hope this video will be helpful for some of you guys! More hair tutorials coming soon!\n\n\n\nMUSIC : by my friend A.Song \"With You\"\n\n\n\nW A T C H  ♥ :\n\nYunwoo\'s Birthday Vlog - http://www.youtube.com/watch?v=RZANRD2YPVU&feature=c4-overview&list=UU-gljeiuxAOpxiB1j32pKpQ\nRecent HAUL - http://youtu.be/duMA_sVjPO0\nRecent Hair Tutorial - http://www.youtube.com/watch?v=YXl6LzgXMVI\nPrevious Makeup Tutorial - http://www.youtube.com/watch?v=uA6gNQy9Jbk\n\n\n\nOTHER SITES  ♥ :\n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : Video not sponsored',139,0,NULL,'2013-10-14 01:54:34',1,'korean-natural-bun-tutorial'),(742,'My \"Go To\" Makeup Look TUTORIAL ♥','http://www.youtube.com/embed/iqEZJF9-Tb4',NULL,'http://img.youtube.com/vi/iqEZJF9-Tb4/0.jpg','27',17,'2013-11-15 02:28:39','2014-01-01 22:25:20','iqEZJF9-Tb4','♥  CLICK HERE FOR MORE INFO  ♥\n\nHey guys! I\'ve been getting a lot of request to do this look since I wore this look on a lot of my recent videos.  This is currently my favorite \"GO TO\" makeup look that I always wear out.  I use to be obsessed over brown shadows, but now I\'m in love with gray shadows!!  This is a wearable soft semi gray smokey eye makeup (great for everyday!). More tutorials coming soon ( KPOP inspired too!) ~~\n\n\n\nPRODUCTS MENTIONED ♥ :\n\n\n- Shu Uemura Face Architect Illuminating Moisture Fluid Foundation #784 Fair Beige http://bit.ly/GB9Dix\n- Bobbi Brown Stick Foundation \"Sand\" http://www.bobbibrowncosmetics.com/product/2335/7291/Makeup/Face/Corrector-Concealer/Face-Touch-Up-Stick/index.tmpl\n- Urban Decay Primer Potion http://www.urbandecay.com\n- Lioele Auto Brow Pencil\n- Loreal Infalliable \"Iced Latte\" \n- MAC \"Scene\" http://www.maccosmetics.com\n- MAC \"Knight Devine\"\n- MAC Blacktrack Fluidline http://www.maccosmetics.com\n- Urban Decay \"Bourbon\"\n- Urban Decay Naked Palette \"Virgin\"\n- KISS ME mascara (Long & Curl)\n- Bare Minerals \"The One\" http://www.bareescentuals.com/bareMinerals-READY-Blush/USMasterreadyblush,default,pd.html\n- Revlon \"Sweet Tart\" Lip Butter http://www.revlon.com/Revlon-Home/Products/Lips/Lipcolor/Revlon-ColorBurst-Lip-Butter.aspx\n\n\nContacts : Freshlooks Colorblend \"Brown\"\n\n\n\nMUSIC - \"With You\" by my friend A.Song =)\n\n\n\n\nW A T C H  ♥ :\n\nYunwoo\'s Birthday Vlog - http://www.youtube.com/watch?v=RZANRD2YPVU&feature=c4-overview&list=UU-gljeiuxAOpxiB1j32pKpQ\nRecent HAUL - http://www.youtube.com/watch?v=aW92ZwLhJkg&feature=c4-overview&list=UU-gljeiuxAOpxiB1j32pKpQ\nRecent Hair Tutorial - http://www.youtube.com/watch?v=YXl6LzgXMVI\nPrevious Makeup Tutorial - http://www.youtube.com/watch?v=cbdsF-lF6mY\n\n\n\nOTHER SITES  ♥ :\n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : Video not sponsored',207,0,NULL,'2013-10-05 05:47:04',1,'my-go-to-makeup-look-tutorial'),(745,'My Fall Makeup Tutorial 가을 메이크업','http://www.youtube.com/embed/cbdsF-lF6mY',NULL,'http://img.youtube.com/vi/cbdsF-lF6mY/0.jpg','27',32,'2013-11-15 02:28:39','2014-01-02 00:59:38','cbdsF-lF6mY','♥  CLICK HERE FOR MORE INFO  ♥\n\n\nHey guys! Fall is finally here~ YAY!  I filmed a fall makeup tutorial that can be worn as an everyday look!  I used colors that I love to wear in the fall time.  Hope you guys enjoy it! Thumbs up for more makeup tutorials!\n\n(the lighting made the lipstick look really pink, but it\'s actually a peach/coral pinkish color.  I will swatch and show a picture of it on my blog of the lipstick! hehe Also the lighting might seem too bright for those that watch from a monitor with high brightness setting~ the color will look much better if you watch from your phone!)\n\n\nPRODUCTS MENTIONED ♥ :\n\n- Shu Uemura Face Architect Illuminating Moisture Fluid Foundation #784 Fair Beige http://bit.ly/GB9Dix\n- Bobbi Brown Stick Foundation \"Sand\" http://www.bobbibrowncosmetics.com/product/2335/7291/Makeup/Face/Corrector-Concealer/Face-Touch-Up-Stick/index.tmpl\n- Urban Decay Primer Potion http://www.urbandecay.com\n- Loreal Infalliable \"Amber Rush\" http://www.ulta.com/ulta/browse/productDetail.jsp;jsessionid=FD5D807F91984B2A44E8B8EF1BC4E21B.p-a2-app2?productId=xlsImpprod4070031&skuId=2240524\n- NYX Love In Paris 9x Palette http://www.nyxcosmetics.com/p-200-love-in-paris-eye-shadow-palette.aspx\n- shiseido brown shadow pencil www.imomoko.com\n- MAC Blacktrack Fluidline http://www.maccosmetics.com\n- Urban Decay \"Bourbon\"\n- KISS ME mascara (imomoko)\n- Bobbi Brown \"Snow\" Shadow\n- Bare Minerals \"The One\" http://www.bareescentuals.com/bareMinerals-READY-Blush/USMasterreadyblush,default,pd.html\n- Urban Decay Naked Palette \"Sin\"\n- Peripera #15 Lipstick\n\n\nContacts : freshlooks colorblend brown\n\n\n\nW A T C H  ♥ :\n\nYunwoo\'s Birthday Vlog - http://www.youtube.com/watch?v=RZANRD2YPVU&feature=c4-overview&list=UU-gljeiuxAOpxiB1j32pKpQ\nRecent HAUL - http://www.youtube.com/watch?v=aW92ZwLhJkg&feature=c4-overview&list=UU-gljeiuxAOpxiB1j32pKpQ\nRecent Hair Tutorial - http://www.youtube.com/watch?v=YXl6LzgXMVI\nPrevious Makeup Tutorial - http://www.youtube.com/watch?v=uA6gNQy9Jbk\n\n\n\nOTHER SITES  ♥ :\n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : Video not sponsored',188,0,NULL,'2013-09-29 01:26:57',1,'my-fall-makeup-tutorial'),(758,'Son Ye-Jin Inspired GEL Nails (Kdrama SHARK)','http://www.youtube.com/embed/mt3G8TrI-uY',NULL,'http://img.youtube.com/vi/mt3G8TrI-uY/0.jpg','27',37,'2013-11-15 02:28:39','2014-01-02 07:02:09','mt3G8TrI-uY','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey guys! Today my sister in law came over and wanted to do my nails, so I filmed her doing it! It\'s the Son Ye-Jin nails that she has on throughout the whole episodes of the korean drama \"SHARK\".  This deep french nail is extremely popular in Korea right now.  I love gel polishes because they are super long lasting, but a downside to that is it\'s really hard to take off! I will just leave it on my nails until it grows out lol.  My hands are constantly in water (washing bottles & doing dishes), so gel polishes are better for me since it won\'t chip off and very long lasting!  \n\n\n\n\nPRODUCTS MENTIONED :\n\n- base coat, top coat : (Red Carpet Manicure Set) - http://www.ulta.com/ulta/browse/productDetail.jsp?skuId=2243889&productId=xlsImpprod4141919&navAction=push&navCount=1&categoryId=cat80045%20cat210002\n\n- Salon edge uv lamp (amazon) i accidently said it is from Ulta in the video! This lamp is my sister in law\'s :)\n\n- COCO UV Color Gel #3618 (Ebay)\n\n- Pearl Bows (ebay with keywords : nail, deco, art, bow, pearl)\n\n- Scotch glue\n\n- sedona lace small concealer brush (use a small, flat, thin, round edges one)\n\n\n\nMusic By: My friend A. Song \"With You\"\n\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : This video is NOT sponsored.',154,0,NULL,'2013-07-21 05:58:55',1,'son-ye-jin-inspired-gel-nails-kdrama-shark'),(759,'How To : Soft Loose Waves','http://www.youtube.com/embed/YXl6LzgXMVI',NULL,'http://img.youtube.com/vi/YXl6LzgXMVI/0.jpg','27',12,'2013-11-15 02:28:39','2014-01-02 00:09:35','YXl6LzgXMVI','♥  CLICK HERE FOR MORE INFO  ♥ \n\n\nHey guys! I\'ve been getting a lot of requests to do a tutorial on this hairstyle.  I had this hairstyle on my previous video \"What\'s in my beach bag\", and most of the comments were about my hair!  I love soft loose hair waves because my hair still looks long and doesn\'t look so puffy!  I have a loooottt of hair, so whenever I do curls my hair gets really big =)\n\nConair YOU Iron (Limited Edition) $23.99 - I bought this from Target! =)\n\n\n\nMusic Credit : \"With You\" by my friend A.Song\nCheck out his new single \"Stay\" on iTunes! The song used in this video will be released VERY soon too!\n\nhttps://itunes.apple.com/us/album/stay-single/id672829905\n\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : This video is NOT sponsored.',163,0,NULL,'2013-07-20 05:54:52',1,'how-to-soft-loose-waves'),(765,'Short Hair Styling Tutorial♥ 단발 머리 스타일링','http://www.youtube.com/embed/a0nd3iigHKQ',NULL,'http://img.youtube.com/vi/a0nd3iigHKQ/0.jpg','28',58,'2013-11-15 02:29:28','2014-01-02 03:36:39','a0nd3iigHKQ','♥Please Read Me!♥\nHey, Loves! I recently cut my hair to chin length and love the many possibilities in styling this hairstyle! All you basically need is a curling iron to make tight curls or add volume to your cute bob. Here, I do a little bit of both curling and volumizing to achieve that \"messy,\" carefree hair effect! \n♥Instagram: oiseau88\n♥Products Used\n1. ConAir Double Ceramic Technology Curling Iron\n2. Pantene Pro-V Heat Protection Spray',216,0,NULL,'2013-11-04 04:17:56',1,'short-hair-styling-tutorial'),(766,'Halloween:Pretty Mermaid Makeup Tutorial ♥예쁜 인어 화장법','http://www.youtube.com/embed/VYQY-cy0Psg',NULL,'http://img.youtube.com/vi/VYQY-cy0Psg/0.jpg','28',14,'2013-11-15 02:29:28','2014-01-01 21:58:27','VYQY-cy0Psg','♥Please Read Me!♥\nHey guys! Mermaids are one of my favorite mythical/fairytale characters and I thought this look would be great for Halloween! So if you\'re looking for last minute makeup ideas for trick or treating, hope you like this one!\n♥Instagram: oiseau88\n♥Items Used\n1. Lalavesi Akma Base \n2. Lioele Be My Skin Powder Pact [Oil Control Type], No.21 Blooming Ivory\n3. MAC Paint Pot, Soft Ochre\n4. Maybelline 24hr Color Tattoo, No.05 Too Cool\n5. BH Cosmetics 88 ColorPalette, Standard Shimmer Eyeshadow\n6. Faceshop Lovely ME-EX Blusher, PK102\n7. Maybelline EyeStudio Gel Eyeliner, Brown\n8. Majolica Majorca Lash King\n9. Benefit They\'re Real Mascara\n10. Magic Magic False Eyelashes [http://www.en.pinkicon.com]\n11. Fairy 1 Day Princess Circle Lenses, Pink [http://en.pinkicon.com/product-682.html]\n12. Self-Stick Gems, Champagne\n♥Pinkicon facebook:www.facebook.com/pinkicononlineshop',241,0,NULL,'2013-10-22 21:44:20',1,'halloween-pretty-mermaid-makeup-tutorial'),(768,'Updated Korean Eyebrows Tutorial♥눈썹 메이크업','http://www.youtube.com/embed/DiXmZjdgOJA',NULL,'http://img.youtube.com/vi/DiXmZjdgOJA/0.jpg','28',70,'2013-11-15 02:29:28','2014-01-01 17:34:03','DiXmZjdgOJA','♥Please Read Me!♥\nHello, Loves! As requested, here is an updated eyebrow tutorial. This very quick and easy way of shaping/shading in our brows will leave the face looking soft and youthful. Hope you enjoy and thank you for watching!\n\n♥Instagram: oiseau88\n♥Items Shown/Used\n1. NYX Eyebrow Shaper\n2. MAC Brow Set\n3. Etude House Drawing Eyebrow Pencil, Grey\n4. Flamingo Eyebrow Shaver\n5. L\'oréal True Match Crayon Concealer, Fair/Light',244,0,NULL,'2013-10-07 05:21:24',1,'updated-korean-eyebrows-tutorial'),(769,'KARA(카라) Goo Hara Damaged Lady MV Inspired Makeup ♥ \'숙녀가 못 돼\' 구하라 화장법','http://www.youtube.com/embed/L57Xq_JW8KM',NULL,'http://img.youtube.com/vi/L57Xq_JW8KM/0.jpg','28',23,'2013-11-15 02:29:28','2014-01-02 00:26:59','L57Xq_JW8KM','♥Please Read Me!♥\nHello, loves! As promised, here is another requested Kpop inspired makeup tutorial. I am loving Goo Hara\'s subtle but smoldering eye makeup that anybody can re-create for a night out in her latest MV, Damaged Lady! The colors may not look to be exactly like hers but I think it comes close to the concept :) Thank you for watching! \n♥Please follow my daily pics on Instagram: oiseau88\n♥Items Used\n1. Lalavesi Akma Base Formula\n2. MAC Soft Ochre Paint Pot\n3. Faceshop Auto Eyebrow Pencil, Gray/Brown\n4. Mustaev Brown Eyeshadow, Burn\n5. Elf Mint Lip Gloss\n6. Holika Holika Wonder Drawing Eyeliner Auto Stick, Brown\n7. Tarte The Bright Side Eye Brightener\n8. Majolica Majorca Lash King\n9. Mynk Lashes, Miss Dolly: www.mynklashes.com\n10. Stila Rouge Pot, Amaryllis\n11. SheerCover Bronzing Tan Minerals\n12. Lioele Be My Skin Powder Pact [Oil Control Type], 21 Blooming Ivory\n13. MAC Lipstick, Show Orchid\n14. 3CE [3concept eyes] Jumbo Lip Crayon, Mad Red',222,0,NULL,'2013-10-01 20:29:54',1,'kara-goo-hara-damaged-lady-mv-inspired-makeup'),(771,'f(x) Sulli Makeup Inspired Look in Céci Magazine September 2013','http://www.youtube.com/embed/pjJfk0d2R34',NULL,'http://img.youtube.com/vi/pjJfk0d2R34/0.jpg','28',13,'2013-11-15 02:29:28','2014-01-01 23:13:57','pjJfk0d2R34','♥Please Read Me!♥\nHey, loves! Recently, i\'ve asked you on Facebook/twitter what makeup look you wanted me to do and this one of f(x) Sulli in Céci\'s September 2013 issue came up! I love the play of rose gold and copper shadows on her lids and I felt it was a beautiful makeup for this upcoming Fall season! I hope you enjoy and for the two winners for my 100K subscribers giveaway, please email me your full name and shipping address to my email, theblueoiseau@gmail.com. \n\n♥Instagram:oiseau88\n♥Products Used♥\n1. Lalavesi Akma Base Formula & Lioele Skinfinish Powder Pact No. 21 Blooming Ivory\n2. 3 Concept Eyes Eyebrow Shaper in Gray Brown\n3. MAC Soft Ochre\n4. Skinfood Peach Shimmer Eyeshadow\n5. BH Cosmetics Tropical Shimmer Palette, Copper eyeshadow\n6. L\'oréal Infallible Eyeshadow in No.892 Amber Rush\n7. Holika Holika Wonder Drawing Eyeliner Auto Stick in Brown and Black\n8. Faceshop Duo eyeliner/eyeshadow in Brown/Gold\n9. Maybelline One By One Mascara\n10. L\'oréal True Match Crayon Concealer in N123 Fair/Light\n11. Faceshop Berry Liptint\n12. YSL Liptint in No.9\n13. Les Merveilleuses Ladurée Rose Blusher in Pink\n\n♥Music Credits: karaokekpop',298,0,NULL,'2013-08-30 01:48:52',1,'f-x-sulli-makeup-inspired-look-in-ceci-magazine-september-2013'),(776,'StyleNanda Park Sora Inspired Makeup♥스타일난다 박소라 메이크업 노하우','http://www.youtube.com/embed/3kg5IB6gBGo',NULL,'http://img.youtube.com/vi/3kg5IB6gBGo/0.jpg','28',14,'2013-11-15 02:29:28','2014-01-02 01:28:04','3kg5IB6gBGo','♥Please Read Me!♥\nHi everyone! As requested, here\'s another fun and simple makeup tutorial for the summer! Stylenanda\'s Park Sora is known for her tossled, beachy waves and colorful eyeliners on her lids. I\'ve recreated her look by making my own creamy eyeliner using an old eyeshadow and some concealer! Instead of throwing out some of your old palettes, why not turn them into fun eyeliners for the summer? ^^\n♥Instagram: oiseau88\n♥Makeup products Used\n1. Lalavesi Akma Base Formula\n2. Faceshop Auto Eyebrow, No.2 Gray Brown\n3. Mac Paint Pot, Soft Ochre\n4. Skin Food Sugar Dessert Shadow, No.5 Cream Orange\n5. MAC Fluidline, Blacktrack\n6. Maybelline Age Rewind Dark Circle Eraser\n7. Sleek PPQ Palette, Me Myself & Eye\n8. Maybelline One By One Volum\' Express Mascara\n9. Chantecaille Beauté Illuminating Face Powder, Les Pétales de Rose\n10. MAC Pro Longwear, Love Forever\n♥Music Credits: Karaokekpop',279,0,NULL,'2013-07-04 01:02:11',1,'stylenanda-park-sora-inspired-makeup'),(781,'Lee Hyori \"Miss Korea\" MV Inspired Makeup Tutorial♥이효리 미스코리아 화장 노하우','http://www.youtube.com/embed/03Eh1nw6zTA',NULL,'http://img.youtube.com/vi/03Eh1nw6zTA/0.jpg','28',13,'2013-11-15 02:29:28','2014-01-01 21:26:58','03Eh1nw6zTA','♥Please Read Me!♥\nHi guys! Here is another Kpop inspired makeup tutorial that I had fun filming for you! I love anything with a retro vibe and Lee Hyori\'s new MV \"Miss Korea\" makeup caught my eye. Her look is definitely bolder with exaggerated cat-eye and I wanted to tone it down a bit to make it more wearable. The colors seem a bit light in the tutorial, but they are definitely darker in real life. So hope you enjoy this tutorial and I\'ll talk to you again in my next video!\n♥Instagram: oiseau88\n♥Music Credit: Karaokekpop\n♥Products Used\n1. Holika Holika Face 2 Change BB Roller, No.1 Light Beige\n2. Lioele Be My Skin Powder Pact [Oil Control Type], No.21 Blooming Ivory\n3. MAC Paint Pot, Soft Ochre\n4. Castledew Eyeshadow, No. VL331\n5. Lancome Palette, Dark Matte Purple\n6. MAC Fluidline, Blacktrack\n7. Maybelline Volum\'Express Mascara, One By One\n8. Chantecaille Beauté, Les Pétales de Rose Illuminating Face Powder\n9. YSL Rouge Volupté, No.1 Pink Beige',246,0,NULL,'2013-05-10 05:40:43',1,'lee-hyori-miss-korea-mv-inspired-makeup-tutorial'),(782,'Summer Sun-Kissed Makeup Tutorial♥ 여름에 빛나는 메이크업 노하우','http://www.youtube.com/embed/7rNDPgGWHlE',NULL,'http://img.youtube.com/vi/7rNDPgGWHlE/0.jpg','28',13,'2013-11-15 02:29:28','2013-12-29 12:45:58','7rNDPgGWHlE','♥Please Read Me!♥\nHi guys! I was looking at the May 2013 issue of Céci Magazine and noticed that the models are rocking some amazing glowy skin and funky cheek blushers or lipstick shades. So here is my version of a \"sun kissed\" look that is playful and great for the Summer! I apologize for some blurriness in a few of the video clips but hopefully the tutorial is helpful. Thank you always for watching!\n♥Instagram: oiseau88\n♥Music Credit: Karaokekpop\n♥Products Used: **I purchased all my products and nothing was sponsored.\n1. Lioele Be My Skin Powder Pact [Oil Control Type], No.21 Blooming Ivory\n2. Holika Holika Face 2 Change BB Roller, No.1 Light Beige\n3. Faceshop Auto Eyebrow Pencil, No. 3 Grey\n4. MAC Paint Pot, Soft Ochre\n5. Lancome Color Design, All Over Base Highlight\n6. Maybelline Eyestudio Gel Liner, Brown\n7. Maybelline One By One Volum\' Express Mascara, Black\n8. Chantecaille Beauté Les Pétales de Rose, Illuminating Face Powder\n9. Les Merveilleuses Ladurée Pressed Cheek Color, Gold\n10. Tony Moly Petite Bunny Gloss Bar, Orange',183,0,NULL,'2013-05-05 23:54:59',1,'summer-sun-kissed-makeup-tutorial'),(784,'LEE HI \"Rose\" MV Inspired Makeup Tutorial♥이하이 \"Rose\" MV 메이크업 노하우','http://www.youtube.com/embed/4nPthtnD59Y',NULL,'http://img.youtube.com/vi/4nPthtnD59Y/0.jpg','28',15,'2013-11-15 02:29:28','2013-12-25 14:25:08','4nPthtnD59Y','♥Please read me!!♥\nHello everyone! Here is my take on one of Lee Hi\'s makeup in her new music video, \"Rose.\" I love this soft look for the springtime so hope you enjoy and stay tuned for a giveaway coming soon!\n♥Instagram: oiseau88\n♥Music Credits: Karaokekpop\n♥Products used\n1. Holika Holika Face 2 Change BB Roller, No.1 Light Beige\n2. MAC Soft Ochre Paint Pot\n3. Lioele Skin Fix Powder Pact, No. 21 Blooming Ivory\n4. NYX Blush (used as eyeshadow), PB08 Cinammon\n5. Faceshop Lovely ME-EX Blusher (used as eyeshadow), PK102\n6. Urban Decay Naked Palette, Buck and Smog\n7. MAC eyeshadow, Sushi Flower\n8. Maybelline Eyestudio Gel Liner, Brown\n9. Tarte EmphasEyes Inner Rim Brightener\n10. Maybelline One by One Volum\'Express Mascara\n11. NYX Soft Matte Lip Cream, SMLC03 Tokyo\n12. NARS Pink Lipgloss',220,0,NULL,'2013-04-07 03:33:43',1,'lee-hi-rose-mv-inspired-makeup-tutorial-rose-mv'),(787,'Cheongdam-dong Alice Makeup Tutorial♥\'청담동 앨리스\' 서윤주 메이크업 노하우','http://www.youtube.com/embed/m01OWT_qs48',NULL,'http://img.youtube.com/vi/m01OWT_qs48/0.jpg','28',14,'2013-11-15 02:29:28','2014-01-01 21:54:22','m01OWT_qs48','♥Please Read Me!!♥\nHello everyone! As requested, here is my interpretation of Suh Yoon Joo\'s makeup in the hit Kdrama series, Cheongdam-dong Alice! This is my first time doing a Korean drama look and I love this one for its simplistic elegance . The steps are easy to follow so hope you enjoy and thank you for watching!\n♥Instagram: oiseau88\n♥Products Used♥\n1. Holika Holika Aqua Petit Jelly BB Cream, No.1 Light Beige\n2. Lioele Be My Skin Powder Pact [Oil Control Type], No.21 Blooming Ivory\n3. MAC Paint Pot, Soft Ochre\n4. Lancome Color Design Quad Palette, Ciel Du Soir (Matte) and The New Black (Metallic)\n5. MAC Fluidline, Blacktrack\n6. Maybelline The Mega Plush Volum\'Express Mascara, Black\n7. Guerlain Météorites Perles Illuminating Powder, No.1 Teint Rosé\n8. Etude House Follow Me Lipstick, Berry\n♥Music Credits: Luna (루남)-It\'s Okay (괜찮아) from BubbleFeetGravityOST',235,0,NULL,'2013-02-22 03:15:40',1,'cheongdam-dong-alice-makeup-tutorial'),(790,'Laneige Snow BB Soothing Cushion Review and Makeup Tutorial ♥라네즈 리뷰/화장법','http://www.youtube.com/embed/lToALpkHE0E',NULL,'http://img.youtube.com/vi/lToALpkHE0E/0.jpg','28',14,'2013-11-15 02:29:28','2014-01-01 23:43:25','lToALpkHE0E','♥Please Read Me!♥ ✳Sponsored Review✳\nHello everyone!~Today I have a thorough review on Laneige\'s best selling product, the Snow BB Soothing Cushion. The review is quite long but I did my best to cover all aspects of this BB cream. While this is a sponsored review, I used all the products for two months to give you my honest opinion. I would like to add that I only review products that I believe in so hope you find this helpful and thank you always for watching!\n\n♥Sponsored Products Used♥\n1. Laneige Snow BB Soothing Cushion:http://www.laneige.com/product/detail.jsp?prdtCd=215086017\n2. Laneige Creamy Crystal Eyeliner Waterproof, Blue: http://www.laneige.co.kr/product/detail.jsp?prdtCd=115272008\n3. Laneige Volume Setting Mascara/볼륨 세팅 마스카라: http://www.laneige.co.kr/product/detail.jsp?prdtCd=115271012\n4. Laneige Water Supreme Finishing Pact/워터 수프림 피니싱 팩트: http://www.laneige.co.kr/product/detail.jsp?prdtCd=115269017\n5. Laneige Secret of Snow Crystal Makeup Brighter/메이크업 브라이터: http://www.laneige.co.kr/product/detail.jsp?prdtCd=115269005\n6. Laneige Silk IntenseLipstick, Pink Garden/실크 인텐스 립스틱: http://www.laneige.co.kr/product/detail.jsp?prdtCd=115275013\n7. Laneige Lipstick, Define Red/실크 인텐스 립스틱: http://www.laneige.co.kr/product/detail.jsp?prdtCd=115275013\n♥Music Credits: Karaokekpop\n♥Instagram: oiseau88',347,0,NULL,'2013-01-08 23:20:12',1,'laneige-snow-bb-soothing-cushion-review-and-makeup-tutorial'),(791,'SNSD \"I GOT A BOY\" MV Tiffany Makeup Inspired Look ♥소녀시대 티파니 화장 노하우','http://www.youtube.com/embed/l1WI7NQo9ic',NULL,'http://img.youtube.com/vi/l1WI7NQo9ic/0.jpg','28',13,'2013-11-15 02:29:28','2014-01-02 00:04:49','l1WI7NQo9ic','♥Please Read Me!!♥\nHello Everyone!~ Happy New Year!\nI am back with a new makeup tutorial from SNSD\'s new music video, \"I Got A Boy.\" I\'m focusing here on Tiffany\'s makeup and I apologize in advance for the filming lights, as it seems to lighten up the makeup colors. Hope you enjoy and thank you always for watching!^^\n♥Instagram: oiseau88\n♥Makeup Used♥\n1. Holika Holika Face 2 Change BB Roller\n2. Lioele Skin Fix Powder Pact, No.21 Blooming Ivory\n3. MAC Paint Pot, Soft Ochre\n4. MAC Fluidline, Blacktrack\n5. Urban Decay Naked Palette\n6. Tony Moly Cats Wink Mascara\n7. [Sponsored] Laneige The Secret of Snow Crystal, Make-up Brighter\n8. Etude House Fresh Cherry Tint\n9. [Sponsored from Imomoko.com] Les Merveilleuses Ladurée blush\n♥Music Instrumental Credits: Karaokekpop',251,0,NULL,'2013-01-04 02:52:43',1,'snsd-i-got-a-boy-mv-tiffany-makeup-inspired-look'),(795,'[131107] 트러블메이커 내일은없어 현아 메이크업 _ Trouble maker [NOW] Hyuna Make up tutorial','http://www.youtube.com/embed/W8yuPHUHIG8',NULL,'http://img.youtube.com/vi/W8yuPHUHIG8/0.jpg','29',15,'2013-11-15 06:52:37','2014-01-02 02:16:32','W8yuPHUHIG8','샤넬과 함께한 트러블메이커 현아 메이크업입니다.\n좋아요 + 구독신청 부탁드려요~~',371,0,NULL,'2013-11-06 17:15:52',1,'131107-_-trouble-maker-now-hyuna-make-up-tutorial'),(