d like? Any other suggestions? Leave it in the comments for me to see~\n\nI\'m also going to finally film a monolid tutorial on one of my girlfriends this week! Very excited to do this for you guys. Do you girls have any requests for what kind of monolid makeup you\'d like to see? :) \n\nPlease follow my Facebook, Twitter or Instagram (at least one of those) to stay in touch with me throughout the week! There are so many times I have urgent things to tell you guys or updates on things that I don\'t make a video about and I get sad when I realise I can\'t contact all of you guys here. \n\nHope you guys are having a good week so far! Stay positive, never give up in every situation! I believe in you. Praying for the Philippines and any subbies who have been affected by the recent Typhoon. May God\'s peace, strength, healing and provision be with you ♥\n\nLove Jen xox\n\n\nRecent Blogposts you might want to read:\n- You Were Made For Greatness http://bit.ly/1aMh9on\n- Mani Monday: Chanel Gondola http://bit.ly/HMmeRg\n- \"I Hated Being Korean\": My Korean Australian Story http://bit.ly/18ATGE2\n\n\nPRODUCTS FEATURED:\nMost of the brushes I used in this tutorial are from Sigma: http://bit.ly/18oEnen (10% off code NOV2013)\nEyebrow Powder Palette from LightintheBox: http://bit.ly/16BnTlE\nPeripera Lipstick and Lipglosses from Eye Amore: http://bit.ly/1gwlmPf (10% off code MJMUSE: Code is down at the moment, so type MEEJMUSE in the comments at checkout to receive 20% off! Amount will be returned to your accounts within 24 hours, only for my subscribers though!!)\nComplete list of products will be available on my blog today, after I get home from school! ^__^\n\n- - - -\n\nWHAT I\'M WEARING⇨\n\n- Body -\nTop▸ Witchery Black Singlet Top\nNecklace▸ Tiffany & Co\nRings▸ Wedding Rings from Delphi Diamonds, diamond studded ring from Korea\nNails▸ Miss Shop Oliver Wants & Sally Hanson Gem Crush 03 Big Money\nLenses▸ Circle Lenses from Eye Candy Lens (sorry I forgot the name of the