utorial :)\n \nIn this video I share with you guys my family\'s DIY Korean natural face mask that does a lot more than I could fit into the title (hence I shortened it to the few most stand-out attributes). Do this mask once or twice a week for a month and you will see your skin become: brighter, firmer, smoother, clearer, softer and more supple! Some of you may see results straight away, others may take a few! But just know that it is great for your skin. Make sure you are not allergic to any of the ingredients by doing a patch test beforehand! \n\nPlease excuse the breakouts on my forehead! (Time of the month T_T) And yes guys I\'m still getting those pimples from my previous pill experience update, but it\'s getting better and I\'m starting to only get breakouts during my TOTM. The pimples have nothing to do with the mask itself - apart from those few blemishes my skin feels amazing after cleansing off this mask. I really hope it helps some of you guys :)\n\nKombu - dried kelp - or \'다시마\' in Korean (dashima), is available at all Korean (and asian) grocery stores. Next time you make a soup or stew, try boiling some in the water before adding any other ingredients in for natural flavour enhancement! \n\nAlso, in terms of the flour ingredient, let me leave you with the options. Use unbleached/organic/wholemeal flour if you just want the most natural ingredients on your face, otherwise, if you\'re looking to brighten, it\'s really plain white (bleached) flour that will cause your skin to get lighter. I\'ll leave it up to you guys^^\n\n----\nI\'m going through all my makeup, clothes and jewellery and have to lighten my load a bit! I will be holding a blog sale within the next week so come visit if you\'re interested. \nhttp://www.meejmuse.com\n\nPlease like or comment on this video for requests, questions or just to support!\n\nLove you guys so much :)\n\nGod bless you\n\nJen.\n\n----\nSigma\'s November 10% off Coupon Code: NOV2013\nhttp://www.sigmabeauty.com/?Click=360080\n----\n\nFOLLOW ME⇨\nWebsite/Blog: http://www.meejmuse.com\nYoutube: http://www.youtube.com/meejmuse\nFacebook: http://www.facebook.com/meejmuse\nTwitter: http://www.twitter.com/meejmuse\nInstagram: http://www.instagram.com/meejmuse',313,0,NULL,'2013-09-17 09:27:59',1,'diy-korean-brightening-clear-skin-face-pack-recipe'),(834,'✰ Easy Ice Cream & Sprinkles Nail Tutorial ✰','http://www.youtube.com/embed/CzIPLdEt6iE',NULL,'http://img.youtube.com/vi/CzIPLdEt6iE/0.jpg','30',43,'2013-11-15 06:53:08','2014-01-02 02:01:11','CzIPLdEt6iE','NEW UPDATE: http://www.meejmuse.blogspot.com\nHey guys! Long time no nail tutorial^^ This is a super simple tutorial on ice-cream & sprinkles dipped nails to celebrate the new Spring season in Australia. Hope you enjoy!\n\nComment and/or like this video so I can know that you liked it and want more nail tutorials in the future~\n\nFull review & blogpost on the Essence Nail Topping Stickers and Pastel Nail Polishes (Me & My Ice Cream Range) featured in this video: http://www.meejmuse.com\n\n\n≈Featured Products≈\n\nButter London Melt Away Cuticle Eliminator\nScandal 001 Base Coat (Korean Brand)\nSally Hansen 510 I Pink I Can\nSinful Colours 953 Unicorn\nEssence 02 Always In My Mint\nEssence 03 Ice, Ice baby\nEssence 04 Icylicious\nEssence My & My Ice Cream Nail Topping Sticker 01 Rainbow Sprinkles\n\n\n----\nSigma\'s September 10% off Coupon Code: LJW2013\nhttp://www.sigmabeauty.com/?Click=360080\n----\n\nFOLLOW ME⇨\nWebsite/Blog: http://www.meejmuse.com\nYoutube: http://www.youtube.com/meejmuse\nFacebook: http://www.facebook.com/meejmuse\nTwitter: http://www.twitter.com/meejmuse\nInstagram: http://www.instagram.com/meejmuse\n\n\n\nDisclaimer: I was not paid to make this video. All opinions expressed in this video are mine.\n\nMusic: Royalty-free and permission to publish\n\'Cipher\' by Kevin McLeod\n\'Puppy Love\' by Whitefield (Thank you)',266,0,NULL,'2013-09-12 23:04:11',1,'easy-ice-cream-sprinkles-nail-tutorial'),(847,'Natural & B