눈썹 길이는 자연스러우면서\n눈매를 또렷하고 깊게 연출하기 위해 많이 사용하고 있습니다.\n아이미는 디자인이 완벽에 가깝기 때문에 눈매에 맞춰 \n가로 길이를 조절해 간편히 통으로 붙여도 자연스러워\n많은 분들이 선호하시는 제품입니다.',218,0,NULL,'2013-05-23 12:23:59',1,'39'),(974,'[피카소속눈썹] 아이미 속눈썹 38호 박태윤 아티스트 러블리 메이크업','http://www.youtube.com/embed/FhMBUJugtio',NULL,'http://img.youtube.com/vi/FhMBUJugtio/0.jpg','35',18,'2013-11-15 09:34:25','2014-01-02 06:31:48','FhMBUJugtio','아이미 아이래쉬 38호는 39호와 모양이 같고\n길이 또한 8mm로 동일 하지만\n38호가 39호 보다 연하여 서로 숱이 다른 제품입니다.\n\n아이미 38호의 경우 속눈썹 붙이는 것을 어색해 하시거나\n정말 자연스러운 것을 원하는 분들이\n좋아하실만한 제품으로 가진 속눈썹의 길이나 연령대에\n상관없이 누구나 소화 가능한 제품입니다.\n길이를 많이 늘리기 보다는 원래의 속눈썹과 합쳐져\n숱을 풍성하게 하여 눈매를 더욱 또렷하게 만들어주는\n효과를 볼 수 있습니다.\n\n연예인들의 경우 스킨케어 제품의 광고 화보 촬영시\n민낯에 가까운 메이크업을 연출할 때 많이 사용하며\n특히 마스카라를 전혀 바르지 않고 막 세안한듯\n자연스러운 얼굴을 연출할 때에도 주로 이용합니다.\n디자인이 완벽에 가깝기 때문에 눈매에 맞춰\n가로 길이를 조절해 간편히 통으로 붙여도 자연스러워\n많은 분들이 선호하시는 제품입니다.',214,0,NULL,'2013-05-22 08:30:18',1,'38'),(975,'[피카소속눈썹] 아이미 속눈썹 37호 손대식 아티스트 여배우 메이크업','http://www.youtube.com/embed/kExX7yI6Vug',NULL,'http://img.youtube.com/vi/kExX7yI6Vug/0.jpg','35',14,'2013-11-15 09:34:25','2014-01-02 00:12:38','kExX7yI6Vug','아이미 아이래쉬 37호는 36호와 모양이 같고\n길이 또한 10mm로 동일 하지만\n37호가 36호 보다 진하여 서로 숱이 다른 제품입니다.\n\n아이미 36호, 37호는 38호, 39호에 비해 길이감을 늘린 것이며\n아이미 37호는 39호 정도의 숱에 길이가 길어져\n숱과 길이감 모두 만족시켜주는 제품입니다.\n길이도 짧고 숱도 부족한 분들이 풍성한 속눈썹을 연출하시기에\n적당한 제품으로 내추럴한 메이크업은 물론 스모키 메이크업에도\n굉장히 잘 어울리며 눈매를 확실히 살려주어\n드라마틱한 속눈썹을 연출하는 효과를 줍니다.\n아이미 37호는 36호, 37호, 38호, 39호 중 길이감도 길고\n숱도 많아 가장 진하지만 속눈썹 연장술보다\n훨씬 자연스러운 느낌을 주고자 할 때\n가장 많이 이용하시는 제품입니다.\n\n일상에서 사용할 수 있는 정도의 길이감으로\n연예인들의 경우 보통 화보나 쇼보다는 자연스럽지만\n좀더 드라마틱한 눈매의 연출이 필요한 일반 방송에서\n많이 사용하는 제품입니다.\n디자인이 완벽에 가깝기 때문에 눈매에 맞춰 가로 길이를 조절해\n간편히 통으로 붙여도 자연스러워 많은 분들이\n선호하시는 제품입니다.',233,0,NULL,'2013-05-21 18:50:09',1,'37'),(976,'[피카소속눈썹] 아이미 속눈썹 36호 박태윤 아티스트 아이돌 메이크업','http://www.youtube.com/embed/RxGedh1SSSo',NULL,'http://img.youtube.com/vi/RxGedh1SSSo/0.jpg','35',15,'2013-11-15 09:34:25','2014-01-01 22:18:56','RxGedh1SSSo','아이미 아이래쉬 36호는 37호와 모양이 같고\n길이 또한 10mm로 동일 하지만\n36호가 37호 보다 연하여 서로 숱이 다른 제품입니다.\n\n아이미 3