p://www.youtube.com/embed/e7mGSBpqwHo',NULL,'http://img.youtube.com/vi/e7mGSBpqwHo/0.jpg','2',6,'2013-12-16 17:55:20','2014-01-01 23:34:08','e7mGSBpqwHo','핑크 파티 메이크업 \n파티갈 때마다 드레스코드가 있잖아요. 그래서 항상 스모키메이크업을 하기 보다는 그날 드레스코드에 맞춰서 메이크업을 해주곤 하는데요. 핑크가 드레스코드인 날, 메이크업에도 핑크 컬러 넣어주기~ :D\n\n얼마전에 트러블이 난걸 손으로 건드렸더니 이마에 흉터가 ㅠㅡㅠ 암튼 베이스부터 차근차근 해봤어요. 메이크업하며서도 이거 쓸까 저거 쓸까 고민고민. 입생로랑 유스 리버레이터 세럼 파운데이션으로 베이스를 간단하게 마무리하고, 자연스러운 눈썹 표현을 위해 펜슬 타입이 아닌 케익 타입의 샤넬 아이브로우 제품을 사용했어요. \n\n오늘 메이크업에선 롱래쉬 기능이 탁월한 조성아22 검x마스카라와 볼륨 기능이 탁월한 캐트리스 마스카라 두 가지를 사용해서 속눈썹에 힘을 주었답니다. 평소엔 한 가지 마스카라만 사용하는 편인데, 두 가지를 같이 쓰니까 한결 속눈썹에 힘이 들어가는 것 같아요. ㅎ \n\n그리고 핑크 파티메이크업인만큼 아이섀도우와 립스틱을 핑크색으로 선택. 핑크와 브라운 컬러로 아이메이크업하고, 입술에 핑크색! 특히 립스틱 같은 경우 평소에도 제가 자주 사용하는 컬러라 많이 닳았어요. ㅋㅋ  캐트리스 립스틱들이 참 좋아요. \n\n자세한 내용은 발칙한루루의 블로그 (http://rudelulu.blog.me) 에도 곧 업로드 될 예정이니까요. 놀러오세용!\n\n\n*사용제품\n__________________________\n\n입생로랑 유스 리버레이터 세럼 파운데이션 B10\n맥 파우더 블러쉬 IMMORTAL FLOWER\n샤넬 르 쑤르씨 드 샤넬 20 BRUN\n캐트리스 앱솔루트 아이 컬러 070 Mud Spencer & Coralle Hill\n토니모리 백젤 아이라이너 15 LATTE BROWN\n조성아22 검 x 마스카라 Chrome Black\n캐트리스 에볼루션 투 레볼루션 울트라 블랙 볼륨 마스카라\n캐트리스 얼티미트 컬러 210 PINKADILLY CIRCUS',898,0,NULL,'2013-11-25 05:56:49',1,'with-22'),(4208,'ABSOLUT 2013 앱솔루트 블루 런칭 파티 @세빛둥둥섬','http://www.youtube.com/embed/VKA81NsS-v0',NULL,'http://img.youtube.com/vi/VKA81NsS-v0/0.jpg','2',NULL,'2013-12-16 17:55:20','2013-12-19 18:39:03','VKA81NsS-v0','ABSOLUT BLUE Launching Party @세빛둥둥섬\n2013 앱솔루트 리미티드 에디션 \'앱솔루트 블루\' 런칭 파티에 다녀왔어요. 깨끗한 앱솔루트 바틀에 코발트 블루 한 방울이 흘러내리면서 그려진 모습은 400백만개의 리미티드 에디션이 모두 다르다는 것! 그게 더 특별한 앱솔루트 블루에요.',47,0,NULL,'2013-11-24 12:59:44',NULL,'absolut-2013'),(4209,'FHI 블랙스완 미니고데기 : 헤어 스타일링 못하는 발칙한루루는 이렇게 써요!','http://www.youtube.com/embed/UVCNGlXntYM',NULL,'http://img.youtube.com/vi/UVCNGlXntYM/0.jpg','2',NULL,'2013-12-16 17:55:21','2013-12-19 18:39:04','UVCNGlXntYM','FHI HEAT® BLACK SWAN \n핑크 플레이트가 전원을 켜면 하얀색으로 변하는 미니고데기에요. \n\n휴대할 수 있는 파우치도 있고, 전선이 본체랑 분리가 되서 가방에 넣어 다니기도 좋더라고요! 여행 갈 때 특히 더 유용할만한 사이즈! ^0^ \n\n저는 고데기를 잘 할 줄 몰라서 컬을 넣는 건 어려워 하는 편이라, 간단하게 머리 묶고 옆머리 정도만 정돈하는 용도로 자주 사용하는데요. 열판 온도도 너무 뜨겁지 않고 적당한 것 같고, 열판에 10가지 미네랄 성분을 함유하고 있어서 그런지 제가 기존에 사용하던 고데기보다 FHI 블랙스완 미니고데기로 머리 정돈하는게 더 머릿결이 좋은 느낌이에요. \n\n집에서도 쓰고, 밖에서도 쓰고! \n미니고데기는 처음인데 가볍고, 편하고, 좋아요~♥',136,0,NULL,'2013-11-22 01:00:07',NULL,'fhi'),(4210,'터치인솔 튜토리얼 키트 Vol.3 러블리 데이트 룩','http://www.youtube.com/embed/AA_MDmQHVxQ',NULL,'http://img.youtube.com/vi/AA_MDmQHVxQ/0.jpg','2',NULL,'2013-12-16 17:55:21','2013-12-19 18:39:04','AA_MDmQHVxQ','터치인솔 튜토리얼 키트 Vol.3 러블리 데이트 룩 \n메이크업 키트 하나에 베이스 빼고 나머지 포인트 메이크업 제품이 들어있더라고요. 그냥 슥슥~ 들어있는 제품을 사용하기만 하면 러블리 데이트 룩이 완성 되는 키트. ㅋㅋㅋ 저랑은 아이브로우 컬러가 안맞아서 그 점이 조금 아쉬웠지만, 다른 컬러는 은은하고 자연스러운 데이트룩이나 데일리룩에 잘 어울리는 것 같아요. 제품 구성이나 자세한 내용은 블로그(http://rudelulu.blog.me)에서 확인해주세요. 조만간 업로드할께요~:D',550,0,NULL,'2013-11-20 12:41:29',NULL,'vol-3'),(4211,'S.diary Miracle Control Cleanser : 메이크업 제품에만 반응하는 신기한 클렌저','http://www.youtube.com/embed/5BvOODsvoEM',NULL,'http://img.youtube.com/vi/5BvOODsvoEM/0.jpg','2',NULL,'2013-12-16 17:55:21','2013-12-19 18:39:04','5BvOODsvoEM','S.diary Miracle Control Cleanser \n메이크업 제품에만 반응하는 신기한 클렌저 \'에스다이어리 미라클 컨트롤 클렌저\'에요. 아무것도 없는 피부 위에서는 거품이 그대로~ 그런데 메이크업 제품들만 만나면 거품이 막 뽀글뽀글 거리는 듯 하다가 녹아버리더라고요. 신기방기. ㅋ 자세한 리뷰는 발칙한루루의 블로그 http://rudelulu.blog.me 에서 곧 만나보실 수 있습니다. 오늘은 없어요~ ㅎㅎ 담에 놀러오세용!',103,0,NULL,'2013-11-18 07:45:39',NULL,'s-diary-miracle-control-cleanser'),(4212,'SKINFOOD) 스킨푸드 흑석류 터치 마스크 활용영상 @ 발칙한루루','http://www.youtube.com/embed/YOigVKdszTA',NULL,'http://img.youtube.com/vi/YOigVKdszTA/0.jpg','2',NULL,'2013-12-16 17:55:21','2013-12-19 18:39:04','YOigVKdszTA','SKINFOOD\n스킨푸드 흑석류 터치 마스크 활용 영상이에요. 탱글탱글한 실리콘 팁이 마사지하는 재미가 있어요. 그리고 지금 보고 계신 영상은 스킨푸드 홈페이지에서도 확인할 수 있답니다. 11월 30일까지 이벤트가 진행중이거든요~ ㅎ 스킨푸드 홈페이지에서 참여하시고 흑석류 볼류밍 라인 제품들 받아보세요. 제품들 다 좋아요! ^^\n\n*이벤트페이지\nhttp://www.theskinfood.com/event/20131105/index.asp',58,0,NULL,'2013-11-09 14:42:24',NULL,'skinfood'),(4213,'SKINFOOD) 스킨푸드 흑석류 오일 활용영상 @ 발칙한루루','http://www.youtube.com/embed/jjCRLDbSHeg',NULL,'http://img.youtube.com/vi/jjCRLDbSHeg/0.jpg','2',NULL,