피부를 유지할 수 있어요. 메이크업아티스트 조성아의 조성아22 네트 아쿠아 컬러 \'핑크마카롱\' 컬러로 볼에 핑크빛 생기와 약간의 광채를 주면 더 화사해진답니다.\n\n발칙한루루\'s BLOG\nhttp://rudelulu.blog.me',624,0,NULL,'2013-04-12 16:04:17',NULL,'part1--2'),(4239,'[TONYMOLY] LULU\'s Spring Make-up Part2 : Eye & Lip','http://www.youtube.com/embed/Zs_7D7kVZo4',NULL,'http://img.youtube.com/vi/Zs_7D7kVZo4/0.jpg','2',NULL,'2013-12-16 17:55:23','2013-12-19 18:39:05','Zs_7D7kVZo4','LULU\'s Spring Make-up Part2 : Eye & Lip\n토니모리(TONYMOLY) 제품을 이용한 스프링 메이크업입니다.\n\n두 번째 영상 속 베이스에서 사용한 제품은\n토니모리 딜라이트 블러셔와 딜라이트 모노 섀도우예요.\n\n!!!!!!\n그리고 도중에 엄청 시끄러운 부분이 있으니까 볼륨을 작게 해주세요.\n깜짝 놀랄만한 엄청난 사이렌 소리가 울릴거예요. (저한테 욕하기 없기~)\n\n자세한 내용은 발칙한루루의 블로그\nhttp://rudelulu.blog.me 에서 확인해주세요. :D',574,0,NULL,'2013-04-04 02:18:55',NULL,'tonymoly-lulu-s-spring-make-up-part2-eye-lip'),(4240,'[TONYMOLY] LULU\'s Spring Make-up Part1 : Face','http://www.youtube.com/embed/etBWgwkj9PI',NULL,'http://img.youtube.com/vi/etBWgwkj9PI/0.jpg','2',NULL,'2013-12-16 17:55:23','2013-12-19 18:39:05','etBWgwkj9PI','LULU\'s Spring Make-up Part1 : Face\n토니모리(TONYMOLY) 제품을 이용한 스프링 메이크업입니다.\n\n첫 번째 영상 속 베이스에서 사용한 제품은\n루미너스 여신광채 생기 멜팅 파운데이션 - 23 스킨 베이지 입니다.\n들뜸없이 착착 감기는 자연스러운 피부 표현이 가능한 제품이예요.\n\n자세한 내용은 발칙한루루의 블로그\nhttp://rudelulu.blog.me 에서 확인해주세요. :D',424,0,NULL,'2013-04-04 02:12:52',NULL,'tonymoly-lulu-s-spring-make-up-part1-face'),(4241,'BIOTHERM 비오템 아쿠아수르스 수분 앰플 에센스 사용후기','http://www.youtube.com/embed/pcuGlKcLhUo',NULL,'http://img.youtube.com/vi/pcuGlKcLhUo/0.jpg','2',NULL,'2013-12-16 17:55:23','2013-12-19 18:39:05','pcuGlKcLhUo','BIOTHERM AQUASOURCE DEEP SERUM\n비오템 아쿠아수르스 수분 앰플 에센스\n\n새로나온 비오템의 신상 에센스를 사용해봤어요.\n아쿠아수르스의 친근한 향이 느껴지고, 피부에 사용하면 촉촉하고 광채가 납니다.\n비오템의 핵심성분인 \'활성 스파 플랑크톤\'을 3배 더 농축시켜 담았다고 하구요.\n마노스와 진주 펄 성분이 촉촉한 빛이 나는 피부로 가꿔준다고 해요.\n\n잠깐 동안 끈적임이 있는건가 싶다가\n흡수가 되고 나면 끈적임은 사라지고, 촉촉한 광채가 남더라구요.\n또 강력한 수분 침투력 때문인지 에센스 사용 후 크림을 바르지 않아도 당기지 않았어요.\n(참고로 저는 수분부족형 지성피부입니다.)\n\n상세리뷰는 발칙한루루의 블로그\nhttp://rudelulu.blog.me에 업로드될 예정입니다.\n많이 놀러와주세용. ㅎ',201,0,NULL,'2013-04-03 10:56:46',NULL,'biotherm'),(4