าศ : ทุกวันพฤหัสบดี เวลา 00.00 - 00.30 น. (เที่ยงคืน-เที่ยงคืนครึ่ง) ทางช่อง 9 (โมเดิร์นไนน์ ทีวี)\n\nfollow at here :\n\nfacebook คู่ซี้ตีเนียน : http://www.facebook.com/KhuSiTiNeiyn?fref=ts\n\nfacebook pearypie : http://www.facebook.com/pearypiemakeupartist?fref=ts',2370,0,NULL,'2012-09-28 23:22:00',NULL,'pearypie'),(4255,'Pearypie: Sweet Soft Curls Hair\"','http://www.youtube.com/embed/z8Jg_GtZEcc',NULL,'http://img.youtube.com/vi/z8Jg_GtZEcc/0.jpg','4',NULL,'2013-12-16 17:55:30','2013-12-19 18:39:05','z8Jg_GtZEcc','My usual soft curl hair look\nProduct List\nHair Serum\" Erb\" Aslip of Shine\nHeat Styling \"TRESemmé\" Heat Tamer Protective Spray\nCurve Straightener \"Le\' Sasha\" OMG\n\nwww.facebook.com/pearypiemakeupartist\nVideo by Jeto Panithi',186,0,NULL,'2012-08-22 12:26:04',NULL,'pearypie-sweet-soft-curls-hair'),(4256,'Pearypie: Etude House Thailand \"Shiny Fresh Look\"','http://www.youtube.com/embed/-kH9kIgxqwc',NULL,'http://img.youtube.com/vi/-kH9kIgxqwc/0.jpg','4',NULL,'2013-12-16 17:55:30','2013-12-19 18:39:05','-kH9kIgxqwc','Etude House Thailand \"Shiny Fresh Look\" feat Pearypie\nช่วงนี้เปิดเทอมกันแล้ว สาวๆ ที่ต้องแต่งหน้าไปเรียนทุกวันอาจจะเกิดอาการเบื่อกับลุคเดิมๆ ของเราได้ ในคลิปนี้อีทูดี้ก็มีเคล็ดลับแต่งหน้าดีๆ จากคุณ แพร อมตา จิตตะเสนีย์ (Pearypie) Beauty influencer ที่ได้แปลงโฉม น้องอริส อริสา คุราตะ Etude House Princess Thailand 2012 นางแบบของเรา ให้กลายเป็นสาวหวานอมเปรี้ยวขึ้นมาเลยทีเดียว รับรองว่านอกจากจะดูดีแล้ว ยังแต่งไม่ยากอีกด้วย มาลองติดตามดูกันเลยดีกว่าค่ะ ^^',715,0,NULL,'2012-08-20 09:03:58',NULL,'pearypie-etude-house-thailand-shiny-fresh-look'),(4257,'Pearypie: \"Chalkwave\"','http://www.youtube.com/embed/pAaYrVMdiqQ',NULL,'http://img.youtube.com/vi/pAaYrVMdiqQ/0.jpg','4',NULL,'2013-12-16 17:55:30','2013-12-19 18:39:05','pAaYrVMdiqQ','Hair Coloir Chalk or colour rub \"masters pastel\"\n*noted* you may also use any Soft chalk pastels too\nHi, this is my first hair tutorial- it is all about non-permanent hair colour + wave curl. I hope you enjoy this!\n\nIf you are looking for an easy non-permanent way to dye the ends of your hair, hair chalking might just be the thing for you. People have been chalking their hair for a very long time so don\'t worry about it killing your hair because it won\'t. This is very fun if you want to try something new out but don\'t want to go permanent.\n\nProduct list\nCurling Tong \"LE\'SASHA\"- Spiral\nHair Coloir Chalk or colour rub \"masters pastel\"\n*noted* you may also use any Soft chalk pastels too\nHair Styling \"Liese\"  Super Hard Hair Spray\n\n\nTIPS:\n1. if you have blonde hair,do not wet before chalking, as this will stain the hair.\nBrunettes need the water, as this releases more pigment in the chalk and allows it to show on dark hair\n2.You do not need to use HAIR chalk ,inexpensive ones can be found at craft stores \n3.the color will rub off on your clothes over the course of the day, so wear a color similar to your chosen pastels.\n4.Before showering, brush your hair. This will get rid of most of the chalk.\n5.Conditioning treatment is a MUST after you wash out your chalk.\n\nwww.facebook.com/pearypiemakeupartist',186,0,NULL,'2012-08-09 15:41:06',NULL,'pearypie-chalkwave'),(4258,'Pearypie: \"Summer Getaway\"','http://www.youtube.com/embed/wTGjkTw1ZWk',NULL,'http://img.youtube.com/vi/wTGjkTw1ZWk/0.jpg','4',NULL,'2013-12-16 17:55:30','2013-12-19 18:39:06','wTGjkTw1ZWk','Fun, fresh makeup look\nMakeup list:\nSunscreen: Biore UV Aqua Rich SPF 50+\nBB Cream: Etude House \"Precious Mineral Sun BB cream\"\nConcealer: Benefit \"Erase Paste\"\nLoose Powder: Bobbi Brown \"light\"\nBlush on: Bisous Bisous\"Berry picnic Blusher 1\"\nBronzer: Too faced \"Sun Bunny\"\nEyebrow Pencil: Kate \"Lasting eyebrow W\"\nEyeshadow: Lola \"Organza\"\nLiquid Liner: Etude House\"Proof 10\"\nEyeliner: IN2IT \"Pearl silver\"\nMascara: Maybelline \"hyper curl volume express waterproof\"\nFalse Lashes: View eyelash \"21\"\nLip liner: MAC \"Entertain me\"\nLipstick: Kat Von D \"A-Go-Go\"\nContactlens: Neo Cosmo\"Green\"\n\nDress:\nGlasses: Mooeyewear\nOrange dress:Munchus\nGreen Dress: Mistymynx\nFlower headband: Mindmilinery\n\nlocation: Cha-am, Thailand\n\nwww.facebook.com/pearypiemakeupartist\n\nFilmed by Jeto Panithi Nawasmittawong',171,0,NULL,'2012-08-03 08:47:43',NULL,'pearypie-summer-getaway'),(4259,'Pearypie: \"Bioré, Make-up girl must have\"','http://www.youtube.com/embed/RzgHYTVsNhQ',NULL,'http://img.youtube.com/vi/RzgHYTVsNhQ/0.jpg','4',NULL,'2013-12-16 17:55:30','2013-12-19 18:39:06','RzgHYTVsNhQ','Pearypie as a Brand Ambassador for Bioré Makeup Remover Advertisement campaign\n\n﻿\"ในฐานะ Brand Ambassador  คนแรกของ Bioré : Makeup remover  ในประเทศไทย แพรขอเชิญชวนเพื่อนๆที่รักการแต่งหน้าหันมาใช้ Make-up removerค่ะ เครื่องสำอางเป็นตัวช่วยที่ทำให้คนเราสวยขึ้นมาได้ แต่ขณะเดียวกันเราต้องรักผิวหน้าของเราและดูแลให้ดีด้วยค่ะ\"\n\nจากผลสำรวจสาวไทยส่วนใหญ่ไม่ใช้ Make-up Remover\nบางคนแค่ใช้กระดาษเปียกเช็ดหน้าอย่างเดียว บางคนนั่งแกะ eyelinerหรือดึงmascara จากขนตาออกระหว่างกลับบ้าน แล้วล้างหน้าด้วยแค่โฟมหรือเช็ดโทนเนอร์\nมันไม่พอค่ะ นอกจากหน้าจะไม่เนียนแล้วยังเป็นเหตุก่อสิวอุดตันอีกด้วย\n\nMake-up Remover คือผลิตภัณฑ์ที่ชำระล้างเครื่องสำอางออกจากบนใบหน้า ไม่ว่าจะเป็น รองพื้น บีบี eyeliner mascara หรือสิ่งที่ใช้มาแต่งแต้มหน้าให้สวย\nMakeup remover ใช้เพื่อทำความสะอาดในขั้นตอนแรกเราล้างหน้า การล้างหน้าด้วยโฟมนั้นไม่พอ เพราะโฟมล้างหน้าส่วนใหญ่ชำระล้างแต่ฝุ่นละออง\nไม่ว่าคุณจะแต่งหน้าแบบจัดหนักหรือใสๆในวันเบาๆ  และอยากให้ผิวเราสวยใสและอยู่กับเราไปนานๆ Make-up remover เป็นสิ่งที่สำคัญมากค่ะ :)\n\n\nhttp://www.biorethailand.com/\nhttp://www.kao.com/th/product/biore.html\nhttp://www.facebook.com/Biorethailand\nhttp://www.facebook.com/pearypiemakeupartist\n\nFilmed by Jeto Panithi Nawasmittawong',121,0,NULL,'2012-08-01 02:57:49',NULL,'pearypie-biore-make-up-girl-must-have'),(4260,'Pearypie: Maybelline 6 liners 6 styles','http://www.youtube.com/embed/Fk6E07Q3cic',NULL,'http://img.youtube.com/vi/Fk6E07Q3cic/0.jpg','4',NULL,'2013-12-16 17:55:30','2013-12-19 18:39:06','Fk6E07Q3cic','How To เซตนี้เราเตรียมมาสำหรับสาวๆ ที่ชอบการเขียนขอบตาโดยเฉพาะ\nItem สำคัญคือ Maybelline Hyper Glossy Eyeliner ใหม่มาแรง!!!\nอายไลเนอร์ชนิดน้ำแบบจุ่ม สูตรฟิล์มเทคโนโลยีสุดพิเศษมอบความดำเงาแบบกลอสซี่มากกว่าอายไลเนอร์ธรรมดาๆ ถึง 10 เท่า ติดทนนานไม่เลอะเปื้อนยาวนานถึง 25 ชั่วโมง หัวแปรงพิเศษสุดล้ำควบคุมทิศทางให้เขียนง่ายกรีดเรียบครั้งเดียวอยู่\n\nในคลิปนี้ Makeup Artist PearyPie มาชวนคุณ ท้าให้โดดเด่น ด้วยการเขียนขอบตา 6 ระดับ 6 สไตล์ แล้วคุณล่ะ! กล้าไหม...กล้าที่จะโดดเด่น สู่อีกระดับของดวงตาคมเด่นแบบเน้นๆ ถึง 6 ระดับ!!\n\nระดับ 1 Beginner basic สำหรับวันเบาๆ เป็นธรรมชาติ สำหรับมือใหม่หัดเขียน\nระดับ 2 Everyday Chic อัพลุคในวันทำงานด้วยไลเนอร์เส้นหนาขึ้นแบบWing liner\nระดับ 3 Date Night เพียงเขียนขอบตาด้านล่างเพิ่มก็ไปดินเนอร์เดทกับชายหนุ่มได้\nระดับ 4 Fashionista อัพลุคเป็นสาวแฟชั่นนิสต้าเปรี้ยวซ่าโดยเติมอายไลเนอร์ที่หัวตา\nระดับ 5 Runway Diva เทรนด์เมคอัพลุคจากรันเวย์เพียงกรีดตาด้านล่างแบบเว้นขอบตา\nระดับ 6 Party Queen โดดเด่นถึงขีดสุดในทุกงานปาร์ตี้สุดด้วยการเพิ่มหัวตาและหางตาให้ยาวออกมา เปรี้ยวสุดๆไปเลย\n\nwww.facebook.com/pearypiemakeupartist\nwww.facebook.com/maybellinethailand\n\nFilmed by Jeto Panithi Nawasmittawong',282,0,NULL,'2012-07-13 11:58:25',NULL,'pearypie-maybelline-6-liners-6-styles'),(4261,'Coming soon: คู่ซี้ตีเนียน','http://www.youtube.com/embed/_WG70eriBVg',NULL,'http://img.youtube.com/vi/_WG70eriBVg/0.jpg','4',NULL,'2013-12-16 17:55:30','2013-12-19 18:39:06','_WG70eriBVg','Video created with the Socialcam app on iPhone: http://socialcam.com',26,0,NULL,'2012-06-24 13:05:11',NULL,'coming-soon'),(4262,'Pearypie\'s Makeup Workshop อธิบายกิจกรรมและกติกา','http://www.youtube.com/embed/kVHZ2K6nzNQ',NULL,'http://img.youtube.com/vi/kVHZ2K6nzNQ/0.jpg','4',NULL,'2013-12-16 17:55:30','2013-12-19 18:39:06','kVHZ2K6nzNQ','watch my Video teaser\n\nhttp://youtu.be/PqPwkEoURMk\n\nครั้งแรกในประเทศไทย ที่คุณจะได้เรียนแต่งหน้าและร่วมพูดคุยแฮงเอาท์ แบบสดๆ บนหน้าจอคอมพิวเตอร์ของคุณเอง กับ PEARYPIE สาวน้อยที่กำลังมาแรงอยู่ขณะนี้ ที่จะมาบอกเค