013-07-31 13:20:52',NULL,'belif-sticky-monster-lab-2'),(4443,'2012 빌리프 촉촉 갤러리 현장 스케치','http://www.youtube.com/embed/LzrL55mpcik',NULL,'http://img.youtube.com/vi/LzrL55mpcik/0.jpg','10',NULL,'2013-12-16 17:56:00','2013-12-19 18:39:13','LzrL55mpcik','2012 빌리프 촉촉갤러리를 방문하지 못하신 분들을 위해 준비한 \n현장 스케치 영상입니다.\n\n온 세상을 바꾸는 따뜻한 생각,\n빌리프의 촉촉한 나눔과 함께 해주세요.',70,0,NULL,'2012-10-22 06:13:41',NULL,'2012--2'),(4444,'빌리프 온 세상 촉촉 캠페인','http://www.youtube.com/embed/BJqGAB257mY',NULL,'http://img.youtube.com/vi/BJqGAB257mY/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','BJqGAB257mY','\"The Moist Land of Africa\"는\n온 세상 촉촉 캠페인의 이름으로\n물 부족으로 고통받는 우리의 이웃들을 함께 생각하기 위해 \n진행되는 착한 프로젝트입니다.\n\n우리는 우간다의 Budumba 마을에 우물을 지어주기 위해서\n마음을 담은 감성적인 작품들로 마실 물조차 없어서 고통받고 있는\n아프리카의 이야기를 전달하고 많은 사람들과 함께하고 싶었습니다.\n\n마음을 함께해준 여섯명의 작가들과 \n짐바브웨 타파라 마을 어린이들의 작품이 전시되는\nEXHIBITION - \" The Moist Land of Africa \"에\n오셔서 우간다의 Budumba 마을 친구들을 위해\n여러분의 마음을 더해 주세요.',110,0,NULL,'2012-10-16 01:30:16',NULL,'--93'),(4445,'The Moist Land Of Africa','http://www.youtube.com/embed/vAR1yNOMMSA',NULL,'http://img.youtube.com/vi/vAR1yNOMMSA/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','vAR1yNOMMSA','\'온 세상 촉촉 캠페인\'은 \"온 세상을 촉촉하게\"라는 비전을 품고 \nbelif와 월드비전이 함께 펼치고 있는 지구촌 나눔 캠페인입니다. \n건조한 환경에서 고통 받고 있는 이웃들에게 보습폭탄, 모이스춰라이징 밤을 \n기부하고, 아프리카에 우물을 짓는 등 다양한 활동을 펼치고 있는 \n\'온 세상 촉촉 캠페인\'의 의미를 감각적으로 담아낸 영상입니다. \n영상을 즐기며 belif의 촉촉한 나눔에 함께 해주세요.\n\n세상을 촉촉하게 하는 20가지 이야기들 \n20 Moist moments \n\n당신의 몸과 마음을 촉촉하게 적셔줄, 20가지의 특별한 순간들을 지금 느껴보세요.',263,0,NULL,'2012-10-08 08:18:02',NULL,'the-moist-land-of-africa'),(4446,'The Moist Land Of Africa','http://www.youtube.com/embed/5-H1QRKwFXg',NULL,'http://img.youtube.com/vi/5-H1QRKwFXg/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','5-H1QRKwFXg','\'온 세상 촉촉 캠페인\'은 \"온 세상을 촉촉하게\"라는 비전을 품고 \nbelif와 월드비전이 함께 펼치고 있는 지구촌 나눔 캠페인입니다. \n건조한 환경에서 고통 받고 있는 이웃들에게 보습폭탄, 모이스춰라이징 밤을 \n기부하고, 아프리카에 우물을 짓는 등 다양한 활동을 펼치고 있는 \n\'온 세상 촉촉 캠페인\'의 의미를 감각적으로 담아낸 영상입니다. \n영상을 즐기며 belif의 촉촉한 나눔에 함께 해주세요.\n\n세상을 촉촉하게 하는 20가지 이야기들 \n20 Moist moments \n\n당신의 몸과 마음을 촉촉하게 적셔줄, 20가지의 특별한 순간들을 지금 느껴보세요.',262,0,NULL,'2012-10-05 09:53:38',NULL,'the-moist-land-of-africa--2'),(4447,'belif talk film teaser','http://www.youtube.com/embed/hnH7zBfUrAg',NULL,'http://img.youtube.com/vi/hnH7zBfUrAg/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','hnH7zBfUrAg','빌리프 패밀리의 피부 고민에 대한 해답을 전문가와 함께 찾아보는 진솔한 대화의 장, 빌리프 토크 필름의 티저 영상을 공개합니다. 곧 오픈될 토크 필름 1편도 기대해주세요~! ^^',61,0,NULL,'2012-09-12 09:09:37',NULL,'belif-talk-film-teaser'),(4448,'belif ost 3rd - 06. boa noite','http://www.youtube.com/embed/aFHm1fxJ3Is',NULL,'http://img.youtube.com/vi/aFHm1fxJ3Is/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','aFHm1fxJ3Is','조용한 겨울밤의 자장가. good night라는 뜻의 포르투칼어입니다.',118,0,NULL,'2011-11-29 08:42:37',NULL,'belif-ost-3rd-06-boa-noite'),(4449,'belif ost 3rd - 03.incremento','http://www.youtube.com/embed/2vJrn2fyxXA',NULL,'http://img.youtube.com/vi/2vJrn2fyxXA/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','2vJrn2fyxXA','이번 시즌의 메인 아이템인 essence의 테마곡. 경쾌하고 단순한 멜로디를 통해 에센스의 본질과 감성을 표현하고 있습니다.',163,0,NULL,'2011-11-21 05:23:48',NULL,'belif-ost-3rd-03-incremento'),(4450,'빌리프 영국 해로즈백화점 홍보 동영상','http://www.youtube.com/embed/FJAUUqHQmKc',NULL,'http://img.youtube.com/vi/FJAUUqHQmKc/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','FJAUUqHQmKc','지난 8월 28일 빌리프가 영국의 명품 백화점인 해로즈백화점에 당당히 입성했습니다! 한국-EU FTA 발효를 계기로 코트라(KOTRA)가 해로즈백화점에서 주최한 [한국특별전]에 참가한 것인데요, [한국특별전]은 세계적인 디자이너 이상봉, 슈콤마보니 등 패션, 문화를 비롯해 다양한 분야의 대한민국 넘버원 브랜드를 소개하기 위해 마련된 자리로, 국내 화장품 브랜드로는 유일하게 빌리프가 초대되어 한국 뷰티 파워를 발휘했습니다^^ \n빌리프는 에든버러에 위치한 네이피어스 매장 3곳에 이미 입점되어 영국 고객에게 친숙할 뿐만 아니라, 과대포장과 광고 없이 합리적인 가격으로 제품을 선보이는 정직한 브랜드이고, 더불어 동물유리 성분, 합성 방부제등을 사용하지 않아 안전하다는 것이 빌리프가 유일하게 초청받은 이유입니다!\n이번 행사 참여로 빌리프의 탁월한 제품력이 다시 한번 세계에서 인정받게 되어 너무 기쁘네요^^\n\n멋진 홍보 영상 만들어주신 분들 소개해드리겠습니다!\ncredit\nproduction - belif\ndirecting&art -communication woody\nediting1&C.G-jeong hee lee\nediting2-kino\ncinematography-euijeong hong',120,0,NULL,'2011-09-27 01:18:09',NULL,'--94'),(4451,'belif_1stanniversary.avi','http://www.youtube.com/embed/eBRxyzbuU_M',NULL,'http://img.youtube.com/vi/eBRxyzbuU_M/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','eBRxyzbuU_M','영국 150년 역사의 전문 허브샵 Napiers의 전통과 철학을 이어받아, 새로운 가치를 더한 트루 허브 코스메틱, 빌리프가 첫번째 생일을 맞이하였습니다. 그 의미있는 첫 해를 기념하고자 제작된 새로운 빌리프 movie를 감상하세요.',72,0,NULL,'2011-08-23 09:25:39',NULL,'belif_1stanniversary-avi'),(4452,'belif Movie \"The True cream\" by sticky monster lab.','http://www.youtube.com/embed/jQYSK29YlYU',NULL,'http://img.youtube.com/vi/jQYSK29YlYU/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','jQYSK29YlYU','스티키몬스터랩에서 제작한 네번째 빌리프 무비 \"The True cream\" 입니다. \n빌리프 \'Moisturizing bomb/Aqua bomb\' 이 건조한 피부에 수분을 가득 채워주는 모습을 귀여운 캐릭터로 표현한 영상입니다.',11,0,NULL,'2011-05-17 05:18:40',NULL,'belif-movie-the-true-cream-by-sticky-monster-lab'),(4453,'belif Movie \"Secret Water\" by sticky monster lab.','http://www.youtube.com/embed/hQi_GCO6kmU',NULL,'http://img.youtube.com/vi/hQi_GCO6kmU/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','hQi_GCO6kmU','스티키몬스터랩에서 제작한 세번째 빌리프 무비 \"Secret Water\" 입니다. 빌리프 \'Hungarian Water Essence\' 의 모습을 표현하였으며, 수분이 부족할 때 사용하면 쏙 스며들어 수분을 채워주고, 헝가리 여왕에게는 젊음을 되찾아 주는 모습을 재밌게 표현한 영상입니다.',12,0,NULL,'2011-05-17 05:16:51',NULL,'belif-movie-secret-water-by-sticky-monster-lab'),(4454,'belif Movie \"Two Drops of Magic\" by sticky monster lab.','http://www.youtube.com/embed/mxSdPvvRTVg',NULL,'http://img.youtube.com/vi/mxSdPvvRTVg/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','mxSdPvvRTVg','스티키몬스터랩에서 제작한 두번째 빌리프 무비 \"Two Drops of Magic\" 입니다. 빌리프 \'The True Anti-Aging Essence\' 의 카렌듈라 초보습 휘핑크림 층과 아사이 베리 항산화 에센스층이 피부에 흡수되는 과정을 귀엽고 말랑말랑한 캐릭터가 재밌게 설명해드리는 영상입니다.',14,0,NULL,'2011-05-17 04:52:56',NULL,'belif-movie-two-drops-of-magic-by-sticky-monster-lab'),(4455,'belif Movie \"I am belif-belif Story\" by sticky monster lab.','http://www.youtube.com/embed/kN03Y9toX08',NULL,'http://img.youtube.com/vi/kN03Y9toX08/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','kN03Y9toX08','스티키몬스터랩에서 제작한 빌리프 무비 \"I am belif-belif Story\" 입니다. 빌리프의 탄생과정과 빌리프의 정신, 모토를 귀엽고 아기자기한 영상으로 쉽게 보실 수 있습니다.',172,0,NULL,'2011-05-17 03:01:12',NULL,'belif-movie-i-am-belif-belif-story-by-sticky-monster-lab'),(4456,'belif ost 1st - 01. the formula','http://www.youtube.com/embed/cE9TSWuh5vg',NULL,'http://img.youtube.com/vi/cE9TSWuh5vg/0.jpg','10',NULL,'2013-12-16 17:56:01','2013-12-19 18:39:14','cE9TSWuh5vg','belif의 제품군들을 구성하는 성분들은 매우 다양한 요소들의 조합으로 되어 있습니다. 드럼과 오르간, 기타와 보컬, 이렇게 다양한 소리들이 모여서 즐거운 하모니를 내듯이 말이죠',167,0,NULL,'2011-04-26 07:59:58',NULL,'belif-ost-1st-01-the-formula'),(4457,'belif ost 2nd - 07. toy&bells(cd bonus track)','http://www.youtube.com/embed/YrBrECblySw',NULL,'http://img.youtube.com/vi/YrBrECblySw/0.jpg','10',NULL,'2013-12-16 17:56:02','2013-12-19 18:39:14','YrBrECblySw','belif가 선물하는 크리스마스 경음악! belif의 사운드트랙을 담당하고 있는 espionne가 제공하는 이번 크리스마스 캐롤은 어린시절을 항상 들뜨게 만들었던 크리스마스에 벨소리와 선물에 대한 음악입니다. 모든 분들이 따뜻한 마음의 선물을 주고 받는 크리스마스가 되었으면 좋겠네요.',158,0,NULL,'2011-04-26 07:25:57',NULL,'belif-ost-2nd-07-toy-bells-cd-bonus-track'),(4458,'belif ost 2nd - 06. monsoon season pt.1','http://www.youtube.com/embed/6RQoH5I2xlY',NULL,'http://img.youtube.com/vi/6RQoH5I2xlY/0.jpg','10',NULL,'2013-12-16 17:56:02','2013-12-19 18:39:14','6RQoH5I2xlY','벌써 장마철입니다. 왈츠 리듬처럼 내리는 빗방울은 자연이 우리에게 주는 풍성한 리듬입니다. 이 노래의 멜로디는 창문을 두드리는 빗방울의 높낮이를 연상하며 만들어졌습니다.',112,0,NULL,'2011-04-26 04:14:16',NULL,'belif-ost-2nd-06-monsoon-season-pt-1'),(4459,'belif ost 2nd - 05. raindrops','http://www.youtube.com/embed/Q7IpLZMrjAM',NULL,'http://img.youtube.com/vi/Q7IpLZMrjAM/0.jpg','10',NULL,'2013-12-16 17:56:02','2013-12-19 18:39:14','Q7IpLZMrjAM','가벼운 산책과 함께 맞는 이슬비는 초여름에만 느낄 수 있는 신선함입니다. 빌리프의 보습 제품들처럼 경쾌하면서 끈적이지 않는 담백한 멜로디는 빗방울 소리와 함께하는 소리의 산책입니다.',214,0,NULL,'2011-04-26 01:57:10',NULL,'belif-ost-2nd-05-raindrops'),(4460,'belif ost 2nd - 04. white balance','http://www.youtube.com/embed/mGB5cDIpzuI',NULL,'http://img.youtube.com/v