을 선보이는 마스터 클래스 시간을 가졌다.',83,0,NULL,'2010-12-01 07:24:15',NULL,'key-note-master-class'),(4632,'바비 브라운 이화여대 강연','http://www.youtube.com/embed/eyEqYiNWcsQ',NULL,'http://img.youtube.com/vi/eyEqYiNWcsQ/0.jpg','14',NULL,'2013-12-16 17:56:29','2013-12-19 18:39:21','eyEqYiNWcsQ','세계적인 메이크업 브랜드 바비 브라운의 창립자이자 CEO인 바비 브라운 여사가 16일 이화여대 강단에 섰다. \n\n바비 브라운은 자신의 이름을 딴 화장품 브랜드 \'바비 브라운\'의 론칭 20주년을 앞두고 처음으로 한국을 방문했으며, 공식 첫 행사로 차세대 여성 리더들을 위한 커리어 특강을 진행한 것. 바비 브라운은 \"나의 창업 스토리(How did I create my brand)\"라는 주제로 메이크업 아티스트로 시작해 자신만의 브랜드를 창립하고 글로벌 브랜드로 키워온 성공 스토리를 들려줬다. \n\n1시간 남짓한 강연 시간 동안 바비 브라운은 메이크업에 대한 애정, 여성으로서의 주체적인 삶, 리더십 관한 이야기들 열정적으로 전달해 400여 명의 수강생에게 박수를 받았다. 강연 후에는 바비 브라운의 사인회도 진행됐다.\n\n이번 행사를 총괄·기획한 바비 브라운의 브랜드 매니저 최원식 상무는 \"이번 특강은 성공한 여성 CEO로서 바비 브라운이 차세대 리더들을 격려하고 영감을 주기 위해 마련됐다\"며 \"행사 고지 후 이틀 만에 1000명이 넘는 학생들이 특강을 신청했을 정도로 뜨거운 관심을 모았다\"고 밝혔다.',84,0,NULL,'2010-12-01 07:15:11',NULL,'--127'),(4633,'2010 유방암 의식 향상 캠페인 개최','http://www.youtube.com/embed/nYlTi3DYgLs',NULL,'http://img.youtube.com/vi/nYlTi3DYgLs/0.jpg','14',NULL,'2013-12-16 17:56:29','2013-12-19 18:39:22','nYlTi3DYgLs','전세계적으로 1992년부터 시작된 유방암 의식 향상 캠페인이 올해도 \'유방암의 달\'인 10월에 전 세계 60개국에서 동시에 개최될 예정. \n우리나라는 10월 21일 서울 청계천 광장에서 10주년 행사를 개최를 시작으로 전국 8개 도시에서 한 달 동안 다채로운 행사를 펼친다.\n특히 올해는 한국 행사 10주년을 맞아 유방암에 대한 시민들의 의식을 높이고자 청계천을 핑크색 천과 조명으로 뒤덮는 초대형 랜드아트와 일루미네이션 쇼, 그리고 시민들과 함께 하는 다양한 공연 프로그램을 마련했다고...',46,0,NULL,'2010-10-20 14:55:53',NULL,'2010--2'),(4634,'바비 브라운 일루미네이팅 컴팩트 론칭 행사!','http://www.youtube.com/embed/flOEQLzdNM8',NULL,'http://img.youtube.com/vi/flOEQLzdNM8/0.jpg','14',NULL,'2013-12-16 17:56:29','2013-12-19 18:39:22','flOEQLzdNM8','뉴욕 메이크업 브랜드 바비 브라운이 지난 7일 신제품 \'일루미네이팅 휘니시 파우더 컴팩트 화운데이션 SPF 12PA+\'론칭 행사를 청담동 비욘드 뮤지엄에서 진행했다.\n\n바비 브라운은 행사장을 찾은 스타 및 VIP들이 제품을 체험하고, 자사의 메이크업 아티스트들로부터 신제품을 사용하는 다양한 팁을 배우는 시간을 마련했다. 또한 이번 행사에는 피아니스트 김정원의 부드럽고 섬세한 터치가 느껴지는 피아노 연주와 동시에 일루미네이팅 컴팩트를 모티브로 한 미디어 아티스트 송호준 작가의 영상을 플레이 해 보드랍고 고급스럽게 빛나는 \'밍크스킨\'을 연출해주는 \'일루미네이팅 컴팩트\'를 시각과 청각을 통해 공감각적으로 느낄 수 있는 자리가 되었다.\n\n특히, 행사장 중앙의 사선으로 좁아지는 공간은 블랙으로 조성하고, 그 끝에 약 9ｍ 높이로 LED를 설치해, 어둠 속에서 발산되는 화려한 빛이 세련된 블랙 케이스와 빛나는 피부를 연출해주는 신제품 \'일루미네이팅 컴팩트의 연상시키며 환상적인 공간을 연출해 눈길을 끌었다.',210,0,NULL,'2010-09-16 18:50:05',NULL,'--128'),(4635,'-바비브라운 탐구생활- 바비브라운 세일즈 컨퍼런스 UCC공모전 2위 수상작','http://www.youtube.com/embed/aKuLSkSDNbY',NULL,'http://img.youtube.com/vi/aKuLSkSDNbY/0.jpg','14',NULL,'2013-12-16 17:56:29','2013-12-19 18:39:22','aKuLSkSDNbY','바비 브라운 세일즈 컨퍼런스 UCC공모전에서 2위를 차지한 롯데 상인점의 UCC!\n바비 브라운 탐구생활이라는 재밌는 스토리가 Goooood!',205,0,NULL,'2010-07-10 20:03:22',NULL,'ucc-2'),(4636,'2009 가을 & 홀리데이 메이크업','http://www.youtube.com/embed/3hQwRsdInK0',NULL,'http://img.youtube.com/vi/3hQwRsdInK0/0.jpg','14',NULL,'2013-12-16 17:56:29','2013-12-19 18:39:22','3hQwRsdInK0','바비브라운 2009 가을 & 홀리데이 메이크업에 관한 모든것 !\n누드메이크업을 위한 깔끔한 피부표현에서부터 고혹적인 아이메이크업이 돋보이는 아이비리그컬렉션, 그리고 홀리데이를 위한 립 메이크업 까지.\n이번 가을 , 바비브라운 메이크업으로 홀리데이의 주인공이 되어보세요~!',396,0,NULL,'2009-10-14 13:40:27',NULL,'2009'),(4637,'바비브라운 2009 f/w 뉴욕 패션위크','http://www.youtube.com/embed/wlknXi3Ytoo',NULL,'http://img.youtube.com/vi/wlknXi3Ytoo/0.jpg','14',NULL,'2013-12-16 17:56:29','2013-12-19 18:39:22','wlknXi3Ytoo','2009 s/s 시즌에 이어 f/w 시즌에도 함께한 바비브라운!\n뉴욕컬렉션 현장에서 미리 만나보는 2009 f/w 메이크업 트렌드 !!',181,0,NULL,'2009-04-07 12:46:22',NULL,'2009-f-w'),(4638,'바비 브라운 2009 S/S 뉴욕패션위크','http://www.youtube.com/embed/MAXloHenzjU',NULL,'http://img.youtube.com/vi/MAXloHenzjU/0.jpg','14',NULL,'2013-12-16 17:56:29','2013-12-19 18:39:22','MAXloHenzjU','2009 s/s 뉴욕패션위크와 함께하는 바비브라운~!',50,0,NULL,'2009-04-07 11:46:01',NULL,'2009-s-s'),(4639,'2009 skin foundation SPF 15','http://www.youtube.com/embed/rgNAiur2WB4',NULL,'http://img.youtube.com/vi/rgNAiur2WB4/0.jpg','14',NULL,'2013-12-16 17:56:29','2013-12-19 18:39:22','rgNAiur2WB4','\"한병 더~!\"\n마치 내 피부같은 자연스러움을 연출할 수 있는\n2009년 바비브라운의 뉴아이템\n스킨화운데이션!',64,0,NULL,'2009-04-07 11:33:50',NULL,'2009-skin-foundation-spf-15'),(4640,'RiRi ♥ MAC Holiday 컬렉션 비하인드 씬','http://www.youtube.com/embed/m9u2tsDuZBQ',NULL,'http://img.youtube.com/vi/m9u2tsDuZBQ/0.jpg','15',NULL,'2013-12-16