디렉터이자 뉴욕 메이크업 아티스트로, \n런던과 파리, 뉴욕 등지 에서 활동을 펼치며 \n헐리웃 셀렙의 메이크업을 담당하고 있는 크리스 콜벡(Chris Colbeck). \n그가 제안하는 올 가을 뉴욕 스킨 스타일링 TIP에 주목할 것.\n\n스킨케어부터 페이스 메이크업까지, \n지금 가장 HOT한 뉴욕의 스킨 스타일링 비법을 모두 공개했다.\n\n에스쁘아 페이스 슬립 하이드레이팅 컴팩트로 \n크리스 콜백이 제안한 팁을 활용하여\n탑모델의 매끄러운 피부를 경험해보자.\n\nSkin Styling from SOHO, NYC\neSpoir face slip HYDRATING COMPACT',152,0,NULL,'2012-08-31 00:32:46',NULL,'tip'),(4684,'[eSpoir] Trip to the Soho Soul -- 박시연, 새로운 스킨스타일링을 찾아 떠나다','http://www.youtube.com/embed/Lpiex8ZjX_8',NULL,'http://img.youtube.com/vi/Lpiex8ZjX_8/0.jpg','16',NULL,'2013-12-16 17:56:40','2013-12-19 18:39:24','Lpiex8ZjX_8','더 매끄러울 순 없을까?\n\n박시연, \n새로운 스킨 스타일링을 찾아 뉴욕으로 떠나다.\n\n스무딩 슬립컴플렉스로 더 매끈하고 부드럽게, 촉촉하고 윤기있게, 어느 각도에서나 더욱 빛나게 \n피부가 슬립을 입는 순간 눈부시게 매끄러워지다\n\nSkin Styling from SOHO, NYC\neSpoir face slip HYDRATING COMPACT',61,0,NULL,'2012-08-20 02:48:13',NULL,'espoir-trip-to-the-soho-soul'),(4685,'베러걸스, 뉴욕에서 온 Hot item 에스쁘아 슬립 파데에 홀릭하다!','http://www.youtube.com/embed/uyXhONsQUdQ',NULL,'http://img.youtube.com/vi/uyXhONsQUdQ/0.jpg','16',NULL,'2013-12-16 17:56:40','2013-12-19 18:39:24','uyXhONsQUdQ','깐깐한 겟잇뷰티 품평단 베러걸스.\n뉴욕에서 온 핫 아이템에 홀릭하다!\n\n깐깐하기로 소문난 겟잇뷰티 품평단인\n베러걸스(Better girls) 출신의 뷰티 블로거 4인방이 경험한\n스킨 스타일링 아이템, 에스쁘아 페이스 슬립 하이드레이팅 컴팩트.\n\n그녀들의 아찔하게 솔직한 파운데이션 리얼 토크를 확인하세요!\n\nNEW ARRIVAL FROM SOHO.NYC',72,0,NULL,'2012-08-13 02:10:57',NULL,'hot-item'),(4686,'도수코2의 탑모델 그룹, 뉴욕에서 온 Hot item 에스쁘아 슬립 파데에 빠지다!','http://www.youtube.com/embed/f1YFM75Jgcc',NULL,'http://img.youtube.com/vi/f1YFM75Jgcc/0.jpg','16',NULL,'2013-12-16 17:56:40','2013-12-19 18:39:24','f1YFM75Jgcc','도전 슈퍼모델 코리아2의 탑모델.\n뉴욕에서 온 핫 아이템에 빠져들다!\n\n\'도전 슈퍼모델 코리아2\'에서 압도적인 카리스마와 완벽한 스타일링으로\n영광의 우승을 차지한 탑모델 그룹, 진정선 박슬기가 경험한\n스킨 스타일링 아이템, 에스쁘아 페이스 슬립 하이드레이팅 컴팩트.\n\n그녀들의 아찔하게 솔직한 파운데이션 리얼 토크를 확인하세요!\n\nNEW ARRIVAL FROM SOHO.NYC',68,0,NULL,'2012-08-13 01:56:07',NULL,'2-hot-item'),(4687,'스타 메이크업 아티스트, 뉴욕에서 온 Hot item 에스쁘아 슬립 파데에 빠지다','http://www.youtube.com/embed/mIFtxlAVzr0',NULL,'http://img.youtube.com/vi/mIFtxlAVzr0/0.jpg','16',NULL,'2013-