시 태어나는 컴플렉스 박멸, 윤곽 보정 메이크업 노하우를 공유합니다 :)\nWhat if, high cheekbones, instead of drawing beautiful guidelines for how to blush your face, give a too-strong-a-depth to the face...? \nFrom real-life daily concerns that we suffer ourselves...we hereby present the \"Redesigning the facial-line\" how-to; rather than using the blush to give depth to the face, this time, it worked as a plump-up color to round-up the sunken cheeks and broadly cover the cheekbones! We hope you like it. :)',112,0,NULL,'2013-12-10 10:56:22',1,'4-bye-bye-complex-series-4-redesigning-the-facial-lines'),(4828,'Celebrity Style#7: 탕웨이 글래머러스 가을 메이크업  - Tang Wei\'s Glamorous Fall Make Up','http://www.youtube.com/embed/k_OBzv7Xu20',NULL,'http://img.youtube.com/vi/k_OBzv7Xu20/0.jpg','23',10,'2013-12-16 17:57:10','2014-01-02 07:10:23','k_OBzv7Xu20','Use a metallic taupe color on the eyes for a sense of depth, resulting in a glamorous style make up which highlights the actress\' emotional complexity.',201,0,NULL,'2013-11-30 08:07:54',1,'celebrity-style-7-tang-wei-s-glamorous-fall-make-up'),(4829,'Celebrity Style#6: 미스에이 Hush 메이크업 - \"HUSH!\" MissA\'s VERY FIRST Team-Look','http://www.youtube.com/embed/ZJj-OIipoI4',NULL,'http://img.youtube.com/vi/ZJj-OIipoI4/0.jpg','23',8,'2013-12-16 17:57:10','2014-01-01 23:25:07','ZJj-OIipoI4','신곡 \'Hush\'로 돌풍을 일으키며 돌아온 숙녀들, MissA.  함께, 또 따로, 깊어진 색깔을 보이는 그녀들의 뉴 룩을 정샘물 아티스트 그룹이 재현했답니다 :) \n\nAll for one, and one for all - seems to be their proclamation for their unanimous come-back look of \"Hush\" by MissA. Celebrating their comeback, Jungsaemmool Artist Group has recreated the signature makeup of these unique-yet-perfectly-complementing young ladies for their VERY FIRST Team-Look. \n*MissA, notable for each member\'s unique personalities, has never been shown in an united-team-look before! :)',295,0,NULL,'2013-11-21 13:37:58',1,'celebrity-style-6-hush-hush-missa-s-very-first-team-look'),(4830,'새로운 발견 시리즈#2: 이 머리를 밴드로 연출했다니! - the Hyde-Side Of...Series#2: The Secret Role of Hair Band','http://www.youtube.com/embed/bQG-kF-_nt0',NULL,'http://img.youtube.com/vi/bQG-kF-_nt0/0.jpg','23',NULL,'2013-12-16 17:57:10','2013-12-19 18:39:30','bQG-kF-_nt0','\"아티스트 양반 무슨 소리요, 이 머리를 밴드로 연출했다니..!\" \n우아하고 자연스럽게 흘러내린 듯, 하루 종일 풀어지지 않는 스타일의 비밀! \n머리 위가 아닌 머리 속에서 맹활약한 헤어 밴드의 역할, 새로운 발견 시리즈#2의 밴드 연출법을 통해 확인해볼까요? ;) \n\nNot on top, but stealthy-underneath the hair, \nthe hair band plays a critical role in making this flawlessly natural yet lasting classic-style hair. The secret of many celebrities hour-long-lasting perfect-looking hairstyle - let\'s find out how the hair band makes this possible! :)',114,0,NULL,'2013-11-14 11:30:35',NULL,'2-the-hyde-side-of-series-2-the-secret-role-of-hair-band'),(4831,'파운데이션으로 연출하는 섬머 바디 - Summer Body Tone using Foundation','http://www.youtube.com/embed/9jUmzieIHHA',NULL,'http://img.youtube.com/vi/9jUmzieIHHA/0.jpg','23',NULL,'2013-12-16 17:57:10','2013-12-19 18:39:30','9jUmzieIHHA','짧은 옷 때문에 불규칙하게 살짝 그을린 팔다리와, 비교적 흰 편인 얼굴의 톤 차이가 거슬렸다면? 평소 사용하는 제품보다 살짝 어두운 파운데이션과 드라이 오일을 활용해서 전체 톤을 맞춰주고, 건강한 얼굴과 바디로 연출하는 생활 팁을 공유합니다 :) \n\nOne daily tip Jungsaemmool Makeup Artist Use to create a slightly dark, naturally tanned skin without the actual tanning process: foundation! The principle is not so different from art paintings - utilize existing colors and products. Mix a small amount of darker shades with dry  oil to smooth-out the entire body tone. Add a little highlight to the arms for skinnier-effect. No need to tire your skin from sunburn, or artificial tanning machines for healthy looking body tone :)',107,0,NULL,'2013-08-05 12:07:51',NULL,'summer-body-tone-using-foundation'),(4832,'Behind the Scenes - JSM & EYK','http://www.youtube.com/embed/5o8RwIFVJ4w',NULL,'http://img.youtube.com/vi/5o8RwIFVJ4w/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','5o8RwIFVJ4w','Just as some of the Simon & Martina\'s NASTIES have figured out already...YES, S&M together with Jungsaemmool Artist Group went through some \"BAD\" transformation. More to come up on Saturday, May 25th! \n\nOne regret: didn\'t have enough time to transform M into bad girl and to cover S as well...(sigh) may the day come soon when S embraces guy-liner and BB creams :S \n\nBest, Jungsaemmool Artist Group',25,0,NULL,'2013-05-23 14:51:56',NULL,'behind-the-scenes-jsm-eyk'),(4833,'남자 아이돌 메이크업_Light Male-K-pop Star Makeup','http://www.youtube.com/embed/mosby-MIivU',NULL,'http://img.youtube.com/vi/mosby-MIivU/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','mosby-MIivU','K-pop Star들의 인기와 함께, 점점 많은 남자분들이 데일리 메이크업을 시도하고 있는 듯 해요 :) 오늘은 많은 문의를 받았던 남자 아이돌들의 메이크업을 보다 캐주얼하게 재현한 룩을 소개합니다. 남자 메이크업은 전체적으로 깨끗하고 정돈된 느낌을 위한 피부톤 보정과 눈썹결 정돈에 중점을 두고, 보다 엣지 있는 느낌을 위해 아이라인을 더하는 게 특징인데요. 거친 듯 부드러운 듯 살짝 번진 듯한 느낌을 위해, 면봉을 이용해서 언더라인 위로 스머지하는 것이 스페셜 팁이랍니다 :)  \n\nAnother request response ;D The K-pop star-like male makeup in a slightly daily version. Male makeup focuses more on making the overall skin tone evenly bright, with a slight emphasis on the eyes. If the eye lines seem too-much, feel free to take out the steps you don\'t feel comfortable with :)',202,0,NULL,'2013-04-25 02:30:13',NULL,'_light-male-k-pop-star-makeup'),(4834,'5분 안에 완성하는 셀프 드라이 5 Minutes Dry Hair-Styling','http://www.youtube.com/embed/bZdpZqL7-eI',NULL,'http://img.youtube.com/vi/bZdpZqL7-eI/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','bZdpZqL7-eI','빗 없이 손과 드라이어만으로 완성하는 5분 초간단 내추럴 웨이브 헤어스타일링입니다 :) \n\nA 5 minutes-clip sharing how to give natural wave to medium-length hair using one\'s own hands and the hair drier only.',146,0,NULL,'2013-04-18 05:31:34',NULL,'5-5-minutes-dry-hair-styling'),(4835,'보아\'s 케이팝스타 시즌2 룩 BoA\'s Peach-Grey Makeup','http://www.youtube.com/embed/XI0UphKT8UA',NULL,'http://img.youtube.com/vi/XI0UphKT8UA/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','XI0UphKT8UA','악동뮤지션의 우승으로 대장정의 피날레를 올린 K-Pop Star 시즌2!\n때로는 날카롭게, 때로는 부드럽고 자상하게, 차세대 케이팝 스타를 꿈꾸는 친구들에게 조언과 격려를 아끼지 않은 심사위원 보아. 회를 거듭할수록 화제를 불러일으킨 보아의 룩들 중, 따뜻하고 자상한 자연인으로서의 그녀를 담아내고자 했던 \"피치그레이 내추럴 룩\"을 소개합니다 :) \n\nK-pop Star S2 ended in grand-finale of \"Akdong Musician\" taking the winner\'s seat, and Jungsaemmool Artist Group\'s long journey of perfecting BoA, the jury and Top-K-Pop Star herself, for each live rounds ended along with it, for now, too. \n\nBoA never ceases to surprise her fans, sometimes with unforeseen accessories, sometimes with sharp comments posing challenges for the contestants...but also does not forget to show her warm, genuine and natural sides as well. This makeup was one we created with her in the hopes that it shows the sunshine-part of her. \n\nUpcoming videos reflected your request to show some daily wearable natural hair and MALE makeup :)',265,0,NULL,'2013-04-11 06:32:07',NULL,'s-2-boa-s-peach-grey-makeup'),(4836,'여드름 피부 수분 케어 Jungsaemmool\'s Beauty Tip: Soothing and Moisturizing Acne Skin','http://www.youtube.com/embed/ZF9hKQqPXvc',NULL,'http://img.youtube.com/vi/ZF9hKQqPXvc/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','ZF9hKQqPXvc','정샘물 아티스트 그룹의 스킨-뷰티 팁 두번째, 여드름 피부를 위한 수분 & 진정 케어! 여드름으로 울긋불긋, 열을 머금은 피부를 진정시키고, 뽀록뽀록 올라온 빨간 여드름을 케어하면서 가볍게 가려줄 수 있는 수딩 케어 비법을 공유합니다 :) \n\nThe long-awaited acne skin care - another presentation from your genie, Jungsaemmool Artist Group ;) \n\nNow, some may have seen this clip already, because it\'s been re-uploaded due to some errors. This clip shares how we treat acne-prone, blemished red skin of our models, concentrating on cooling down the heated blemishes and to soothe troubles.',202,0,NULL,'2013-04-06 11:19:00',NULL,'jungsaemmool-s-beauty-tip-soothing-and-moisturizing-acne-skin'),(4837,'소녀시대 메이크업 Girl\'s Generation: I Got A Boy-Look','http://www.youtube.com/embed/2CHGZGvIV74',NULL,'http://img.youtube.com/vi/2CHGZGvIV74/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','2CHGZGvIV74','각양각색의 매력은 기본, 컴백할 때마다 언제나 새로운 룩으로 돌아오는 K-pop 스타들! Pop!-한 헤어 컬러와, 반짝거리는 화려한 메이크업으로 사랑받은 소녀시대의 I Got A Boy룩을 재현해봤습니다. 9명의 소녀들 중 누구의 룩인지, K-pop과 it-메이크업을 사랑하시는 여러분, 알아보시겠어요? ;) \n\nWe, the Jungsaemmool Artist Group...are genies to your requests - here comes, Girl\'s Generation - I Got A Boy \"Re-make-up\" Look, presented by Kwon Hee-Sun, the Chief Makeup Artist of Jungsaemmool Inspiration WEST :) \n\nThe next upcoming video clip, too, will be another at-your-service contents to those friends who always support us with your feedback, idea, and kind messages :\') \n\nSo do not hesitate to let us know your favorite contents, your wanna-be stars and like-to-see looks! Thank you with love :)',258,0,NULL,'2013-04-01 08:06:51',NULL,'girl-s-generation-i-got-a-boy-look'),(4838,'Brand New: MÜLE \'s Sparking Star Palette 2nd Signature Look \"Semi-Smokey\"','http://www.youtube.com/embed/Iv9hGOL-Feg',NULL,'http://img.youtube.com/vi/Iv9hGOL-Feg/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','Iv9hGOL-Feg','뮬의 첫 색조 제품, \"스파클링 스타 팔레트\" - 아이, 립, 치크에 모두 사용할 수 있는 15색상의 멀티 컬러로 이뤄진 스파클링 스타 팔레트의 두번째 시그니처 룩, 세미-스모키를 공개합니다 ;)  \n\n올 봄엔 스모키 = 블랙, 이라는 클래식을, 토크 핑크, 딥 블루의 반짝거리는 색깔과 누드 베이지로 변주한 부드러운 세미 스모키 룩으로, 강렬했던 스모키에 부드러운 광채를 더해보는 건 어떨까요^^\n\nYes, black is black - with changing trends, some suggested that black could be replaced. Like \"Red is the new black\" but we all know...black is yet THE classic, especially when it comes to smokey-eye makeup. \n\nSmokey-makeup truly has become an all-year-around-thing - but since spring is so much in the air, why not add some variation to suit the season? ;) \n\nHereby, we Jungsaemmool Artist Group suggest a varied smokey makeup, using gently shimmering colors like \"talc-pink\" and \"deep-blue\" for some some refreshing glow underneath the sunshine; while indoors, the contrast between the pink and blue yet succeed to maintain the deepening effects of smokey-eye makeup :)',241,0,NULL,'2013-03-20 09:12:11',NULL,'brand-new-mule-s-sparking-star-palette-2nd-signature-look-semi-smokey'),(4839,'Brand New: MÜLE \'s Sparking Star Palette 1st Signature Look \"Splendid Pink Lip\"','http://www.youtube.com/embed/JfSNQHvmqVs',NULL,'http://img.youtube.com/vi/JfSNQHvmqVs/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','JfSNQHvmqVs','뮬의 첫 색조 제품, \"스파클링 스타 팔레트\"! 아이, 립, 치크에 모두 사용할 수 있는 15색상의 멀티 컬러로 이뤄진 스파클링 스타 팔레트의 첫번째 시그니처 룩, 핑크 립 포인트 룩을 공개합니다 :) \n\n봄에 가장 먼저 활짝 피는 진달래처럼 선명한 \"스플렌디드 핑크\"가 입술 위에, 반짝반짝 고운 금빛의 \"뉴욕 옐로우\"와, 맑고 화사한 \"루미너스 화이트\"가 봄꽃의 아름다운 빛깔로 눈 위에 피어납니다 ^^ \n \nHereby we Jungsaemmool Artist Group present the very first-and-all-in-one multi-color palette of MÜLE: the \"Sparkling Star Palette\" :) \n\nEvery day and with each breath-taken, spring around us changes in color and hue; every air particle seems to glitz-and-glow with the excitement and hope - greens, yellows, lilac-purple, violet and pink - which has been captured, baked and pressed into the 15 color discs.  \n\nWith the very first colors seen in Korean spring - the Splendid Pink of the flower \"Azalea\", the New-York Yellow of the flower \"Forsythia\", and the Luminous White of the flower \"Magnolia\" - we present the 1st signature look \"the Splendid Pink Lip\" to you! :) \n\nThese are indeed the very first colors that mark the beginning of spring; they come long before the very first green appears, brightening up the long-barren-and-bleak landscapes. \n\nWe hope that with this simple, bright yet vivid look, we could deliver a breeze of Korean spring across to you all around the world :) \n\nWith love for spring, Jungsaemmool Artist Group',258,0,NULL,'2013-03-13 05:38:52',NULL,'brand-new-mule-s-sparking-star-palette-1st-signature-look-splendid-pink-lip'),(4840,'좌우대칭 맞추기 시리즈#1_Quick Balance Tip#1: How to Balance the Eyebrows','http://www.youtube.com/embed/cun39y9ITJQ',NULL,'http://img.youtube.com/vi/cun39y9ITJQ/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','cun39y9ITJQ','학교 다닐 때...손을 번쩍~들고 기준~!을 외치던 짝꿍을 중심으로...모여~펼쳐~섰던 기억...다들 있으시죠? ^^ 오늘은 반듯하게 얼굴의 기준~!을 잡을...정샘물 아티스트 그룹의 좌우대칭 맞추기 공식 시리즈 1탄! 아이브로우 균형 맞추기 클립과 함께 인사드립니다 :) \n\n짝짝이 쌍꺼풀도, 한쪽만 듬성~한 속눈썹도...모두모두 반듯하게 잡아줄 좌우대칭 맞추기 공식 시리즈는 앞으로 더 많은 에피소드가 추가될 예정이랍니다. 아이브로우 균형 에피소드를 시작으로, 완벽하게 균형잡힌 아름다움을 향해 Go Go~...:) \n\nHaven\'t we all shed tears about why one side of my eyes is double lid...while the other is a half-mono lid? Or, haven\'t we all grieved about why one side of my eyebrows has less hair than the other side? \n\nTo share our suffering and solution to the imperfect balance of our faces...we Jungsaemmool Artist Group hereby present your officially \"Perfect-Twin-Balance Series Episode#1: How to Clone Your Eyebrows\"!\n\nEven the most beautiful people silently suffer from the imbalance of their face; even if every single people on the planet praise their beauty, what they find in the mirror is the disturbing difference of their eyes, brows, nose, even dimples...to the extent they feel as if everyone seems to notice and laugh about the disproportion. \n\nWe want everyone to know that you are already beautiful; we propose these quick tips in the hopes that these will support you to agree on that fact, as much as we do :) \n\nWith love and cheering, Jungsaemmool Artist Group',90,0,NULL,'2013-03-05 10:58:18',NULL,'1_quick-balance-tip-1-how-to-balance-the-eyebrows'),(4841,'K-POP STAR BoA\'s To-the-Point-Feedback Makeup \"Glossy Hot Orange Point Lip\"','http://www.youtube.com/embed/yoJLoAPscvk',NULL,'http://img.youtube.com/vi/yoJLoAPscvk/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','yoJLoAPscvk','드디어 최종 생방송 대결로 들어선 K-POP STAR의 따뜻한 멘토, 보아! 때로는 예리한, 때로는 자상한 피드백만큼이나 화제가 되는 것은 매 회마다 기대를 모으는 그녀의 트렌디한 룩! 한 발 앞서 뷰티 트렌드를 보여주는 보아의 글로시 핫 오렌지 포인트 메이크업 룩을 정샘물 인스피레이션 아티스트들이 재현해 보았습니다 :)\n\nNow getting to the final rounds, full-attention of people, more than ever, are pointed towards K-POP STAR\'s mentor, BoA\'s lips; what feedback, comment and encouragements her lips will pour out :O \n\nAt the same time, another sort of attention is focused on her for different reasons: THAT HAIR! THAT EYE-MAKEUP! THAAAAT LIP COLOR! ;)\n  \nSo today, Jungsaemmool Inspiration\'s Makeup Artist, Go, Mi-Yeong and Hair Designer Shin, Yoon-Seo have recreated one of BoA\'s trendiest looks, the \"Glossy Hot Orange Lip\". There are maaany more requests on BoA\'s looks pouring in through YouTube and Facebook messages, so if there are specific looks you like, come on and join :)\n\nAlso, please understand that today\'s clip does not include product information due to BoA\'s request :( but it is only for this time; all the forthcoming clips will have full information, as always. \n\nand last but not least, new video clips are being filmed as we speak: and this time, we have reflected the mostly-wanted contents requests from you!  (Hint: ac*e...;)...) \n\n-Always happy to have your ideas, comments and staying with us, Jungsaemmool Artist Group :)',214,0,NULL,'2013-02-22 01:55:16',NULL,'k-pop-star-boa-s-to-the-point-feedback-makeup-glossy-hot-orange-point-lip'),(4842,'발렌타인 초콜렛 메이크업_Flowers-and-Chocolate-Theme Makeup for Valentine\'s Day.mp4','http://www.youtube.com/embed/8jeegvpu_Ko',NULL,'http://img.youtube.com/vi/8jeegvpu_Ko/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','8jeegvpu_Ko','짧은 설 연휴가 끝나니 어느새 발렌타인 데이가 다가왔네요^^ 추운 하루를 마무리하는 꽃과 초콜렛, 은은한 촛불과 아늑한 시간...상상만 해도 마음이 따뜻해지는 로맨틱한 순간에 맞춰, 꽃과 초콜렛을 테마로 한 메이크업을 제안합니다 :)\n\n은은한 조명에 맞춰 다소 진하고 부드러운 초콜렛 테마의 룩을 은은하게 밝혀주는 하일라이트로, 의외의 꽃 모티브와 컬러가 숨어 있답니다^^ (궁금하면...초콜렛?^^)\n\nOne of Korean Beauty Brands suggests \"Don\'t eat off; give it to your skin with love\"...so does the Jungsaemmool Artist Group for the upcoming Valentine\'s Day\'s flowers and chocolate ;)\n\nIf you mean to hold yourselves back from eating away the chocolates - either way because it\'s a gift for someone else, or because you chose to follow the advice to give it to your skin :D, then this \"Flowers-and-Chocholate-Theme Look\" may be a good way to give a bit of sweetness to your face :)\n\nThe unusually intense and dark-sweet look is best under candle-lights; not to miss catching the glow into one\'s face, a hidden color of a flower (there are many more flowers in this world than roses, right?:S) has been used to reflect and brighten the eyes :) \n\nWe wish you all a sweet, lovely Valentine\'s Day, and again, happy lunar new year!',263,0,NULL,'2013-02-12 08:08:12',NULL,'_flowers-and-chocolate-theme-makeup-for-valentine-s-day-mp4'),(4843,'펜슬 하나로 메이크업 체인지_Utilizing Eyeliner Pencil to switch Lip Color.mp4','http://www.youtube.com/embed/fSBtudsohYI',NULL,'http://img.youtube.com/vi/fSBtudsohYI/0.jpg','23',NULL,'2013-12-16 17:57:11','2013-12-19 18:39:30','fSBtudsohYI','메이크업 아티스트들의 다양하고 창의적인 스킬 중 딱 하나만 꼽아본다면? 투명 마스카라를 활용해서 워터프루프 아이라인 완성하기, 나에게 딱 맞는 색깔이 나올 때까지 질감, 브랜드를 가리지 않고 베이스 조색하기 등...주어진 틀에 구애받지 않는 무한하고 독특한 활용이라고 할 수 있지요 :)\n\n정샘물 아티스트 그룹의 최대균 부원장님과 함께, 아이라이너를 활용해서 메이크업을 휙~바꾸는 2가지 Tip을 확인해보세요 :)\n\nOne of the key factors that distinguish professional makeup artists from the others could be their unlimited and creative utilization of tools and products. Haven\'t we all have spent hours and hours trying to find the PERFECT foundation shade for my skin? Or, emptied our purses in the attempt to catch up to the latest color trends? Or filled our drawers with tools that we often forget when and how to use? \n\nIf you have cried out yes! to each, check out this short tip of DaeKyoun Tche, Makeup Artist of Jungsaemmool Artist Group, utilizes eyeliner pencils to switch colors. If you have ever wondered why the lipstick does not give you the expected color effects, don\'t hesitate to mix and challenge the given use and colors: reaching out for the one-and-only-and-the-right state is what a true artisan would do! :)',151,0,NULL,'2013-02-09 10:22:36',NULL,'_utilizing-eyeliner-pencil-to-switch-lip-color-mp4'),(4844,'핫핑크 립포인트 / \"YoonEunHye\'s Hot-pink Lip-point\" from 2012-Hotty K-drama \"I Miss You\"','http://www.youtube.com/embed/D3gfsRexdlA',NULL,'http://img.youtube.com/vi/D3gfsRexdlA/0.jpg','23',NULL,'2013-12-16 17:57:12','2013-12-19 18:39:30','D3gfsRexdlA','2012년 하반기 최고의 화제 드라마 중 하나, \"보고싶다\"! 긴박감 넘치는 스토리, 명배우들의 열연과 함께, \"조이 / 이수연\" 역으로 분한 윤은혜의 핫핑크 립 메이크업이 큰 사랑을 받았었는데요. \n\n과거의 아픔과 슬픔을 감추듯, 선명하고 또렷한 핑크빛 립포인트로 세상과 마주하던 윤은혜의 핫핑크-립포인트 룩! 정샘물 아티스트 그룹의 Go연정 부원장의 가이드를 통해 바로 함께 시도해볼까요? Go Go~ :)\n\nOne of the hottest K-drama in Fall 2012, \"I Miss You\" left many legacies; from boy-to-man, YooSeungHo, and now more-a-born-actor-than-only-Kpop star, ParkYooChun...but mostly, what pops up to our sight the most was definitely the pop-pink-hot lips of Zoe, starring YoonEunHye. The trend of hot-and-pop lips started F/W 2012, and is expected to continue through early 2013. The winter seems prolonged; it is not-at-all-late to put a pop on the lips to fight off the blizzard of the outside world (like Zoe did) :)      \n\nAlso, for many friends who gave us quick feedback about the product info - said and done! From this clip on, the product info will always be included in the video! If there are more ideas about improving contents, or layout, or trend - let us know anytime. We LOVE + appreciate your support and involvement, more than words can say :)',230,0,NULL,'2013-02-01 05:23:49',NULL,'yooneunhye-s-hot-pink-lip-point-from-2012-hotty-k-drama-i-miss-you'),(4845,'Super-rookie K-pop Star: Lee Hai\'s 1,2,3,4 Dolly-Jolie Makeup.mp4','http://www.youtube.com/embed/d-ffBuf474g',NULL,'http://img.youtube.com/vi/d-ffBuf474g/0.jpg','23',NULL,'2013-12-16 17:57:12','2013-12-19 18:39:30','d-ffBuf474g','K-pop스타에서 발굴된 이래, \"1,2,3,4\"의 파워풀한 가창력과 매력적인 보이스로 대중들의 사랑을 받으며 승승장구하고 있는 이하이! 풋풋하고 앳된 여고생의 이미지를 벗고, 노래와 더불어 많은 이를 사로잡는 이하이만의 묘한 눈빛...이를 더욱 돋보이게 만드는 일등 공신은 과연 무엇일까요^^ \n\nJungsaemmool Inspiration과 함께 이하이의 상큼발랄 1,2,3,4 메이크업의 완성을 차근차근~1발, 2발, 3발, 4발~따라가볼까요? :) \n\nThe super-rookie Hai Lee, who rose to glory through the star-audition program, \"K-pop Star\" says hello with her debut single \"1,2,3,4\"! It\'s not only her unbelievably powerful and attractive voice, but also her mystic eyes that draw so many fans, having grown so deep from her high-teen looks over such a short time. Let\'s find out the secret makeup that has turned one dolly into jolie :)',299,0,NULL,'2013-01-28 05:13:52',NULL,'super-rookie-k-pop-star-lee-hai-s-1-2-3-4-dolly-jolie-makeup-mp4'),(4846,'수분 톡톡 데일리 기초케어_Jungsaemmool\'s Beauty Tip: Skin-bombing behind the Makeup-scene','http://www.youtube.com/embed/1GixQ4iP4Tw',NULL,'http://img.youtube.com/vi/1GixQ4iP4Tw/0.jpg','23',NULL,'2013-12-16 17:57:12','2013-12-19 18:39:31','1GixQ4iP4Tw','새로운 한 해를 맞이하여, 채널도, 컨텐츠도 곱게 새 단장하여 인사드립니다^^ \n\n너무나 춥고 긴 겨울...누구나 원하지만 너무나 어려운 \"수분 촉촉 피부\"를 지켜드리기 위해, 정샘물 아티스트 그룹이 머리를 맞대고 모은 노하우를 공유합니다 :)\n\n정샘물 아티스트 그룹이 강력하게 추천하는 초보습 제품은 무엇? \n적절한 사용량과 최고의 효과를 내는 제품의 조합은? \n숨겨진 보습의 비법은...? \n\n쉽지만 단순하진 않은 겨울철 보습의 비법으로 2013년 Channel Jungsaemmool을 시작합니다! 함께 Go Go Go~^^\n\n\nBelated happy new year, and thank you sincerely for returning to the first 2013 clip of Channel Jungsaemmool! :) \n\nStarting the new year, all Crew Jungsaemmool have had the time to look back the past year, and to gather our thoughts/vision for the coming times. As a whole, the Artist Group Jungsaemmool will leap towards a year full of news and challenges; things will be different, and for better, we promise. Please stay with us, hopefully with fondness, for whatever is to come ;)\n\nThe first tutorial, as part of our new attempts, features the answer to so-many-friends\'-wonder: \"how come the models\' skins are so perfect?\" YES, the models\' skins are smooth and beautiful, but NO, not necessarily by birth! :) and here we share, how the Team Jungsaemmool makes and keeps the perfect canvas for a flawless makeup.\n\nThank you again for being with us; and with greater love, a challenging and happy new year to all of you :) !',228,0,NULL,'2013-01-21 07:08:25',NULL,'_jungsaemmool-s-beauty-tip-skin-bombing-behind-the-makeup-scene'),(4847,'히피 스타일 밴딩땋기_From Mature to Cute: Braid-band Decoration.wmv','http://www.youtube.com/embed/scjccLl1z8Q',NULL,'http://img.youtube.com/vi/scjccLl1z8Q/0.jpg','23',NULL,'2013-12-16 17:57:12','2013-12-19 18:39:31','scjccLl1z8Q','펌을 한 긴 머리가 의외로 멋을 내기 쉽지 않지요? 지난번 물결 머리에 이은 웨이브 + 땋은머리 2탄입니다. 긴 머리와 드라이어, 아이론 등 늘 사용하는 도구로 멋 내기에 좋은 땋은 머리 디테일! 혼자 하기에는 약간 난이도가 있는만큼...크리스마스, 송년회, 그 외 즐거운 자리에 나가기 앞서, 친구들끼리 모여서 서로 해주기에 딱 좋은 스타일이 아닐까 생각되네요. \n\nIn Korea, there are two classic hairstyle that many girls prefer: long, straight-ironed hair or long, wavy perm hair. However, Jungsaemmool Inspiration\'s staff noticed that many girls seem to suffer less variety in hair-styling after the perm. Plus, an additional worry: sometimes, the wavy perm seem to make girls\' faces appear too mature. So here it is: \n\ntransforming a mature-looking wave perm into a cute, girlish wave with braids! \n\nAnd YES, you may have noticed that the Team Jungsaemmool loves braids...but only because it is thought to be a simple way to add fun and sophistication (and also relatively easy to follow) to hair-styling!\n\nNext time, Channel Jungsaemmool will be back with more makeup tutorials, so please stay tuned. With love!',192,0,NULL,'2012-12-18 04:51:22',NULL,'_from-mature-to-cute-braid-band-decoration-wmv'),(4848,'[NYLON TV KOREA] 이기광 윤두준','http://www.youtube.com/embed/VD-AEyAXWBg',NULL,'http://img.youtube.com/vi/VD-AEyAXWBg/0.jpg','24',NULL,'2013-12-16 17:57:15','2013-12-19 18:39:31','VD-AEyAXWBg','do what U want\n\n가수와 연기자의 영역을 넘나들며, 2013년 한 해를 그 누구보다 바쁘게 보낸 윤두준과 이기광. 그대 이 곳에서라도 편히 쉬어요.\n\nfeatured music 짙은 - December\nmusic directed by Pastel Music   \n\nEDITOR YOO EUN YOUNG\nNYLON TV PD KIM SANG EUN\nFILMED BY SEO JUN SEOK',129,0,NULL,'2013-11-18 07:58:26',NULL,'nylon-tv-korea'),(4849,'[NYLON TV KOREA] 써니 x 펠틱스','http://www.youtube.com/embed/suSLYPEeQkE',NULL,'http://img.youtube.com/vi/suSLYPEeQkE/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','suSLYPEeQkE','sunny christmas\n\n힙한 소울로 가득한 스트리트 캐주얼 브랜드 펠틱스와 써니가 크리스마스 파티를 함께 했다. \"난 혼자가 아니야. 남자친구보다 더 따뜻한 패딩이 여기 있잖아.\"\n\nfeatured music 전기뱀장어 - 최신유행\nmusic directed by Sound Holic\n\nEDITOR YOO EUN YOUNG\nNYLON TV PD KIM SANG EUN\nFILMED BY KIM SANG EUN',118,0,NULL,'2013-11-18 05:12:12',NULL,'nylon-tv-korea-x'),(4850,'[NYLON TV KOREA]  스타일리스트 채한석과 뉴 젠 포토그래퍼 vol.12','http://www.youtube.com/embed/bPIe66TUjB8',NULL,'http://img.youtube.com/vi/bPIe66TUjB8/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','bPIe66TUjB8','santeria\n\n9집 앨범으로 돌아온 자우림과 스타일리스트 채한석, 그리고 12번째 뉴젠 포토그래퍼 우상희가 만났다. 나일로니아는 알고 있겠지만, 뉴젠 포토그래퍼 프로젝트의 마지막 작업이었다. 유머나 개그의 코드는 사실 이럴 때 더 필요하다. 처음 만났을 때, 그리고 헤어지는 순간. 우리 모두는 그날 밤, 몹시 즐거웠다.       \n\nfeatured music 자우림 - Dancing Star\nmusic directed by Sound Holic  \n\nEDITOR KANG HYO GENE                                                       \nSTYLIST CHAE HAN SEOK                                                     \nPHOTOGRAPHED BY WOO SANG HEE\nNYLON TV PD KIM SANG EUN                                           \nFILMED BY OH BUM BIN(BBO digital film works)',139,0,NULL,'2013-10-18 04:30:20',NULL,'nylon-tv-korea-vol-12'),(4851,'[NYLON TV KOREA] 나일론 데님 데이','http://www.youtube.com/embed/T4Q0c0Jw1gc',NULL,'http://img.youtube.com/vi/T4Q0c0Jw1gc/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','T4Q0c0Jw1gc','wild & young\n\n완벽한 핏과 트렌디한 디자인을 추구하는 데님 브랜드 리바이스와 나일론이 함께 한 데님 데이. \n\nfeatured music 고고보이스 - xxx\nmusic directed by Sound Holic              \n                                                                     \nEDITOR  YI YOON JIN \nNYLON TV PD KIM SANG EUN\nFILMED BY KIM SANG EUN',83,0,NULL,'2013-10-18 04:20:54',NULL,'nylon-tv-korea--2'),(4852,'[NYLON TV KOREA] beauty studio x 에스쁘아','http://www.youtube.com/embed/XXAsj7rVtYU',NULL,'http://img.youtube.com/vi/XXAsj7rVtYU/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','XXAsj7rVtYU','3 artists, 3 weapons \n\n최상의 피부 컨디션으로 만들어 완벽한 메이크업을 연출하는 스킨 케어 아이템이 나타났다. 스타 메이크업 아티스트 원조연, 이미영, 이준성 실장이 한눈에 반해버린 이것의 정체는?\n\nfeatured music 희영(hee young ) - Are You Still Waiting? \nmusic directed by Pastel Music                                                                                                                                             \nEDITOR  O DA HYE\n