8'),(4856,'[NYLON TV KOREA] beauty studio x 베네피트','http://www.youtube.com/embed/zlJ3bGsh8uw',NULL,'http://img.youtube.com/vi/zlJ3bGsh8uw/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','zlJ3bGsh8uw','brow magic show! \n\n신사숙녀 여러분, 곧 지상최고의 눈썹 전문가 베네피트가 펼치는 쇼를 시작하겠습니다. 마법 지팡이 \'김미 브라우\'로 완벽한 눈썹이 생기는 마술 쇼, 절대 놓치지 마세요! \n\nfeatured music 소규모 아카시아 밴드 - Dream Is Over\nmusic directed by Pastel Music                                                       \n\nEDITOR  O DA HYE\nNYLON TV PD KIM SANG EUN\nFILMED BY KIM SANG EUN',142,0,NULL,'2013-09-18 02:05:16',NULL,'nylon-tv-korea-beauty-studio-x--9'),(4857,'[NYLON TV KOREA] 스타일리스트 채한석과 뉴 젠 포토그래퍼 vol.11','http://www.youtube.com/embed/BG6eFjlLIEA',NULL,'http://img.youtube.com/vi/BG6eFjlLIEA/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','BG6eFjlLIEA','the girl with a pearl earring\n\n체크 스커트를 입고 진주 귀걸이를 한 소녀. \n\nfeatured music 커먼그라운드(Common Ground)  - Shake It!\nmusic directed by SoundHolic                                                                 \n\nEDITOR KANG HYO GENE                                                              \nSTYLIST CHAE HAN SEOK                                                     \nPHOTOGRAPHED BY KIM HYUK\nNYLON TV PD KIM SANG EUN                                                                   \nFILMED BY SEO JUN SEOK',118,0,NULL,'2013-09-17 14:52:09',NULL,'nylon-tv-korea-vol-11'),(4858,'[NYLON TV KOREA]ESTEE LAUDER beauty of night!','http://www.youtube.com/embed/B0SU5E-t634',NULL,'http://img.youtube.com/vi/B0SU5E-t634/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','B0SU5E-t634','에스티 로더의 6세대 갈색병 출시를 축하하기 위해서 한고은, 황신혜, 황우슬혜, 김완선, 이종혁... 셀 수없이 많은 셀럽이 한 자리에 모였다. 이들이 직접 전하는 6세대 갈색병의 이야기와 뷰티 오브 나이트의 생생한 현장, 지금 바로 플레이 하시라! \n \nfeatured music Lusia(심규선) - 자기만의 방\nmusic directed by Pastel Music                                      \n \nEDITOR  O DA HYE\nNYLON TV PD KIM SANG EUN\nFILMED BY KIM SANG EUN',117,0,NULL,'2013-09-14 07:52:39',NULL,'nylon-tv-korea-estee-lauder-beauty-of-night'),(4859,'[NYLON TV KOREA] 잠뱅이 x 이종석 + 박신혜','http://www.youtube.com/embed/sllPVf_LQtA',NULL,'http://img.youtube.com/vi/sllPVf_LQtA/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','sllPVf_LQtA','rising again \n\n무더운 날씨의 연속이지만, 잠뱅이의 2013 F/W 광고 촬영 현장에서 만난 배우 이종석과 박신혜는 쿨하기 그지 없었다. 그런 자리에 나일론이 빠질 수 없다. \n\n\nfeatured music 커먼그라운드(Common Ground) - FunKastik James (Glen Check Remix)\nmusic directed by SoundHolic\n\nEDITOR YI YOON JIN\nNYLON TV PD KIM SANG EUN\nFILMED BY OH BUM BIN(BBO digital film works)',79,0,NULL,'2013-08-23 01:19:35',NULL,'nylon-tv-korea-x--2'),(4860,'[NYLON TV KOREA] 스타일리스트 채한석과 뉴 젠 포토그래퍼 vol.10','http://www.youtube.com/embed/lo-A31f9Z7A',NULL,'http://img.youtube.com/vi/lo-A31f9Z7A/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','lo-A31f9Z7A','No.5\n\n채한석과 뉴젠 포토그래퍼 천영상, 그리고 10명의 모델이 모여 나일론 창간 5주년을 축하했다. 물론 NYLON TV는 더 재밌다.     \n\nfeatured music 후후(whowho)  - Dance In The Rain         \nmusic directed by SoundHolic                                                                 \n\neditor KANG HYO GENE                                                              \nstylist CHAE HAN SEOK                                                     \nPhotographed by CHUN YOUNG SANG\n\nNYLON TV PD KIM SANG EUN                                                                   \nFILMED BY OH BUM BIN(BBO digital film works)',127,0,NULL,'2013-08-19 02:23:44',NULL,'nylon-tv-korea-vol-10'),(4861,'[NYLON TV KOREA] 에스티 로더','http://www.youtube.com/embed/3aDTbXEcEjU',NULL,'http://img.youtube.com/vi/3aDTbXEcEjU/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','3aDTbXEcEjU','32년간의 끊임없는 혁신. 갈색병의 또 한번의 진화 \n\n전 세계 여성들이 경험한 에스티 로더의 No.1 리페어 \'갈색병\'이 또 한번 진화 한다. \n1982년 첫 \'나이트 리페어\' 출시 이후, 32년간의 끊임 없는 혁신의 결과로 만들어진 신제품 갈색병 리페어는 에스티 로더 사상 가장 종합적이고 진보한 \'나이트 리페어\' 제품이다. \n신제품 갈색병은 8월 9일부터 만나 볼 수 있다.',16,0,NULL,'2013-07-30 02:16:51',NULL,'nylon-tv-korea--4'),(4862,'[NYLON TV KOREA] 스타일리스트 채한석과 뉴 젠 포토그래퍼 vol.9','http://www.youtube.com/embed/14cvsH0Bxi4',NULL,'http://img.youtube.com/vi/14cvsH0Bxi4/0.jpg','24',NULL,'2013-12-16 17:57:16','2013-12-19 18:39:31','14cvsH0Bxi4','it\'s for you\n\n스타일리스트 채한석과 뉴젠 포토그래퍼 장엽, 그리고 애프터스쿨의 가은이 나일로니아에게 한 턱 제대로 쏩니다. 가은이 입은 8가지 룩을 모두 선물로 드리겠어요. 지금 바로 나일론 페이스북을 확인해주세요!\nwww.facebook.com/nylonkorea\n\nfeatured music 루비스타(Ruby Star) - Masquerade         \nmusic directed by SoundHolic                                                                 \n\neditor KANG HYO GENE                                                              \nstylist CHAE HAN SEOK                                                     \nPhotographed by JANG YOUP\nNYLON TV PD KIM SANG EUN                                                                   \nFILMED BY SEO JUN SEOK',206,0,NULL,'2013-07-26 04:00:11',NULL,'nylon-tv-korea-vol-9'),(4863,'[NYLON TV KOREA] 커밍스텝','http://www.youtube.com/embed/7goSycv-DrU',NULL,'http://img.youtube.com/vi/7goSycv-DrU/0.jpg','24',NULL,'2013-12-16 17:57:17','2013-12-19 18:39:31','7goSycv-DrU','우리 둘리가 달라졌어요 \n\n감각적인 캐주얼 브랜드 커밍스텝에서 \'아기 공룡 둘리\'의 30주년을 기념해 콜라보레이션 컬렉션을 선보인다. 티셔츠와 셔츠 등을 비롯해 총 4가지로 구성된 이 컬렉션은 가벼운 소재와 내추럴한 핏으로 편안한 착용감을 제공하는 것이 특징이다. 같은 디자인의 남성 제품도 출시된다고 하니 커플 아이템을 찾고 있다면 이 컬렉션이 제격이다. 게다가 이 컬렉션을 구매하면 둘리가 프린트된 귀여운 클러치도 증정한다. 그러니까 발랄한 루킹을 즐기는 이들에겐 더할 나위 없이 반가운 소식!',41,0,NULL,'2013-07-23 06:11:28',NULL,'nylon-tv-korea--5'),(4864,'[NYLON TV KOREA] 베네피트 \'하이드라-스무드 립 컬러\' 론칭 행사','http://www.youtube.com/embed/yOTdlBfX-Uw',NULL,'http://img.youtube.com/vi/yOTdlBfX-Uw/0.jpg','24',NULL,'2013-12-16 17:57:17','2013-12-19 18:39:31','yOTdlBfX-Uw','wow! hydra smooth\n\n기발한 네이밍, 감각적인 패키지, 뷰티 고민들을 콕 짚어 해소해주는 센스까지 겸비한 베네피트의 제품들을 만나는 건 언제나 즐겁다.  베네피트의 창립자 진의 딸이자 제인의 조카인 애니와 매기가 내한해 직접 선보인 \'하이드라-스무드 립 컬러\' 론칭 행사는 패션, 뷰티 피플과 기자, 셀러브리티들로 북새통을 이뤘다. \n\nfeatured music Lucia(심규선) - 어른이 되는 레시피                               \nmusic directed by Pastel Music                                                         \n\nEDITOR LEE SUN JUNG\nNYLON TV PD KIM SANG EUN\nFILMED 