               \nmusic directed by SoundHolic\n\nEDITOR  KIM SO HEE, KIM SOO JI \nNYLON TV PD KANG JI HYE \nNYLON TV AD KIM SANG EUN\nFILMED BY SEO JUN SEOK',131,0,NULL,'2013-04-27 00:32:37',NULL,'nylon-tv-korea-6-brilliant-tattoo-artists'),(4871,'[NYLON TV KOREA] NII x JYJ','http://www.youtube.com/embed/1wBJCbQMTpg',NULL,'http://img.youtube.com/vi/1wBJCbQMTpg/0.jpg','24',NULL,'2013-12-16 17:57:17','2013-12-19 18:39:32','1wBJCbQMTpg','NII와 JYJ가 여름 광고 캠페인을 촬영했다. 바다를 연상시키는 파란 세트장에서 진행된 이번 화보는 알록달록한 NII의 여름 의상과 어우러져 상큼한 분위기를 자아냈다. 메이킹 영상과 사진은 NII 홈페이지(www.nii.co.kr)와 페이스북(www.facebook.com/nii27)을 통해 만날 수 있다. 이번 캠페인에는 김재중의 강아지, 쥬니도 참여했다니 JYJ 팬들에겐 특히 반가운 소식일 듯.',101,0,NULL,'2013-04-25 02:10:21',NULL,'nylon-tv-korea-nii-x-jyj'),(4872,'[NYLON TV KOREA] don\'t cry baby please don\'t cry','http://www.youtube.com/embed/JWv08GNMmGo',NULL,'http://img.youtube.com/vi/JWv08GNMmGo/0.jpg','24',NULL,'2013-12-16 17:57:17','2013-12-19 18:39:32','JWv08GNMmGo','don\'t cry baby please don\'t cry\n\n부은 두 눈을 보이기 싫었어요. 아름다운 샤넬의 선글라스로 내 마음을 숨겨 봅니다.\n\nfeatured music 루비스타(Ruby Star) - Neutrino\nmusic directed by SOUNDHOLIC\n\nEDITOR KANG HYO GENE\nNYLON TV PD KANG JI HYE\nNYLON TV AD KIM SANG EUN\nFILMED BY SEO JUN SEOK',80,0,NULL,'2013-04-24 02:54:35',NULL,'nylon-tv-korea-don-t-cry-baby-please-don-t-cry'),(4873,'[NYLON TV KOREA]바비 브라운의 2013 F/W 뉴욕 패션위크 백스테이지 메이크업 현장 엿보기!','http://www.youtube.com/embed/D8reRzUkFnI',NULL,'http://img.youtube.com/vi/D8reRzUkFnI/0.jpg','24',NULL,'2013-12-16 17:57:17','2013-12-19 18:39:32','D8reRzUkFnI','바비 브라운의 아티스트 팀이 백 스테이지 메이크업을 담당한 2013 F/W 뉴욕 패션위크! 바비 브라운 여사의 진두지휘 아래, 7개국에서 모여든 40명의 글로벌 아티스트가 티비(Tibi), 레이첼 로이(Rachel Roy), 홈즈 앤 양(Holmes & Yang) 등 20개의 쇼를 더욱 돋보이도록 백 스테이지에서 활약했다. 우리나라의 바비 브라운 수석 메이크업 아티스트 노용남 팀장도 당당히 참여해 멋진 룩을 보여준 2013 F/W 뉴욕 패션위크. 그 생생한 백스테이지 현장을 영상으로 고스란히 담았다.',72,0,NULL,'2013-04-23 08:10:49',NULL,'nylon-tv-korea-2013-f-w'),(4874,'[NYLON TV KOREA] last ceremony','http://www.youtube.com/embed/gPBcbv2O0Mk',NULL,'http://img.youtube.com/vi/gPBcbv2O0Mk/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','gPBcbv2O0Mk','last ceremony\n\n쇼는 끝났지만 서울 패션 위크 2013 F/W는 이제 시작이다.\n\nfeatured music 박준혁 - 강아지\nmusic directed by Pastel Music\n\nEDITOR JUNG HEE IN, YOO EUN YOUNG\nNYLON TV PD KANG JI HYE \nNYLON TV AD KIM SANG EUN\nFILMED BY SEO JUN SEOK',90,0,NULL,'2013-04-19 09:13:11',NULL,'nylon-tv-korea-last-ceremony'),(4875,'[NYLON TV KOREA]스타일리스트 채한석과 뉴 젠 포토그래퍼 vol.6','http://www.youtube.com/embed/dRriVpP27ls',NULL,'http://img.youtube.com/vi/dRriVpP27ls/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','dRriVpP27ls','new age newera\n\n모던하고 페미닌하게 정제된 2013년식 힙합 룩을 소개한다. 쿨한 패턴과 컬러가 돋보이는 8가지 뉴에라 스타일. \n\nfeatured music 후후(WhoWho) - Love\nmusic directed by SOUNDHOLIC \n\neditor KANG HYO GENE\nstylist CHAE HAN SEOK\nPhotographed by  GOWOON\nNYLON TV PD KANG JI HYE\nNYLON TV AD KIM SANG EUN\nFILMED BY OH BUM BIN(BBO digital film works)',124,0,NULL,'2013-04-18 04:02:41',NULL,'nylon-tv-korea-vol-6'),(4876,'[NYLON TV KOREA] beauty class x 렌 스킨케어','http://www.youtube.com/embed/GiupTB8PBsQ',NULL,'http://img.youtube.com/vi/GiupTB8PBsQ/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','GiupTB8PBsQ','real clean, ren \n\n건강한 피부를 가지려면 청결한 생활 습관과 철저한 클렌징이 우선이다. 깨끗해야 한다는 거다. 그래서 깨끗한 스킨케어 브랜드, 렌의 글로벌 헤드 디렉터 루이 브랑 쿠를 만나 진정한 깨끗함이 뭐냐고 물어봤다. \n\nfeatured music 도나웨일(Donawhale) - 반딧불소년(A Glow Boy)\nmusic directed by Pastel Music\n\nEDITOR  O DA HYE\nNYLON TV PD KANG JI HYE\nNYLON TV AD KIM SANG EUN\nFILMED BY KIM SANG EUN',88,0,NULL,'2013-04-18 03:55:59',NULL,'nylon-tv-korea-beauty-class-x'),(4877,'[NYLON TV KOREA] 박재범','http://www.youtube.com/embed/fKwckhfnS3Q',NULL,'http://img.youtube.com/vi/fKwckhfnS3Q/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','fKwckhfnS3Q','모두 사실이야\n\n의외로 더 피곤했다. 지나치게 솔직한 인터뷰이를 만나서.\n\nfeatured music 박재범 - 좋아(JOAH)\n\nEDITOR CHO YUN MI\nNYLON TV PD KANG JI HYE\nNYLON TV AD KIM SANG EUN\nFILMED BY KIM SANG EUN',66,0,NULL,'2013-04-17 06:06:48',NULL,'nylon-tv-korea--7'),(4878,'[NYLON TV KOREA] 에스티 로더 더블 웨어 라운지','http://www.youtube.com/embed/j3XnEr8dYMk',NULL,'http://img.youtube.com/vi/j3XnEr8dYMk/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','j3XnEr8dYMk','double wear lounge, wow! \n\n지난 4월 5~6일 신사동 가로수길에서 에스티 로더의 베스트셀링 파운데이션 \'더블웨어 파운데이션\'을 알리는 더블 웨어 라운지가 개최되었다. 이미 많은 뷰티 블로거와 에디터로부터 최고의 파운데이션 자리를 굳건히 지키고 있는 더블웨어 파운데이션. 미쳐 가보지 못했다면 에스티 로더의 더블웨어 파운데이션을 만나러 이곳을 방문해보자! www.esteelauder.co.kr\n\nfeatured music 인스턴트 로맨틱 플로어 - Duet\nmusic directed by Pastel Music\n\nEDITOR LEE SUN JUNG\nNYLON TV PD KANG JI HYE\nNYLON TV AD KIM SANG EUN\nFILMED BY KIM SANG EUN',85,0,NULL,'2013-04-17 03:41:04',NULL,'nylon-tv-korea--8'),(4879,'[NYLON TV KOREA] 크리스 크리스티','http://www.youtube.com/embed/C9OpJx0_uAk',NULL,'http://img.youtube.com/vi/C9OpJx0_uAk/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','C9OpJx0_uAk','time to shine\n\n크리스 크리스티가 원빈, 김민희와 함께 여름 화보 촬영을 진행했다. 우월한 존재감을 가진 두 배우가 크리스 크리스티의 가볍고 화사한 의상을 입어 더욱 빛이 났다는 후문이다. 다정한 연인의 스타일리시한 루킹을 콘셉트로 진행된 이번 캠페인은 4월 말 리뉴얼된 홈페이지를 시작으로 전국 매장과 여러 매체를 통해 공개된다.',85,0,NULL,'2013-04-17 03:25:31',NULL,'nylon-tv-korea--9'),(4880,'[NYLON TV KOREA] 라빠레뜨 x 효니','http://www.youtube.com/embed/eryElLKqvTw',NULL,'http://img.youtube.com/vi/eryElLKqvTw/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','eryElLKqvTw','isn\'t she lovely\n\n사랑하지 않고 견딜 수 없는 아름다운 오월. 모델 효니가 라빠레뜨의 백을 들고 나일론의 카메라 앞에 섰다. 지금 그녀를 사랑하지 않는 자, 모두 유죄. \n\nfeatured music 글렌체크(Glen Check) - Metro (Re Ver.)\nmusic directed by Sound Holic\n\nEDITOR YOO EUN YOUNG\nNYLON TV PD KANG JI HYE\nNYLON TV AD KIM SANG EUN\nFILMED BY OH BUM BIN(BBO digital film works)',131,0,NULL,'2013-04-16 02:35:24',NULL,'nylon-tv-korea-x--3'),(4881,'[NYLON TV KOREA] NY+LONDON FASHION MAGAZINE NYLON (advertising)','http://www.youtube.com/embed/EyA7V9rJLiA',NULL,'http://img.youtube.com/vi/EyA7V9rJLiA/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','EyA7V9rJLiA','NY+LONDON FASHION MAGAZINE [NYLON] \n\n뉴욕과 런던을 대표하는 패션 매거진 나일론\n비주얼 아티스트 VAKKI(빠키)와 나일론의 콜라보레이션 CF\nMTV에서도 매일 12:30, 14:30, 21:30에 확인 할 수 있습니다.  \n\n뉴욕과 런런의 감성을 전하는 패션 매거진 나일론을 \n매달 18일 서점에서 만나세요.\n\nFeatured Music \n러브엑스테레오(Love X Stereo) - Soul City (Seoul City)\n\nCollaboration Visual Artist \nVakki\n\nNYLON TV PD \nKang Ji Hye',31,0,NULL,'2013-04-02 08:21:11',NULL,'nylon-tv-korea-ny-london-fashion-magazine-nylon-advertising'),(4882,'[NYLON TV KOREA] NYLON TV x CHANEL ROUGE COCO SHINE','http://www.youtube.com/embed/WvJ60_jRa9s',NULL,'http://img.youtube.com/vi/WvJ60_jRa9s/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','WvJ60_jRa9s','NYLON TV x CHANEL ROUGE COCO SHINE  lip&nail cinematheque\n\n영화에서 영감을 받아 만들어진 샤넬의 루즈 코코, 루즈 코코 샤인, 르 베르니즈의 새로운 컬러들이 개봉을 앞두고 있다.나일론 시네마떼끄에서 미리 보는 예고편.\n매장으로 달려가기 전, 나일론이 이 세 가지 콜렉션을 가지고 만든 짧은 필름을 감상해보시길! 나일론 특유의 아트워크와 샤넬의 파리지엥 감성이 만난 재미있는 영상이 상영된다! \n \nCollaboration Visual Artist Vakki\n\nFeatured Music 후후(WHOwho) - Bye Bye\nMusic Directed by Sound Holic\n\nModel CHOI A RA\nHair KANG HYUN JIN\nMake up KIM JI HYUN\nShooting SEO JUN SEOK\nNYLON TV AD KIM SANG EUN\nNYLON TV PD KANG JI HYE',34,0,NULL,'2013-03-26 09:22:06',NULL,'nylon-tv-korea-nylon-tv-x-chanel-rouge-coco-shine'),(4883,'[NYLON TV KOREA] 비달사순 x 오렌지캬라멜','http://www.youtube.com/embed/3Y58_irXymw',NULL,'http://img.youtube.com/vi/3Y58_irXymw/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','3Y58_irXymw','follow me, it ll be alright!\n\n톡톡 튀는 매력의 소유자 오렌지 캬라멜의 나나, 레이나, 리지가 \'트랜스포머 멀티 스타일러\'와 만났다. 그녀들이 뽐내는 6가지 헤어 스타일링, 한 번 따라 해 보는 건 어때? \n\nfeatured music 희영(Hee Young) - Lonely Like Everyone                                          \nmusic directed by Pastel Music                                                            \n \nEDITOR LEE HYE WON \nNYLON TV PD KANG JI HYE \nNYLON TV AD KIM SANG EUN\nFILMED BY OH BUM BIN(BBO digital film works)',138,0,NULL,'2013-03-22 11:45:06',NULL,'nylon-tv-korea-x--4'),(4884,'[NYLON TV KOREA] 4minute','http://www.youtube.com/embed/CSDSMFRy0sI',NULL,'http://img.youtube.com/vi/CSDSMFRy0sI/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','CSDSMFRy0sI','Girls Just Wanna Have Fun \n\n자고 일어나면 새로운 아이돌이 나오는 시대를 살면서도 포미닛은 여전히 티 하나 없이 맑게 웃는다. \n\nfeatured music 루비스타(Ruby Star) - Rubycraft\nmusic directed by SOUND HOLIC\n\nEDITOR KIM SO HEE\nNYLON TV PD KANG JI HYE \nNYLON TV AD KIM SANG EUN\nFILMED BY SEO JUN SEOK',99,0,NULL,'2013-03-21 13:52:06',NULL,'nylon-tv-korea-4minute'),(4885,'[NYLON TV KOREA] 커밍스텝','http://www.youtube.com/embed/hkMOxoEPFOw',NULL,'http://img.youtube.com/vi/hkMOxoEPFOw/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','hkMOxoEPFOw','new campaign story\n\n세계적인 포토그래퍼 조쉬 올리스와 모델 카티 네슈어가 커밍스텝의 2013 S/S 광고 캠페인을 위해 만났다. \'youthful, light&easy\'를 테마로 진행된 이번 캠페인은 카티의 생동감 있는 포즈와 표정을 아름답게 포착한 컷들로 구성되었다고 한다. 커밍스텝의 이번 시즌 룩이 올리스와 네슈어에 의해 얼마나 근사하게 표현되었는지 광고 캠페인을 통해 확인할 수 있다.',44,0,NULL,'2013-03-20 07:26:34',NULL,'nylon-tv-korea--10'),(4886,'[NYLON TV KOREA] topten s/s new campaign','http://www.youtube.com/embed/df_yg_GEbFI',NULL,'http://img.youtube.com/vi/df_yg_GEbFI/0.jpg','24',NULL,'2013-12-16 17:57:18','2013-12-19 18:39:32','df_yg_GEbFI','topten s/s new campaign \n\n트렌디하고 실용적인 아이템으로 사랑받는 탑텐이 새로운 광고 캠페인을 선보인다. 지난해 론칭할 때부터 함께 작업해온 NAGI와 한 번 더 호흡을 맞춰 브랜드 특유의 활기찬 에너지를 고스란히 담았다. 매 시즌 필수 아이템 10가지를 합리적인 가격대로 선보이는 탑텐, 론칭 1주년을 맞아 선보일 새로운 아이템과 캠페인이 기대된다. \n\nfeatured music 트램폴린(Trampauline) - 1995\nmusic directed by Pastel music',69,0,NULL,'2013-03-19 05:38:00',NULL,'nylon-tv-korea-topten-s-s-new-campaign'),(4887,'[NYLON TV KOREA] BEAUTY STUDIO x 더페이스샵','http://www.youtube.com/embed/lHxhVifOnHA',NULL,'http://img.youtube.com/vi/lHxhVifOnHA/0.jpg','24',NULL,'2013-12-16 17:57:19','2013-12-19 18:39:32','lHxhVifOnHA','splash illumination\n\n윤광, 물광, 꿀광, 결광... 온갖 광 트렌드 속에서도 나일로니아는 딱 하나만 알면 된다. 바로 시선을 사로잡는 화사한 조명광! TV속 여배우의 이 아름다운 조명광 피부가 만들어지는 과정을 스타 아티스트 손대식이 나일론에 낱낱이 공개했다. \n\nfeatured music 센티멘탈 시너리(Sentimental Scenery) - Heavenly Sky(feat. 심규선)\nmusic directed by Pastel Music\n\nEDITOR  O DA HYE\nNYLON TV PD KANG JI HYE\nNYLON TV AD KIM SANG EUN\nFIL