 filmed it at night and color is all messed up and didnt know how to correct them... :\'(\nGive this video thumbs up! if you wanna see more celeb makeup tutorial :)\nThank you!\n\n안녕하세요~~~~ \n오늘은 인터넷에서 보고 완전 반해버린 아만다 사이프리드 사진속의 메이크업을 해봤어요~\n확실히 얼굴이 워낙 다르게 생겨서 비슷해보이지는 않지만...ㅠㅠ 그래도 핑크핑크한 메이크업이 너무 예뻐서 한번 따라해봤어요 :) 특별한 날에 여성스러워보이고 싶을때 하면 좋을듯 ㅎㅎㅎㅎ\n동영상에 색이 막 자꾸 바뀌는거 너무 죄송해요.ㅠㅠ 저녁에 찍었는데 막 애들 색이 맘대론데 색 보정을 어떻게 하는지..... 잘 모르겠어요.ㅠㅠ\n암튼 재밌게 보시구 해외셀렙 메이크업 더 보시고 싶으시면 비디오 Thumbs up!주세요~\n감사합니다!!',714,0,NULL,'2013-12-09 02:44:03',1,'date-night-makeup-inspired-by-amanda-seyfried'),(4935,'Korean makeup vs American makeup 한국 메이크업과 미국 메이크업의 다른점! :)','http://www.youtube.com/embed/In455i8fTGI',NULL,'http://img.youtube.com/vi/In455i8fTGI/0.jpg','26',6,'2013-12-16 17:57:28','2013-12-25 14:09:06','In455i8fTGI','Watch my VLOG here : www.youtube.com/theyounguru\nFacebook : www.facebook.com/soyoungsbeautyroom\nInstagram : soyoung0201\n\n안녕하세요 \n오늘은 한국과 미국의 메이크업을 관찰한 결과 제가 느낀 점들을 간단하게 비디오로 만들어봤어요~\n재밌게 보시고 Thumbs up! 공유! 부탁드려요~♥\n감사합니다!!!\n\nHello everyone ♥★\ntoday\'s video is the difference between Korean makeup and American makeup.\nI\'m not saying all Korean does their makeup this way or all American does their makeup this way :)\nThese are just some things I recognized in Korean makeup and American makeup.\nI hope you enjoy this video :D\nThank you soooo much for watching!!!! ♥\n\n*Products used in this video*\n\nKorean makeup\n-MAC strobe cream\n-IOPE AirCushion N23 \n-Bobbybrown bronzing powder\n-Thebalm downboy\n-Makeup Forever aqua eyes pencil liner \n-MAC brunette eye brows pencil\n-Missha sepia Ink brush pen liner\n-Aritaum cushion tint #3 blondie\n\nAmerican makeup\n-Smashbox camera ready BB cream in medium\n-Bobbybrown bronzing powder\n-Stila custom color blush \n-MAC brunette eyebrow pencil\n-NYX super skinny eye marker in carbon black\n-Thebalm nudetude palette\n-Maybelline Instant agerewind eraser concealer in light \n-YSL rouge volupte shine 19 fucshia in rage',525,0,NULL,'20