17:57:33','2013-12-19 18:39:35','RZANRD2YPVU','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey guys! We celebrated Yunwoo\'s 1st birthday / Doh party yesterday.  His actual birthday is on the 26 (Thursday), but Koreans celebrate it on the weekend before the birthday (since that is when everyone is off work).  For those that don\'t know what DOHL party is, it is a huge Korean 1st Birthday celebration.  They invite their family and friends to celebrate. The main thing during this event is to see what item the baby will pick up.  It will \"show\" what they will become when they get older (shows their future).  Yunwoo picked up the mic which means he will be a singer/entertainer! hehe~!  Hope you guys enjoyed this video! Thanks to my brother for filming this during the party!  I just noticed that the company at Korea that made our presentation video spelled the word \"first\" wrong... booo~! Anyways~  I will be uploading A LOT of pictures from his birthday party on my blog very soon!  Thanks to everyone for wishing him a happy birthday! Love you guys! Muah~~~!\n\n(I uploaded this vlog on my main channel because I upload my important vlogs from events on this channel. Please subscribe to my 2nd channel for more of the daily vlogs!)\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',230,0,NULL,'2013-09-24 01:37:28',NULL,'yunwoo-s-1st-birthday-dohl-party'),(4954,'Kollaboration Dallas 2013 VLOG','http://www.youtube.com/embed/XIGXCBoaA6Y',NULL,'http://img.youtube.com/vi/XIGXCBoaA6Y/0.jpg','27',NULL,'2013-12-16 17:57:33','2013-12-19 18:39:35','XIGXCBoaA6Y','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey guys! I was one of the judges this past weekend for Kollaboration Dallas! I had such a great time watching the show and got to meet so many talented people.  I\'m trying to convince my brother to join for next year\'s show! hehe\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',241,0,NULL,'2013-09-16 22:41:33',NULL,'kollaboration-dallas-2013-vlog'),(4955,'Collective Haul ♥ Beauty & Fashion','http://www.youtube.com/embed/aW92ZwLhJkg',NULL,'http://img.youtube.com/vi/aW92ZwLhJkg/0.jpg','27',NULL,'2013-12-16 17:57:33','2013-12-19 18:39:35','aW92ZwLhJkg','♥  CLICK HERE FOR MORE INFO  ♥ \n\n\nHey Guys!!!! I have another collective haul for you with both beauty and fashion products!!\nWhich item shown in the video was your favorite? =)  If I was to do a giveaway soon would you guys prefer a beauty or clothing piece? =) Let me know!\n\n\nPRODUCTS MENTIONED :\n\n( B E A U T Y H A U L - from http://www.imomoko.com)\n10% off promotional code! - \"10LOVE\"\n\nKiss Me Lengthening Mascara\n\nShu Uemura Tokyo Lash Mascara - http://bit.ly/16uHrEY\n\nshiseido eyelash curler\n\nshiseido eyeshadow pencil - http://www.imomoko.com/shiseido-integrate-pencil-eyes-eyeshadow-pencil-2651.html\n\nEyemazing Eyelashes #101 - http://www.imomoko.com/eyemazing-jun-komori-false-eyelashes.html\n\nEtude House Crystal Shine Lips PPK002 - http://www.imomoko.com/etude-house-etoinette-crystal-shine-lips.html\n\n\n( F A S H I O N  H A U L - from http://www.miamasvin.net/?utm_source=Youtube&utm_medium=Video&utm_campaign=beautifymeeh)\n\nblue skirt - http://miamasvin.net/product/Ruffled-Skater-Skirt-with-Asymmetrical-Hem/SFSELFAA0010266/?main_cate_no=AD000000&display_group=1#.UjdCbRbZ14N\n\nmaxi dress - http://miamasvin.net/product/Shirred-Waist-Maxi-Dress/SFSELFAA0010108/?main_cate_no=AI000000&display_group=1#.UjdCzRbZ14M\n\n(I think the other two items are out of stock right now, I don\'t see it on the site!)\n\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd chann