itter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',414,0,NULL,'2013-08-27 07:33:24',NULL,'collective-haul-beauty-fashion--2'),(4959,'Hubby Cooking : Jajangmyun & Tangsooyook','http://www.youtube.com/embed/S9-333RmCGo',NULL,'http://img.youtube.com/vi/S9-333RmCGo/0.jpg','27',NULL,'2013-12-16 17:57:34','2013-12-19 18:39:35','S9-333RmCGo','♥  CLICK HERE FOR MORE INFO  ♥ \n\n\nFinally ... a cooking video that so many of you guys have been waiting for! Aiden decided to make jajangmyun and tangsooyook for dinner since his sister and her boyfriend was coming over!  I thought it was a great idea to film him cooking~!  For those who don\'t know.. jajangmyun 짜장면 is blackbean noodles & tangsooyook 탕수육 is sweet & sour deep fried pork!  Both dishes are very popular and delicious!!!\n\nIf you have a request on what he should cook NEXT, let us know in the comment box down below! Happy Eating! =)\n\n\nWATCH :\n\nPrevious Cooking Video - http://youtu.be/9ovscT2_8OE\nHow We Met ♥ - http://youtu.be/ts2kkp1SrO4\nCurrent Skincare Routine - http://youtu.be/yLInKTScFVw\nLatest Hair Tutorial (Waves) - http://youtu.be/YXl6LzgXMVI\nCurrent Giveaway - http://youtu.be/v-S2rEyuLAc\n\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',540,0,NULL,'2013-08-17 17:36:30',NULL,'hubby-cooking-jajangmyun-tangsooyook'),(4960,'My Freelance Makeup Kit - TOOLS','http://www.youtube.com/embed/SdyF5UJ3lA0',NULL,'http://img.youtube.com/vi/SdyF5UJ3lA0/0.jpg','27',NULL,'2013-12-16 17:57:34','2013-12-19 18:39:35','SdyF5UJ3lA0','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey guys! I decided to film a video showing you guys some of the tools that I take along with me when I meet a client for wedding makeup.  It\'s super important to 