18:39:35','yb0LKisGxos','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey guys! Since school is about to start (or already started), I wanted to make an advice video and share some tips that was helpful for me when I was a student (many years ago!).  Hope this was helpful! Good luck on the start of your new school year!  Let me know if you have any requests on what I should talk about for my next advice video! Love yall!! Muahh =)\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',277,0,NULL,'2013-08-12 23:28:48',NULL,'advice-for-students'),(4963,'July Beauty Favorites ♥','http://www.youtube.com/embed/M5Si2qkuz6I',NULL,'http://img.youtube.com/vi/M5Si2qkuz6I/0.jpg','27',NULL,'2013-12-16 17:57:34','2013-12-19 18:39:35','M5Si2qkuz6I','♥  CLICK HERE FOR MORE INFO  ♥ \n\nAzulen paste is $18.99 on this website! http://www.skin-spa.com/dre-azulenpaste.htm\n\nHey guys! Time for another montly favorites!!! Here are couple of items that I have been loving in the month of July!  I also purchased four other Whisper lipsticks.. so if you guys want me to do a review on them, let me know!!!!\n \n \nThe azulen paste from the original brand seller (Dr. Eckstein) is no longer﻿ available. The $90 is from a different seller. I didn\'t buy mine for that much. You can find it on ebay too for half that price. It is pretty expensive, but def worth the price. Some acne creams that dermatologists prescribe cost $200-$300.  It works SOO well for me.. but please note that we all have different skin types... so it may work for me but not for you =)\n\n\nPRODUCTS MENTIONED :\n\n- Eylure Naturalites Natural Volume\n- Benefit Stay Flawless 15 Hr Primer\n- Bare Minerals Ready Blush \"The One\"\n- Makeup Forever High Definition Powder\n- Maybelline Color Whisper Lipstick \"Pin Up Peach\"\n- Azulen Paste (cheaper on ebay)\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : Everything was purchased by me! =)',300,0,NULL,'2013-08-06 05:04:44',NULL,'july-beauty-favorites'),(4964,'How To Fix Eye Shadow Duo','http://www.youtube.com/embed/e_wt3zr_s7k',NULL,'http://img.youtube.com/vi/e_wt3zr_s7k/0.jpg','27',NULL,'2013-12-16 17:57:34','2013-12-19 18:39:35','e_wt3zr_s7k','♥  CLICK HERE FOR MORE INFO  ♥ \n\n\nHey guys! One of my favorite duo eyeshadows cracked so I decided to film me fixing it! I used the common well known method that everyone uses (been around for years), but this one is slightly different since there are two shadow colors in one pan.  The single shadow colors are easier to fix since you can simply just pour the alcohol in the pan and mix it up until it\'s creamy.  Using alcohol is also safe since alcohol evaporates once it dries.  \n\nNail tutorial here (sis in law did it for me at home) -  http://youtu.be/mt3G8TrI-uY\n\n\n\nPRODUCTS MENTIONED :\n\n- too faced \"boy toy\" duo shadow\n- 70% alcohol\n- medicine dropper\n- mustaev small shadow brush\n- hair pin\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',163,0,NULL,'2013-07-25 03:32:46',NULL,'how-to-fix-eye-shadow-duo'),(4965,'What\'s In My Beach Bag?!','http://www.youtube.com/embed/SccUWxC3O9E',NULL,'http://img.youtube.com/vi/SccUWxC3O9E/0.jpg','27',NULL,'2013-12-16 17:57:34','2013-12-19 18:39:35','SccUWxC3O9E','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey guys! Since it\'s summer time, I decided to film what I carry in my beach bag.  I haven\'t been to the beach in a really long time! The last time was in Hawaii 2011 for our honeymoon =( boooo!   Hope you guys enjoy this! Let me know couple things that you like to take to the beach! (the clip at the beginning is at Hawaii!) hehe\n\nSunscreen - Neutrogena Ultra Sheer Sunscreen SPF50\n\n\n\nCheck out my friend\'s first single out on iTUNES! A. Song - \"Stay\"\n\nhttps://itunes.apple.com/us/album/stay-single/id672829905\n\n\nHis \"With You\" song that I use in a lot of my videos will be released very soon!\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',227,0,NULL,'2013-07-18 04:32:08',NULL,'what-s-in-my-beach-bag'),(4966,'Kollaboration Dallas Meet & Greet','http://www.youtube.com/embed/-iEEX4NMK0U',NULL,'http://img.youtube.com/vi/-iEEX4NMK0U/0.jpg','27',NULL,'2013-12-16 17:57:34','2013-12-19 18:39:35','-iEEX4NMK0U','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey guys!! I will be one of the judges for Kollaboration Dallas this year.  The show will be on September 14, 2013.  There will be a meet and greet before the show (Yunwoo and Aiden will be there too) so I can\'t wait to meet some of you guys!  You will be able to meet all the judges AND all the performers!  Arden Cho (love her!) was a judge for Kollaboration Dallas last year, and I\'m so excited for being one of the judges for this year!  If you are planning to go, let me know in the comment box down below!  \n\nGet Tickets Now - http://kollaborationdallas.eventbrite.com\n\n\n\n\n\nMore Info on Kollaboration Dallas :\n\n\"Kollaboration - platform for young artists to showcase their talents. Founded in 2000 by Paul PK Kim, Kollaboration began with a single show in Los Angeles.  Kollaboration now produces 15 shows across 14 cities in North America. Each year, Kollaboration involves hundreds of volunteers and performers, tens of thousands of live audience members, and millions of viewers online.\"\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',51,0,NULL,'2013-07-09 21:09:30',NULL,'kollaboration-dallas-meet-greet'),(4967,'June Beauty Favorites','http://www.youtube.com/embed/VTQkCdGlmkw',NULL,'http://img.youtube.com/vi/VTQkCdGlmkw/0.jpg','27',NULL,'2013-12-16 17:57:34','2013-12-19 18:39:36','VTQkCdGlmkw','♥  CLICK HERE FOR MORE INFO  ♥ \n\n\nHey Guys! Happy Independence Day! I decided to film my monthly favorite before I met up my friends for lunch!  I will have today\'s vlog up by tomorrow on my 2nd channel!\nAt the end of the video I accidently said July favorites! Oppps~ I meant June :)\n\nPRODUCTS MENTIONED :\n\n- Benefit Cha Cha Tint\n- Real Techniques Powder Brush\n- Bare Escentuals Mineral Foundation (Original) \"Fair\"\n- Shu Uemura #784 Light Beige Illuminating Foundation http://bit.ly/GB9Dix\n- The Face Shop Face It Radiance Dual Veil ConcealerNB21\n- Nivea Cherry Tinted Lip Balm\n- The Body Shop Satsuma Body Butter\n\n\n\nON ME:\n\nShirt & cardigan -  h&M\nEarrings - korea\nBracelet - NY street vendors\nWatch - marc jacobs\nLips -  MAC speed dial\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : I purchased everything with my money! =)',304,0,NULL,'2013-07-04 23:47:22',NULL,'june-beauty-favorites'),(4968,'My Little Yunwoo','http://www.youtube.com/embed/UuDEFVMZmBk',NULL,'http://img.youtube.com/vi/UuDEFVMZmBk/0.jpg','27',NULL,'2013-12-16 17:57:34','2013-12-19 18:39:36','UuDEFVMZmBk','♥  CLICK HERE FOR MORE INFO  ♥ \n\nI wanted to share this short b