ails : \n\nSTARTS - May 22, 2013\nENDS - June 6, 2013\n\n- one winner\n- USA & International\n- I will announce winner on my twitter/fb/blog 2 days after it ends\n- www.sephora.com\n \n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : This is NOT a sponsored video.',193,0,NULL,'2013-05-22 18:30:14',NULL,'life-updates-more-closed'),(4977,'April Favorites 2013','http://www.youtube.com/embed/5BU6030lxy0',NULL,'http://img.youtube.com/vi/5BU6030lxy0/0.jpg','27',NULL,'2013-12-16 17:57:35','2013-12-19 18:39:36','5BU6030lxy0','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey everyone!  I have another monthly favorites today! I can\'t believe it\'s already MAY! YAYYY it\'s my favorite month.. since my birthday is in May! =)  \nWhen I swatched it on my hand, the cc cream is lighter because my hands/body is darker than my face.  It matches my face color perfectly.\n\n\nPRODUCTS MENTIONED :\n\nHera CC Cream #2 Natural Beige (bought from ebay)\nAmore Pacific Energy Mist \nThe Face Shop Pore Care Pack Wash Off Mask\nBeauty Blender Makeup Sponge\nBenefit Coralista Blush\nNYX Tea Rose Lipstick\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer :  This is NOT a sponsored video.  Everything was purchased with my money.',281,0,NULL,'2013-05-03 01:59:16',NULL,'april-favorites-2013'),(4978,'50 Random Facts About Me','http://www.youtube.com/embed/3f7CTVIkM3Q',NULL,'http://img.youtube.com/vi/3f7CTVIkM3Q/0.jpg','27',NULL,'2013-12-16 17:57:35','2013-12-19 18:39:36','3f7CTVIkM3Q','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey everyone!  I saw this cute TAG video going around so I wanted to do it too!  \nSorry about the background noise towards the middle of the video~ we turned on the AC and didn\'t realize it would be that loud!  Please let me know one fact about you down in the comment box... and I would LOVE to read them!!!  \n\n- For those who are curious about what chigger bites are.. I did a post on it on my website long time ago! I can stand on grass for a few seconds and then quickly I run off. lol  The only time I do stand on grass is if my husband REALLY wants to take a picture somewhere with a nice scenery (usually where there is grass ).  What I would do for my husband~\n\n- I always put cheese in my kimbab!  Next time you make kimbab at home.. TRY IT! =)\n\n- Current Korean dramas that I am watching : 남자가 사랑할 때 &  직장의 신\n\n- My Top is from a store called \"UPSCALE\" here in Texas!\n\n\n* Upcoming Video : April Favorites, Makeup Tutorial, cooking video =)\n\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',319,0,NULL,'2013-04-29 22:09:54',NULL,'50-random-facts-about-me'),(4979,'Is He Interested? ♥','http://www.youtube.com/embed/W7qam4TRrwI',NULL,'http://img.youtube.com/vi/W7qam4TRrwI/0.jpg','27',NULL,'2013-12-16 17:57:35','2013-12-19 18:39:36','W7qam4TRrwI','♥  CLICK HERE FOR MORE INFO  ♥ \n \n\nHey everyone! Time for another chit-chat video! Today\'s topic is ways to tell if a guy is interested in you!  I\'ve been getting a lot of emails asking to do a video on this topic!\nHope you guys enjoy!  Please let me know if there are other topics you would like for me to talk about AND share a story in the comment box down below on how you were able to find out a guy was interested in you!  I would love to read about your story!  Have a great Thursday everyone!\n\n* Please note that just because he gives you ONE of the signs mentioned in this video doesn\'t necessarily mean that he might be interested in you... but the MORE signs he gives = higher chance that he does.... hehe =)\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',221,0,NULL,'2013-04-25 20:50:53',NULL,'is-he-interested'),(4980,'Shu Uemura Cleansing Oil Review','http://www.youtube.com/embed/ge8oduKII2s',NULL,'http://img.youtube.com/vi/ge8oduKII2s/0.jpg','27',NULL,'2013-12-16 17:57:35','2013-12-19 18:39:36','ge8oduKII2s','♥  CLICK HERE FOR MORE INFO  ♥ \n\nHey guys!  So far I am LOVING this cleansing oil!  It is so gentle on my skin, takes off all my makeup, and doesn\'t break me out.  I highly recommend this cleansing oil!\n\nPRODUCTS MENTIONED :\n\nShu Uemura Fresh Pore Clarifying Gentle Cleansing Oil - http://bit.ly/1fi92Qr\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv\n\n\nDisclaimer : This product was purchased with my own money =)',206,0,NULL,'2013-04-22 23:17:50',NULL,'shu-uemura-cleansing-oil-review'),(4981,'Draw My Life - Aiden (Hubby)','http://www.youtube.com/embed/9Lz_KU64H1I',NULL,'http://img.youtube.com/vi/9Lz_KU64H1I/0.jpg','27',NULL,'2013-12-16 17:57:35','2013-12-19 18:39:36','9Lz_KU64H1I','♥  I HAD TO RE-UPLOAD BECAUSE THE END GOT CUT OFF  ♥ \n\n\nHey guys!  Aiden finally filmed his \"DRAW MY LIFE\" today!  He had to draw on paper because he tried using the chalk that I used.. but it was too hard for him!  The chalk was too small for his big hand! A lot of people were curious of when Aiden moved to the United States... it was in 2001! =)  One funny part he forgot to add in his drawing was his first road trip in America!  He went with me and my family on a road trip to Galveston, TX.  We were having a romantic lunch on the beach alone together (facing each other sitting on the warm sand), and all of a sudden a sea gull POOPED on my face!!!! Aiden was laughing so hard while watching the poop droop down my face -_-.  I was sooo embarrassed and cried... but now that we look back and think about it.. it was sooo funny and we always laugh about it! Hehe.. but yeah.. we wanted to share that story with you guys! Hope you enjoy this video!\n\n\n\nBTW!  I uploaded pictures of Yunwoo\'s studio photoshoot on my blog.. so go check it out!\n\n\n\nOTHER SITES : \n\nblog http://www.beautifymeeh.com\n2nd channel http://www.youtube.com/beautifymeehtv\ntwitter http://twitter.com/beautifymeeh\nfacebook http://www.facebook.com/beautifymeeh\ninstagram @beautifymeeh\nYunwoo http://www.youtube.com/yunwootv',241,0,NULL,'2013-04-17 04:10:10',NULL,'draw-my-life-aiden-hubby'),(4982,'Holiday Daytime 2013 Makeup: Kiko Mizuhara Inspired Makeup','http://www.youtube.com/embed/HVw7veKTRA8',NULL,'http://img.youtube.com/vi/HVw7veKTRA8/0.jpg','28',NULL,'2013-12-16 17:57:39','2013-12-19 18:39:36','HVw7veKTRA8','♥Please Read Me!♥\nHey loves! Combining beginner\'s makeup with Holiday glam, here is my winter makeup for the daytime. I was very much inspired by model Kiko Mizuhara\'s clean and sleek makeup that she was wearing and I found the look very much appropriate for December. While the tutorial may be easy/simplistic, I found it great for both beginners and makeup lovers alike!\n♥Instagram: oiseau88\n♥Disclaimer: This video is not sponsored.\n♥Products Used:\n1. Lalavesi Akma Base Formula\n2. MAC Paint Pot, Soft Ochre\n3. Urban Decay Naked Palette, Naked\n4. Maybelline Master Duo Liquid Eyeliner, Black Lacquer\n5. Majolica Majorca Lash King\n6. Lioele Be My Skin Powder Pact [Oil Control Type], No.21 Blooming Ivory\n7. Guerlain Météorites Perles, No.1 Teint Rosé\n8. NARS Velvet Matte Lip Pencil, Red Square',199,0,NULL,'2013-12-04 03:54:10',0,'holiday-daytime-2013-makeup-kiko-mizuhara-inspired-makeup'),(4983,'Winter Fashion Styling Feat.FashionToAny♥겨울 패션 스타일링','http://www.youtube.com/embed/GYBrN-HWw3A',NULL,'http://img.youtube.com/vi/GYBrN-HWw3A/0.jpg','28',NULL,'2013-12-16 17:57:39','2013-12-19 18:39:36','GYBrN-HWw3A','♥Please Read Me!♥\nHey, loves! I have a simple outfit styling lookbook to share with you. These items are on trend for this winter and I love how comfortable and yet chic they are! I hope you enjoy and more makeup tutorials are on the way! xo\n♥Disclaimer: All clothing items are gifted from www.fashiontoany.com\n♥Instagram: oiseau88\n♥Items Shown\n1.Prada Baroque Round Sunglasses\n2. AllSaints Leather Booties\n3. Black Swan Dress:http://fashiontoany.com/black-swan-dress.html\n4. Fur Scarf:http://fashiontoany.com/fiance-fox-fur-scarf.html\n5. Clutch:http://fashiontoany.com/mild-clutch.html\n6. Waffle Set:http://fashiontoany.com/waffle-set.html\n7. Boy Fit Wool Jacket:http://fashiontoany.com/boy-fit-wool-jacket.html',113,0,NULL,'2013-11-21 06:11:56',NULL,'winter-fashion-styling-feat-fashiontoany'),(4984,'Fall 2013 Fashion Lookbook Feat. FashionToAny ♥ Fashion Giveaway','http://www.youtube.com/embed/YQafuKEXHwA',NULL,'http://img.youtube.com/vi/YQafuKEXHwA/0.jpg','28',NULL,'2013-12-16 17:57:39','2013-12-19 18:39:36','YQafuKEXHwA','♥Please Read Me!♥\nHey guys! I put together a simple yet chic lookbook for Fall! The items featured in the video are from a new Korean fashion site, www.fashiontoany.com. I am particularly found of this site for their sleek/fashion forward items that are effortlessly clean and structured. They update with new items daily and they house one of the best quality of Korean clothing online. So if you\'re into sleek, Korean fashion and/or fun leggings for Fall, check them out!\n♥Disclaimer: The featured clothing items are gifted from FashionToAny. \n♥Instagram: oiseau88\n♥Featured Items\n1. Beige Flare 