eeded\nYou\'re all I want\nHelp me know You are near \n\n\n- - - -\n\nFor those interested in Sydney, our church is holding a free 3-night conference with a famous pastor from Singapore (Pastor Kong Hee of City Harvest Church) coming to speak about faith, hope and love. Oppa is the worship leader of our church, and I\'m also in the team, so we will be leading the worship every night. Feel free to come along :) I invite you guys - already some from my Sydney Meet & Greet will be coming. \n\nFor details and free reservations (you must book your seat - limited spaces at our church!) : http://bit.ly/HPyGPS\n\n- - - -\n\nFOLLOW ME⇨\nWebsite/Blog: http://www.meejmuse.com\nYoutube: http://www.youtube.com/meejmuse\nFacebook: http://www.facebook.com/meejmuse\nTwitter: http://www.twitter.com/meejmuse\nInstagram: http://www.instagram.com/meejmuse\n\n- - - -',371,0,NULL,'2013-11-17 23:32:15',NULL,'draw-me-close-to-you-cover-meejmuse-hubby');
