ube. \n\nThank you to all my beautiful subscribers and YT friends. You are all very dear to my heart. Your support and love is so precious to me. Thank you for being faithful and patient throughout the years! I\'m excited for this new period in my life, and will promise to do my best to make awesome vids.\n\nGod bless you!\n\nLove Jen.\n\nMORE OF ME!\nWebsite/Blog: http://www.meejmuse.com\nYoutube: http://www.youtube.com/meejmuse\nFacebook: http://www.facebook.com/meejmuse\nTwitter: http://www.twitter.com/meejmuse\nInstagram: http://www.instagram.com/meejmuse',494,0,NULL,'2013-08-21 09:36:01',NULL,'life-update-going-full-time-woohoo'),(5069,'Updated Korean Skincare Routine! ♥ & A Brief Room Tour :)','http://www.youtube.com/embed/erZqNMOOpMo',NULL,'http://img.youtube.com/vi/erZqNMOOpMo/0.jpg','30',NULL,'2013-12-16 17:57:52','2013-12-19 18:39:40','erZqNMOOpMo','Read my full blogpost of my routine with pictures & more - http://bit.ly/19B91T2\nExclusive monthly giveaways on my Facebook page! http://www.facebook.com/meejmuse\n\nHey munchkins ^^\n\nHope you have all been well! I worked hard to edit this video so I really hope it is informative and that you enjoy it.\n\nIt\'s strange cos although it\'s Winter in Australia, my skin hasn\'t changed or become dry this season. I\'ve stuck to most products in this routine for a few years now - Hera is one of my staple skincare products, as is SK-II which I added into my routine over the past year or two. In the near future I may add in the SK-II Cellumination Deep Surge EX between the emulsion and moisturiser steps. I\'ve been testing out the sample and have been amazed by it.\n\n\nWhat do YOU guys use in your skincare routines? \n\n\nCheck out my blogpost on this video: http://www.meejmuse.com\n\n\nxo\nLove Jen\n\n\nA few online stores that I\'ve found which stock Hera, Skinfood and/or Nature Republic:\nhttp://www.royalbeautycosmetics.com\nhttp://www.shopatkorea.com\nhttp://www.gmarket.com\nhttp://www.theskinfoodus.com\n\n\n__