ideo till the end are the true makeup lovers! Hahaha :)\n\nWatch Part 1 here: \nMy Makeup Collection and Storage! ♡ http://youtu.be/39GgyVouW6o\n\nRemember, please don\'t get the wrong idea. I\'m not boasting about my makeup. I am a freelance makeup artist on the side, so this is not all for myself :) I also purchase and collect lots of makeup just to try it out for you guys and feature them in my videos. I try to expose you guys to a variety of brands and products and like using different things in my tutorials, which is why I keep a lot of the stuff even though I may not use some of it regularly.\nAlso, in no way do I wish to pressure any of you to have as much as I do, or organise it with such investment. Remember, I am a Youtube beauty guru and MUA, so I actually need all this (and probably more). Just responding to your requests, and sharing myself with you more and more, so you know my closets inside out. Keke\n\nHope you enjoy the video regardless. All for you guys. I love y\'all!\n\nMy questions for YOU ♡\nHow do you store your makeup?\nWhat are your makeup confessions? \nWhat are your favourite makeup products that you have the most of? (blush, lipsticks..)\nLeave them in a comment below!\n\n\nMORE OF ME!\nYoutube: http://www.youtube.com/meejmuse\nFacebook: http://www.facebook.com/meejmuse\nTwitter: http://www.twitter.com/meejmuse\nInstagram: username \"meejmuse\n\nLove Jen.',706,0,NULL,'2012-11-23 13:13:22',NULL,'my-makeup-collection-part-2-face-and-eye-products'),(5086,'My Makeup Storage and Collection! ♡','http://www.youtube.com/embed/39GgyVouW6o',NULL,'http://img.youtube.com/vi/39GgyVouW6o/0.jpg','30',NULL,'2013-12-16 17:57:53','2013-12-19 18:39:41','39GgyVouW6o','Watch Part 2 here: http://youtu.be/cfP1thA1_L8\n\nHello my lovelies ♡\nHope you enjoy the first part of my makeup storage and collection video :) This was highly requested and I love sharing more beauty product related videos with y\'all. Keeping your attention spans in mind, and also thanks to your votes on Facebook, I\'ve separated this video from the other, which shows my makeup in more detail. \n\nRemember, please don\'t get the wrong idea. I\'m not boasting about my makeup. I am a freelance makeup artist on the side, so this is not all for myself :) I also purchase and collect lots of makeup just to try it out for you guys and to make my videos have more creative option. Everywhere I go my eyes are opened to makeup as I think of you guys, and I try to review as many different ones as I can in case I find something great to recommend to you. I also like exposing you guys to a variety of brands and products in my tutorials, which is why I keep a lot of the stuff even though I may not use some of it regularly.\nAlso, in no way do I wish to pressure any of you to have as much as I do, or organise it with such investment. Remember, I am a Youtube beauty guru and MUA, so I actually need all this for my clients - and probably more. Just responding to your requests, and sharing myself with you more and more, so you know my closets inside out. Keke\n\nHope you enjoy the video regardless. All for you guys. I love y\'all!\n\nMy questions for YOU ♡\nWhat are your makeup shopping confessions? \nHow do you store and organise your makeup?\nLeave them in a comment below! \n\nxoxo\n\nMORE OF ME!\nYoutube: http://www.youtube.com/meejmuse\nFacebook: http://www.facebook.com/meejmuse\nTwitter: http://www.twitter.com/meejmuse\nInstagram: username \"meejmuse\n\nLove Jen.',994,0,NULL,'2012-11-23 10:48:56',NULL,'my-makeup-storage-and-collection'),(5087,'Hubby Cooking Vlog ♥ Never Again...Again!','http://www.youtube.com/embed/86Obp-pEjgw',NULL,'http://img.youtube.com/vi/86Obp-pEjgw/0.jpg','30',NULL,'2013-12-16 17:57:53','2013-12-19 18:39:41','86Obp-pEjgw','Just for fun :) Watch my talented hubby try to cook something nice for me, as promised in our hubby tag video we filmed ages ago. This video is also overdue because of technical glitches to the footage, but I managed to ge