ARENA HOMME+ KOREA DECEMBER 2011 _ EYEBROW MAN 1','http://www.youtube.com/embed/JgmTFtajhoQ',NULL,'http://img.youtube.com/vi/JgmTFtajhoQ/0.jpg','34',NULL,'2013-12-16 17:58:18','2013-12-19 18:39:46','JgmTFtajhoQ','EDITOR 최태경\nVIDEOGRAPHY 강인기\nPHOTOGRAPHY 김린용\nHAIR 이에녹\nMAKE-UP 이준성(aM)\nMODEL 노상민\nASSISTANT 이영선',240,0,NULL,'2011-11-15 07:09:08',NULL,'arena-homme-korea-december-2011-_-eyebrow-man-1'),(5229,'대한민국 아나운서들의 아이미 인조속눈썹 사랑 ♡','http://www.youtube.com/embed/C5R3GHHHkgE',NULL,'http://img.youtube.com/vi/C5R3GHHHkgE/0.jpg','35',NULL,'2013-12-16 17:58:22','2013-12-19 18:39:46','C5R3GHHHkgE','EYEME NO.37 \n\n아나운서들에겐 없어서는 안될 제품 아이미.\n아이메이크업에 자신이 없어질때 아이미를 믿어보세요.\n\n10mm의 긴 길이감으로 36호에 진하기를 더하여 또렷함과 동시에\n풍성하고 짙은 속눈썹으로 그윽하고 우아한 눈매를 연출해주는 아이래쉬. \n\n아이미 36호, 37호는 38호, 39호에 비해 길이감을 늘린 것이며\n아이미 37호는 39호 정도의 숱에 길이가 길어져\n숱과 길이감 모두 만족시켜주는 제품입니다.\n길이도 짧고 숱도 부족한 분들이 풍성한 속눈썹을 연출하시기에\n적당한 제품으로 내추럴한 메이크업은 물론 스모키 메이크업에도\n굉장히 잘 어울리며 눈매를 확실히 살려주어\n드라마틱한 속눈썹을 연출하는 효과를 줍니다.\n아이미 37호는 36호, 37호, 38호, 39호 중 길이감도 길고\n숱도 많아 가장 진하지만 속눈썹 연장술보다\n훨씬 자연스러운 느낌을 주고자 할 때\n가장 많이 이용하시는 제품입니다.\n\n일상에서 사용할 수 있는 정도의 길이감으로\n연예인들의 경우 보통 화보나 쇼보다는 자연스럽지만\n좀더 드라마틱한 눈매의 연출이 필요한 일반 방송에서\n많이 사용하는 제품입니다.\n디자인이 완벽에 가깝기 때문에 눈매에 맞춰 가로 길이를 조절해\n간편히 통으로 붙여도 자연스러워 많은 분들이\n선호하시는 제품입니다.',60,0,NULL,'2013-07-18 04:14:20',NULL,'--167'),(5230,'연예인 비밀병기 아이미 속눈썹의 모든 것','http://www.youtube.com/embed/UqwUBwwl8BM',NULL,'http://img.youtube.com/vi/UqwUBwwl8BM/0.jpg','35',NULL,'2013-12-16 17:58:22','2013-12-19 18:39:46','UqwUBwwl8BM','인조속눈썹, 속눈썹 연장 보다 더 자연스럽고 더 편리하고 더 아름답다면?\n셀럽들의 뷰티 시크릿 아이미에 대해 더 자세히 알아보는 시간.',79,0,NULL,'2013-06-27 07:21:05',NULL,'--168'),(5231,'TBS 홍민희 아나운서의 아이미 속눈썹에 관한...','http://www.youtube.com/embed/InsTlDEVkjM',NULL,'http://img.youtube.com/vi/InsTlDEVkjM/0.jpg','35',NULL,'2013-12-16 17:58:22','2013-12-19 18:39:46','InsTlDEVkjM','TBS 홍민희 아나운서가 가장 아끼는 메이크업 필수 아이템 아이미 속눈썹.\n인조속눈썹계의 레전드이자 연예인 대표 속눈썹인 아이미, 그리고 아이미를 사랑하는 대한민국 아나운서의 그것!',88,0,NULL,'2013-06-19 13:17:58',NULL,'tbs'),(5232,'MBC 스포츠플러스 정주희 아나운서가 애정하는 인조속