ttp://img.youtube.com/vi/4SEI97ahzko/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','4SEI97ahzko','724\n\n파운데이션\n\n일제인조모\n\n플랫하고 끝이 일자형태인 파운데이션브러쉬입니다.\n일반적인 파운데이션보다 플랫한 스타일로\n비비크림과 같이 크리미한 제품을 바를 때\n붓자국이 생기지 않도록 도와줍니다.\n브러쉬가 흡수하는 양도 적고 두껍지 않으면서\n균일하게 발리기 때문에\n많은 분들께서 비비크림 전용브러쉬로\n사용하고 계십니다.\n특히, 일자 형태의 브러쉬 모는\n트러블로 인한 피부 요철이 많은 사람들이 사용할 경우\n요철 사이사이를 매끈하고 빠르게 바를 수 있도록 해주며\n트러블피부가 두께감없이 가볍게 커버하는데 적합하여\n트러블이 도드라지지 않는 보다 자연스러운 피부가 완성됩니다.\n최고급 일제인조모로 브러쉬 탄력이 좋아\n밀착감있게 바를 수 있으며 눈가나 코 주변 섬세한 부위도\n쉽게 커버가 가능해 이 제품 하나만으로 베이스가\n완성됩니다.',48,0,NULL,'2011-09-20 08:22:55',NULL,'724-wmv'),(5239,'[피카소브러쉬] 아이섀도우 브러쉬 사용법 (206a, 207a번).wmv','http://www.youtube.com/embed/6lAirovXIu0',NULL,'http://img.youtube.com/vi/6lAirovXIu0/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','6lAirovXIu0','206a,207a\n\n아이-아이섀도우\n청설모모\n\n기본컬러를 블렌딩하기 좋은 아이섀도우브러쉬.\n포인트 컬러를 바르기에도 기본 컬러를 바르기에도 좋기 때문에 활용도가 매우 높은 브러쉬로 초보자들도 손쉽게 사용하기 좋습니다.\n\n-브러쉬면과 끝을 이용하여 쌍꺼풀라인을 감싸듯이 발라주시고, 두개의 브러쉬는 크기의 차이이기 때문에 눈 넓이에따라 선택하시면 됩니다',40,0,NULL,'2011-09-20 08:21:05',NULL,'206a-207a-wmv'),(5240,'[피카소브러쉬] 아이섀도우 브러쉬 사용법 (205a번).wmv','http://www.youtube.com/embed/ilQCUEY8LP8',NULL,'http://img.youtube.com/vi/ilQCUEY8LP8/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','ilQCUEY8LP8','205a\n\n아이-아이섀도우\n\n산양모\n\n퓨어한 아이메이크업에 사용하기 좋은 아이섀도우 브러쉬.\n전체적으로 컬러감을 주기 좋으며 뾰족하고 납작한 모 끝을 이용하여 쌍꺼풀\n안쪽이나 언더라인에 섬세하게 표현도 가능합니다.\n포인트 컬러를 줄 수도 있고 각도를 조절하게 컬러를 그라데이션 할 수있기\n때문에 손쉽게 활용가능합니다.\n\n-눕혀서 눈두덩이 전체컬러를 주거나 모 끝을 이용하여 각도를 조절하여 사용하면 쌍꺼풀라인이나 언더부분에도 손쉽게 컬러를 입힐 수 있습니다',45,0,NULL,'2011-09-20 08:18:33',NULL,'205a-wmv'),(5241,'[피카소브러쉬] 파우더 브러쉬 사용법 (103pb번).wmv','http://www.youtube.com/embed/8LZRV-gvyGk',NULL,'http://img.youtube.com/vi/8LZRV-gvyGk/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','8LZRV-gvyGk','103pb\n\n페이스-파우더브러쉬\n\n산양모\n\n입자를 완벽하게 잡아주기 때문에 매끈한 피부표현이 가능한 팩트파우더브러쉬.\n지성피부를 가진분들이나, 유분을 완벽하게 잡아주기 위함으로 파우더를 사용하시는 분들에게 매우 유용한 브러쉬로, 파우더의 입자를 완벽하게 잡아 밀착시켜 주기 때문에 지속력을 뛰어나게 합니다.\n\n-피부결을 따라 쓸어주거나 두들겨서 사용하면 피부가 매끈하게 표현됩니다.',43,0,NULL,'2011-09-20 08:16:22',NULL,'103pb-wmv'),(5242,'메종 피카소 도산 파크 - 피카소 메이크업 스쿨','http://www.youtube.com/embed/v26ynqiWRns',NULL,'http://img.youtube.com/vi/v26ynqiWRns/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','v26ynqiWRns','아이폰을 이용하여 촬영한 메종 피카소 도산파크입니다. ^^',144,0,NULL,'2011-09-19 04:40:28',NULL,'--169'),(5243,'[피카소브러쉬] 컨실러, 크림 섀도우 브러쉬 사용법 (proof06, 07, 08, 09. 12, 13 ,14번).wmv','http://www.youtube.com/embed/1rw3wq_zQMg',NULL,'http://img.youtube.com/vi/1rw3wq_zQMg/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','1rw3wq_zQMg','proof06, 07, 08, 09. 12, 13 ,14\n\n페이스 - 컨실러\n아이 - 크림 섀도우\n\n일제인조모\n\n완벽한 커버를 위한 컨실러브러쉬\n높은 탄력감과 다양한 사이즈의 PROOF라인은\n완벽한 커버력과 함께 오랜 지속력을 자랑합니다\n사이즈에 따라 홍조부터 아주 작은 잡티까지\n완벽커버가 가능하여, 드라마틱한 피부표현이 가능합니다\n\n-기미, 주근깨와 같이 넓거나 뭉쳐있는 잡티의 경우\n큰사이즈브러쉬를 이용하여 누르듯이 두들겨서 커버하여 주시고\n작은 잡티를 커버할 때는 작고 가는 브러쉬를 이용하여\n제품을 얹듯이 커버해주시면 완벽한 피부연출이 가능합니다',94,0,NULL,'2011-09-07 10:01:55',NULL,'proof06-07-08-09-12-13-14-wmv'),(5244,'[피카소브러쉬] 하이라이터 브러쉬 사용법 (pony 14번).wmv','http://www.youtube.com/embed/uUAJ8lINjv8',NULL,'http://img.youtube.com/vi/uUAJ8lINjv8/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','uUAJ8lINjv8','pony14\n\n치크-블러셔\n\n청설모모\n\n섬세한 터치를 요할 때 적합한 블러셔/하이라이터브러쉬.\n작은크기, 좁은 끝부분을 으로 블러셔와 하이라이터를\n섬세하고 디테일하게 표현을 해 줄수 있는 브러쉬로,\n생기있는 표현을 요할 때 사용하기 좋습니다.\n\n-브러쉬 모의 면을 이용하여 티존과 눈밑, 관자놀이를 연결하듯이\n쓸어주시면 화사하게 표현됩니다',33,0,NULL,'2011-09-07 10:00:46',NULL,'pony-14-wmv'),(5245,'[피카소브러쉬] 팬브러쉬 사용법 (pa16번).wmv','http://www.youtube.com/embed/LMLCf0j1tGk',NULL,'http://img.youtube.com/vi/LMLCf0j1tGk/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','LMLCf0j1tGk','PA-16\n\n페이스-팬\n\n산양모\n\n크고 넓으며 두툼한 형태의 팬브러쉬입니다\n시중의 팬브러쉬중 가장 큰 사이즈로\n단 몇번의 터치만으로 여분의 입자를 털어낼수 있다는게 특징이죠\n모끝으로 갈수록 굉장히 부드러워 피부에 닿는 느낌이 좋고\n자극없이 가볍게 쓸어주는데 부족함이 없는 제품입니다\n아티스트들은 특히 바디메이크업 용으로 많이 사용하는데요\n노출의 계절에는 일반인들의 구매도 많습니다\n펄파우더나 브론징 제품을 이용해 바디를 메이크업해보세요\n큼직한 브러쉬가 바디를 손쉽게 연출할수 있도록 도와줍니다\n탄력이 뛰어남은 물론\n오래 사용해도 부채모양이 변함없이 지속됩니다',33,0,NULL,'2011-09-07 09:59:27',NULL,'pa16-wmv'),(5246,'[피카소브러쉬] 파운데이션 브러쉬 사용법 (fb16번).wmv','http://www.youtube.com/embed/az1WNZ7vESI',NULL,'http://img.youtube.com/vi/az1WNZ7vESI/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','az1WNZ7vESI','fb16\n\n페이스-파운데이션\n치크-블러셔\n\n일제인조모\n\n넓고 납작한 모를 이용하여 얇고\n매끈한 피부표현이 가능한 파운데이션 브러쉬.\n크림타입의 블러셔나 섀이딩제품을 붓자국이나 경계선없이\n다양한 컬러를 표현할 수 있습니다.\n얇고 촉촉한 피부표현을 즐기시는 분들에게\n아주 적합한 브러쉬입니다.\n\n얼굴안쪽부터 바깥쪽까지 쓸어 발라주시고 가볍게 두들겨서\n발라주시면 깨끗한 피부표현을 할 수 있습니다.',37,0,NULL,'2011-09-07 09:57:17',NULL,'fb16-wmv'),(5247,'[피카소브러쉬] 파운데이션 브러쉬 사용법 (fb15번).wmv','http://www.youtube.com/embed/R0FgL3I5pIU',NULL,'http://img.youtube.com/vi/R0FgL3I5pIU/0.jpg','35',NULL,'2013-12-16 17:58:23','2013-12-19 18:39:47','R0FgL3I5pIU','fb15\n\n페이스-파운데이션\n\n일제인조모\n\n피부결을 잡아주기 때문에\n내추럴한 피부표현이 가능한 파운데이션 브러쉬.\n보다 더 촉촉하고 답답함 없이 가벼운 피부연출이 가능하고\n피부에 닿는 면적이 크기 때문에\n붓자국 없이 바를 수 있습니다.\n\n-손에 힘을 뺀 상태에서 쓸어주듯이 고르게 펴 발라주시고\n가볍게 두들겨 주시면 촉촉하면서\n매끈한 피부를 연출할 수 있습니다',58,0,NULL,'2011-09-07 09:54:06',NULL,'fb15-wmv'),(5248,'[피카소브러쉬] 헤어라인, 두피커버 브러쉬 사용법 (725번).wmv','http://www.youtube.com/embed/E4PrjWPbMjQ',NULL,'http://img.youtube.com/vi/E4PrjWPbMjQ/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:47','E4PrjWPbMjQ','725\n\n페이스-헤어라인\n\n너구리모\n\n둥글고 예쁜이마를 만들어 주는 헤어라인브러쉬.\n부드럽지만 짧게 커팅해놓은 단단한 모라\n색감을 뭉침없이 완벽하게 발색시켜 주고\n문지르듯이 터치를 해야하는 헤어라인 연출에 탁월합니다\n\n-모 끝에 제품을 묻혀 쓸어주거나\n두들겨서 터치하여 주시면 완벽한 헤어라인이 완성됩니다',37,0,NULL,'2011-09-07 09:52:18',NULL,'725-wmv'),(5249,'[피카소브러쉬] 팬브러쉬 사용법 (723번).wmv','http://www.youtube.com/embed/iYMNaQqlsTg',NULL,'http://img.youtube.com/vi/iYMNaQqlsTg/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:47','iYMNaQqlsTg','723\n\n페이스-팬브러쉬\n\n일제인조모\n\n깨끗한 눈밑을 위한 팬브러쉬.\n부드러운 일제인조모라 눈밑에 떨어진 제품을 번짐 없이\n깨끗하게 털어 낼 수 있습니다\n\n-브러쉬 모 끝을 이용하여 날리듯이\n털어내 주시면 뭉치거나 번짐없이\n깨끗한 눈밑을 표현할 수 있습니다',30,0,NULL,'2011-09-07 09:51:20',NULL,'723-wmv'),(5250,'[피카소브러쉬] 아이라이너 브러쉬 사용법 (722번).wmv','http://www.youtube.com/embed/RA7niqgEvS4',NULL,'http://img.youtube.com/vi/RA7niqgEvS4/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:47','RA7niqgEvS4','722\n\n아이-아이라이너\n\n일제인조모\n\n자극없이 원하는 아이라인을 완성할 수 있는 아이라이너 브러쉬.\n브러쉬 각도나 방향을 달리하면 다양한 아이라인을 그릴 수 있어\n전문가들 뿐만 아니라 초보자가 사용하기에도\n매우 유용한 브러쉬입니다\n\n-아이라인그린 부분 위에 지긋이 눌러서 색감을 덧입혀주면\n컬러가 자연스럽게 입혀집니다',34,0,NULL,'2011-09-07 09:49:52',NULL,'722-wmv'),(5251,'[피카소브러쉬] 쉐이딩 브러쉬 사용법 (721번).wmv','http://www.youtube.com/embed/B8QEGW-rqEc',NULL,'http://img.youtube.com/vi/B8QEGW-rqEc/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:47','B8QEGW-rqEc','721\n\n페이스-쉐이딩\n\n다람쥐모\n\n날렵한 얼굴선을 위한 쉐이딩브러쉬.\n사선날을 이용하여 옆선을 가볍게 터치만 해주어도\n날렵한 V라인을 완성할 수 있기 때문에\n얼굴형이 고민이신 분들에게 매우 유용한 브러쉬입니다\n\n-사선날을 이용해 옆선을 쓸어주면 입체적인 윤곽이 됩니다',41,0,NULL,'2011-09-07 09:48:18',NULL,'721-wmv'),(5252,'[피카소브러쉬] 콤브러쉬(comb brush) 사용법 (719번).wmv','http://www.youtube.com/embed/wAkNLszkdSk',NULL,'http://img.youtube.com/vi/wAkNLszkdSk/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:47','wAkNLszkdSk','719\n\n아이-콤브러쉬\n\n오소리모\n\n자연스러운 눈썹정리릉 위한 콤브러쉬.\n정갈하게 눈썹을 정리하기 좋고\n눈썹 결을 관리에 최적화된 브러쉬입니다\n\n-모를 이용하여 눈썹결을 정리하여 주고\n빗부분은 커팅시에 이용하시면\n정갈한 눈썹을 만들 수 있습니다',32,0,NULL,'2011-09-07 09:47:10',NULL,'comb-brush-719-wmv'),(5253,'[피카소브러쉬] 아이라이너 브러쉬 사용법 (717번).wmv','http://www.youtube.com/embed/OtZGl7qiT_s',NULL,'http://img.youtube.com/vi/OtZGl7qiT_s/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','OtZGl7qiT_s','717\n\n아이-아이라이너\n\n일제인조모\n\n정교한 아이라인을 그릴 수 있는 아이라이너브러쉬.\n최대한 부드럽게 꺽이도록 만들어져\n눈꼬리까지 끊김 없이 원터치마무리가 가능하며\n모질이 부드러워 예민한 눈가 사용에도 좋습니다\n\n-모 끝에 제품을 묻혀 속눈썹 사이사이부분과 점막에\n제품을 묻혀주시면 가늘게 라인이 표현되기 때문에\n내추럴한 메이크업시 사용하기 좋습니다',33,0,NULL,'2011-09-07 09:45:46',NULL,'717-wmv'),(5254,'[피카소브러쉬] 아이라이너 브러쉬 사용법 (715번).wmv','http://www.youtube.com/embed/E6pfhNEhFkU',NULL,'http://img.youtube.com/vi/E6pfhNEhFkU/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','E6pfhNEhFkU','715\n\n아이-아이라이너\n\n일제인조모\n\n드라마틱한 눈매연출을 위한 아이라이너브러쉬.\n원통모양의 모는 화보촬영이나 쇼메이크업시\n드라마틱한 눈매연출을 하기에 적합하며\n화려한 눈매를 표현하고자 할 때 유용합니다\n\n-둥근 모끝을 이용하여 점막부분에 색감을 입혀주면\n또렷하면서 깊이감 있는 눈매가 가능합니다',37,0,NULL,'2011-09-07 09:44:14',NULL,'715-wmv'),(5255,'[피카소브러쉬] 립브러쉬 사용법 (714번).wmv','http://www.youtube.com/embed/kQWP3kgBT3U',NULL,'http://img.youtube.com/vi/kQWP3kgBT3U/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','kQWP3kgBT3U','714\n\n립-립\n\n일제인조모\n\n입술선을 살려 그리기 좋은 립브러쉬.\n입꼬리나 입술 안쪽처럼 섬세하게 표현해야 할\n부분까지 쉽고 빠르게 바를 수있습니다\n\n-모 끝을 이용하여 입술선을 잡아서 그려준 후\n면을 이용하여 컬러감을 바르면\n정교한 립 연출이 가능합니다',30,0,NULL,'2011-09-07 09:43:15',NULL,'714-wmv'),(5256,'[피카소브러쉬] 컨실러 브러쉬 사용법 (713번).wmv','http://www.youtube.com/embed/DloQDXfpTMw',NULL,'http://img.youtube.com/vi/DloQDXfpTMw/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','DloQDXfpTMw','713\n\n페이스-컨실러\n\n일제인조모\n\n다양한 흔적을 손쉽게 커버하기 좋은 컨실러브러쉬.\n탄력감이 뛰어나고 끝이 가늘어지는 타입이라\n들뜸없이 밀착력있게 아주 작은 잡티까지\n자연스럽게 커버하기 좋습니다\n\n-얼룩진컬러 사이를 연결하듯이 쓸어 주시면\n피부색상이 고르게 표현됩니다',26,0,NULL,'2011-09-07 09:42:19',NULL,'713-wmv'),(5257,'[피카소브러쉬] 컨실러 브러쉬 사용법 (712번).wmv','http://www.youtube.com/embed/EWp_oOcUcU0',NULL,'http://img.youtube.com/vi/EWp_oOcUcU0/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','EWp_oOcUcU0','712\n\n페이스-컨실러\n\n일제인조모\n\n작은잡티를 쉽고 빠르게 커버할 수 있는 컨실러 브러쉬.\n납작한 형태로 탄력감이 좋기 때문에\n들뜸없이 밀착력있게 커버가 가능합니다\n\n-모 끝을 이용하여 찍어서 커버해주고\n가볍게 쓸어주면 들뜸없이 커버가 가능합니다',35,0,NULL,'2011-09-07 09:40:30',NULL,'712-wmv'),(5258,'[피카소브러쉬] 아이포인트 브러쉬 사용법 (711번).wmv','http://www.youtube.com/embed/NTywx3Iy3dA',NULL,'http://img.youtube.com/vi/NTywx3Iy3dA/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','NTywx3Iy3dA','711\n\n아이-아이포인트\n\n콜린스키모\n\n정교하고 섬세한 터치를 위한 아이포인트브러쉬. \n가는 모 끝을 이용하여 흔들림 없는\n정교한 아이라인을 연출할 수 있으며\n컬러가 섬세하게 표현됩니다\n\n-모 끝을 이용하여 아이라인위에 덧발라주거나\n언더속눈썹 사이를 메워주시면\n자연스러우면서도 입체감있는 눈매표현이 됩니다',31,0,NULL,'2011-09-07 09:38:46',NULL,'711-wmv'),(5259,'[피카소브러쉬] 아이라이너 브러쉬 사용법 (710, 716번).wmv','http://www.youtube.com/embed/BoZi0cQuUQI',NULL,'http://img.youtube.com/vi/BoZi0cQuUQI/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','BoZi0cQuUQI','710, 716\n\n아이-아이라이너\n\n일제인조모\n\n\n드라마틱한 눈매연출을 위한 아이라이너 브러쉬.\n원통모양의 모는 화보촬영이나 쇼메이크업시\n드라마틱한 눈매연출을 하기에 적합하며\n화려한 눈매를 표현하고자 할 때 원활합니다\n\n-세우거나 눕혀서 굵기 조절을 하여 사용이 가능하기 때문에\n홑꺼풀 눈매에 적합합니다.',38,0,NULL,'2011-09-07 09:37:00',NULL,'710-716-wmv'),(5260,'[피카소브러쉬] 아이포인트 브러쉬 사용법 (709번).wmv','http://www.youtube.com/embed/NdZFHkHjp7s',NULL,'http://img.youtube.com/vi/NdZFHkHjp7s/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','NdZFHkHjp7s','709\n\n아이-아이섀도우\n\n콜린스키모\n\n색감을 완벽하고, 섬세하게 터치하기 위한 아이포인트 브러쉬.\n탄력있고 힘이 좋은 모는 흔들림없는\n정교한 아이라인을 그릴 때나\n색감을 날렵하게 표현해줄 때에도 유용합니다\n\n-제품을 묻혀 가볍게 누르듯이 아이라인을 그린 윗부분 또는\n포인트를 줄 곳에 터치하여 주거나 눈 앞쪽에 지긋이 눌러\n화사하게 표현이 가능합니다',47,0,NULL,'2011-09-07 09:34:40',NULL,'709-wmv'),(5261,'[피카소브러쉬] 아이섀도우 브러쉬 사용법 (708번).wmv','http://www.youtube.com/embed/PBZjR4JMwUg',NULL,'http://img.youtube.com/vi/PBZjR4JMwUg/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','PBZjR4JMwUg','708\n\n아이-아이섀도우\n\n청설모모\n\n내추럴한 메이크업을 위한 아이섀도우브러쉬.\n눈두덩이에 컬러감을 자연스럽게 입혀주기 때문에\n원컬러로 그라데이션하여 섀도우를 바르는 분들에게\n유용한 브러쉬입니다\n\n-눈두덩이에 컬러감을 입힌 후 모 끝을 이용하여\n눈 끝부분부터 홀을 잡듯이 포인트를 넣어주시면\n깊이감 있는 눈매연출이 가능합니다',36,0,NULL,'2011-09-07 09:33:13',NULL,'708-wmv'),(5262,'[피카소브러쉬] 아이섀도우 브러쉬 사용법 (707번).wmv','http://www.youtube.com/embed/0rsHPuIGq1U',NULL,'http://img.youtube.com/vi/0rsHPuIGq1U/0.jpg','35',NULL,'2013-12-16 17:58:24','2013-12-19 18:39:48','0rsHPuIGq1U','707\n\n아이-아이섀도우\n\n청설모모\n\n눈주위를 환하게 표현해줄 아이베이스브러쉬.\n브러쉬 부드럽고 폭이 넓기 때문에 한번의 터치만으로도\n만족스러운 발색을 얻을 수 있기 때문에\n섀도우를 원컬러로 표현하는 내추럴메이크업에\n사용하기 좋습니다.\n\n-브러쉬 면을 이용하여 양 옆으로 왔다갔다 쓸어주듯이\n컬러감을 입혀주시면 쉽고 빠르게 색감이 표현됩니다',35,0,NULL,'2011-09-07 09:31:53',NULL,'707-wmv'),(5263,'[피카소브러쉬] 아이섀도우 브러쉬 사용법 (704, 705, 706번).wmv','http://www.youtube.com/embed/XC2by_mgPR0',NULL,'http://img.youtube.com/vi/XC2by_mgPR0/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','XC2by_mgPR0','704, 705, 706\n\n아이-아이섀도우\n\n콜린스키모\n\n완벽한 아이섀도우 컬러감을 주기위한 아이섀도우 브러쉬.\n콜린스키모의 높은 탄력감은 어떠한 색상도\n본연 그대로의 색상으로 표현해주는 것이 장점입니다\n가루날림없이 완벽한 색감과 펄 제품을 깨끗하게 펴 바를 수 있습니다\n\n-전체적으로 색감을 펴 바를 때에는 가볍게 쓸어주고,\n브러쉬 끝을 둥글리듯이 터치하여 주면\n자연스럽게 컬러가 블렌딩되기 때문에\n내추럴, 스모키메이크업 등 다양한 아이메이크업이 손쉽게 완성됩니다',47,0,NULL,'2011-09-07 09:29:45',NULL,'704-705-706-wmv'),(5264,'[피카소브러쉬] 하이라이터 브러쉬 사용법 (703번).wmv','http://www.youtube.com/embed/HzdXOL4v5mI',NULL,'http://img.youtube.com/vi/HzdXOL4v5mI/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','HzdXOL4v5mI','703\n\n페이스-하이라이터\n\n다람쥐모\n\n눈밑을 환하게 밝혀줄 하이라이터브러쉬.\n모의 힘이 있어 입자를 잘 잡아주기 때문에\n펄입자를 날립없이 잘 잡아주고, 피부에 닿는 느낌이 매우 좋습니다\n\n-브러쉬모의 모양을 이용하여 위에서 아래로 쓸어주듯이\n펴 발라주시면 화사하게 연출됩니다',38,0,NULL,'2011-09-07 09:28:05',NULL,'703-wmv'),(5265,'[피카소브러쉬] 파우더, 블러셔 브러쉬 사용법 (702번).wmv','http://www.youtube.com/embed/hZZd_nPqrS0',NULL,'http://img.youtube.com/vi/hZZd_nPqrS0/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','hZZd_nPqrS0','702\n\n치크-블러셔\n\n청설모모\n\n내추럴한 메이크업을 즐겨하시는 분들을 위한 블러셔브러쉬.\n굉장히 자연스럽게 발리고 발색이 자연스러워\n브러쉬가 서툰 초보자들이 사용하기에도 부담스럽지 않은 제품입니다\n\n-파우더를 바를 때는 납작한 모를 이용하여 쓸어주시고\n블러셔를 바를 때에는 모 끝을 이용하여 둥글리듯이 바르면\n자연스러운 색감을 연출할 수 있습니다',37,0,NULL,'2011-09-07 09:26:33',NULL,'702-wmv'),(5266,'[피카소브러쉬] 쉐이딩 브러쉬 사용법 (701번).wmv','http://www.youtube.com/embed/1mi2cFmBBqE',NULL,'http://img.youtube.com/vi/1mi2cFmBBqE/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','1mi2cFmBBqE','701\n\n페이스-쉐이딩\n\n산양모\n\n입체감 있는 페이스라인을 위한 쉐이딩브러쉬.\n턱선과 헤어라인, 얼굴선을 따라 둥글리듯이 굴려만 주셔도\n날렵해 보이게끔 정리가 가능하기 때문에\n처음 쉐이딩을 하시는 분들도 손쉽게 하실 수 있습니다\n\n-헤어라인과 페이스라인을 따라 굴리듯이 가볍게 쓸어주시면\n날렵해보이는 얼굴선이 완성됩니다',45,0,NULL,'2011-09-07 09:24:21',NULL,'701-wmv'),(5267,'[피카소브러쉬] 립브러쉬 사용법 (506번).wmv','http://www.youtube.com/embed/jwyymUxe5jI',NULL,'http://img.youtube.com/vi/jwyymUxe5jI/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','jwyymUxe5jI','506\n\n립-립\n\n콜린스키모\n\n또렷한 입술라인을 잡아주기 위한 립브러쉬.\n네모난모를 이용하여 발라주시면 립라이너를\n따로 사용하지 않아도 또렷한 입술라인을 표현할 수 있습니다\n\n-입술선을 따라 컬러를 입혀주시면\n짙은 컬러까지 번짐없이 연출이 가능합니다',32,0,NULL,'2011-09-07 09:22:43',NULL,'506-wmv'),(5268,'[피카소브러쉬] 립브러쉬 사용법 (501, 505번).wmv','http://www.youtube.com/embed/pDokXZ-vDVA',NULL,'http://img.youtube.com/vi/pDokXZ-vDVA/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','pDokXZ-vDVA','501, 505\n\n립-립\n\n일제인조모\n\n립스틱의 컬러감을 완벽하게 발색해 줄 립브러쉬.\n적당한 탄력감과 폭에 끝이 갈수록 뾰족해지기 때문에\n고르게 펴 발라지면서도 섬세한 부분까지 쉽게 컬러를 입힐 수 있어\n부드러운 립 제품부터 매트한 제품까지 다양하게 사용이 가능합니다\n\n-브러쉬 면을 이용하여 전체컬러를 발라주고\n모 끝으로 입술선을 잡아주기 수월하기 때문에\n립스틱부터 립글로즈까지 다양한 텍스처의 제품을\n완벽하게 발색해줍니다',53,0,NULL,'2011-09-07 08:41:07',NULL,'501-505-wmv'),(5269,'[피카소브러쉬] 컨실러 브러쉬 사용법 (407번).wmv','http://www.youtube.com/embed/HSEBd8MbhXo',NULL,'http://img.youtube.com/vi/HSEBd8MbhXo/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','HSEBd8MbhXo','407\n\n페이스-컨실러\n\n일제인조모\n\n섬세한 부위 터치를 위한 제작된 컨실러브러쉬.\n피부자극이 없으면서 끝이 뾰족한 타입이라\n아이 포인트부터 컨실러까지 전천후 아이템입니다\n\n-제품을 얹듯이 가볍게 찍어 주시면\n완벽한 피부표현이 가능합니다',42,0,NULL,'2011-09-07 08:39:57',NULL,'407-wmv'),(5270,'[피카소브러쉬] 아이포인트 브러쉬 사용법 (406번).wmv','http://www.youtube.com/embed/j0dXOWKJdjo',NULL,'http://img.youtube.com/vi/j0dXOWKJdjo/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','j0dXOWKJdjo','406\n\n아이-아이포인트\n\n일제인조모\n\n섬세한 컬러터치에 유용한 아이포인트브러쉬.\n매우 작은 크기이지만 섀도우의 입자를 매우 잘 잡아주기 때문에\n섬세한 부위에 컬러를 표현해 주거나 덧발라줄 때 유용합니다\n\n-아이라인위에 짙은 컬러를 덧 발라주시면\n인위적이기 않으면서도 또렷한 눈매연출이 가능합니다',33,0,NULL,'2011-09-07 08:39:02',NULL,'406-wmv'),(5271,'[피카소브러쉬] 팁브러쉬 사용법 (403, 720번).wmv','http://www.youtube.com/embed/PA3cqkWi_NQ',NULL,'http://img.youtube.com/vi/PA3cqkWi_NQ/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','PA3cqkWi_NQ','403\n\n아이-팁\n\n루비셀팁\n\n발색이 아주 적은 제품, 펄 입자를 잡아주기 좋은 팁브러쉬.\n입자를 잘 잡아주기 때문에 발색이 떨어지는 제품에\n사용하시기에 좋습니다\n\n-컬러를 입힐 때에는 가볍게 쓸어주시고,\n펄과 같이 입자가 두꺼운 제품을 사용시에는\n두들겨 주시면 원하시는 눈매표현이 가능합니다',33,0,NULL,'2011-09-07 08:38:10',NULL,'403-720-wmv'),(5272,'[피카소브러쉬] 스크류 브러쉬 사용법 (402번).wmv','http://www.youtube.com/embed/vYmKAqLt5zo',NULL,'http://img.youtube.com/vi/vYmKAqLt5zo/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','vYmKAqLt5zo','402\n\n아이-스크류\n\nPBT\n\n좀 더 자연스러운 눈썹표현을 위한 스크류브러쉬.\n눈썹정리시, 눈썹색감 조절, 마스카라 양조절 등\n다양하게 활용이 가능합니다.\n\n-옆으로 쓸어주시면 눈썹색감조절, 눈썹결 정리가 가능하며\n마스카라 후 속눈썹을 빗어주시면 뭉침없이 연출이 가능합니다',50,0,NULL,'2011-09-07 08:36:48',NULL,'402-wmv'),(5273,'[피카소브러쉬] 아이라이너 브러쉬 사용법 (401, 401a번).wmv','http://www.youtube.com/embed/DZfEs2JyJLw',NULL,'http://img.youtube.com/vi/DZfEs2JyJLw/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:48','DZfEs2JyJLw','401, 401a\n\n아이-아이라이너\n\n일제인조모, 족제비모\n\n섬세한 터치를 위한 아이라이너/컨실러브러쉬.\n아이라인으로 사용시에는 눈앞쪽이나 꼬리부분을\n아주 섬세하게 표현할 때 유용하며,\n컨실러로 사용시에는 매우 작은 잡티, 점 커버에\n좋습니다\n\n-모 끝을 세워 찍듯이 컨실러 제품을 얹어주시면\n점과 같이 아주 작은 잡티까지 완벽하게 커버가 가능합니다',39,0,NULL,'2011-09-07 08:35:43',NULL,'401-401a-wmv'),(5274,'[피카소브러쉬] 다크써클 컨실러 브러쉬 사용법 (310번).wmv','http://www.youtube.com/embed/fKjho3z55Nk',NULL,'http://img.youtube.com/vi/fKjho3z55Nk/0.jpg','35',NULL,'2013-12-16 17:58:25','2013-12-19 18:39:49','fKjho3z55Nk','310\n\n페이스-컨실러\n\n현대인들의 고민 다크서클커버에 최적화된 컨실러 브러쉬.\n다크서클을 위하여 새로이 제작된 다크서클 전용 브러쉬로\n플랫하면서 탄력이 있어 제품을 뭉침없이 고르게 펴 발라주기에\n매우 좋습니다.\n\n-부드러운 모끝을 이용하여 가볍게 쓸어주시면\n다크서클을 뭉침없이 가볍게 커버가 가능합니다',35,0,NULL,'2011-09-07 08:35:02',NULL,'310-wmv'),(5275,'ARTDECO 2012 Holiday Glamour Collection GLAM DELUXE','http://www.youtube.com/embed/lc_4obzjGpc',NULL,'http://img.youtube.com/vi/lc_4obzjGpc/0.jpg','36',NULL,'2013-12-16 17:58:27','2013-12-19 18:39:49','lc_4obzjGpc','2012 Holiday Glamour Collection GLAM DELUXE\n\n특별한 파티 드레스를 입지 않아도 세련되고 우아한 럭셔리 글램 메이크업!\n고급스러운 윤기가 흐르는 글로우 페이스,\n화려한 반짝임이 돋보이는 섹시 브릴리언트 아이즈,\n풍부한 볼륨감으로 빛나는 울트라 샤인 립스.\n\n부드러운 광채와 윤기를 드러내는 새틴 슬림 드레스를 닮은\n아르데코 홀리데이 콜렉션 \'글램 디럭스\'로 \n따뜻한 불빛을 품고 있는 크리스마스 조명과 감미로운 향기의 와인 잔을 오고 가는\n홀리데이 파티의 멋진 주인공이 되어 보세요!',105,0,NULL,'2012-11-02 09:29:47',NULL,'artdeco-2012-holiday-glamour-collection-glam-deluxe'),(5276,'2012 Summer 트렌드 블루 컬러라인 메이크업 따라잡기!','http://www.youtube.com/embed/Q8kwrcJTIKk',NULL,'http://img.youtube.com/vi/Q8kwrcJTIKk/0.jpg','36',NULL,'2013-12-16 17:58:27','2013-12-19 18:39:49','Q8kwrcJTIKk',NULL,126,0,NULL,'2012-09-07 11:42:08',NULL,'2012-summer'),(5277,'2012 S/S 컬렉션 뷰티클래스 메이크업 강의 영상','http://www.youtube.com/embed/piql1XaifHM',NULL,'http://img.youtube.com/vi/piql1XaifHM/0.jpg','36',NULL,'2013-12-16 17:58:27','2013-12-19 18:39:49','piql1XaifHM',NULL,308,0,NULL,'2012-09-07 10:40:08',NULL,'2012-