mmel Lasting Finish by Kate 113\n-Loreal Extraordinaire by color riche 303 rouge allegro \n\nWHAT I\'M WEARING\n\n-Sequin Perfume Sweater from Chicwish\n-Bracelet from Romwe\n-Headband from wet seal\n\n♥CONNECT WITH ME!\n\n♥twitter : https://twitter.com/sunnydahye\nINSTAGRAM: http://instagram.com/sunnydahye\n♥facebook: http://www.facebook.com/pages/Sunnydahye\n\nBUSINESS INQUIRIES ONLY: \n\ndahyesunny@gmail.com\n\nSong : Karaokekpop Gain Bloom instrumental',518,0,NULL,'2013-12-17 06:27:15',1,'korean-romantic-first-date-rose-gold-make-up'),(5300,'연말 파티 메이크업 : 틴트로 립 메이크업 하세요 with 토니모리','http://www.youtube.com/embed/c1uHZOuzbOE',NULL,'http://img.youtube.com/vi/c1uHZOuzbOE/0.jpg','2',NULL,'2013-12-22 08:45:19','2013-12-22 08:45:19','c1uHZOuzbOE','연말 파티 메이크업\ntip : 틴트로 립 메이크업 하면, 샴페인 마셔도 입술색이 그대로 유지되요!\n\n파티 메이크업에서 가장 중요한 건 지속력이 아닐까 싶어요. 눈가가 팬더눈이 되지 않도록 워터프루프 제품으로 아이메이크업 하는건 당연한거고, 이왕이면 스머지프루프 제품을 사용하는 것도 도움이 되겠죠. 오랜 시간 파티를 즐겨도 처음 느낌 그대로~ 깔끔하게 메이크업을 유지하는게 가장 중요하더라고요. (제 경험상) 그래서 립 메이크업에 빠뜨리지 않고 사용하는 아이템이 바로 \'틴트\'에요. 이번에 토니모리 토니 틴트 2호 레드 컬러를 만나게 되었는데, 요것도 역시 지속력과 발색력이 최강! 그래서 파티 메이크업에 꼭꼭 사용해주고 있답니다. 오늘밤도 파티가 있어서 나가요. 오늘도 제 입술만큼은 처음부터 끝까지 생생한 레드 컬러로 남아있을 예정입니다. ㅎㅎㅎㅎㅎ 그럼 제품들에 대한 자세한 정보는 블로그에서 확인해주세요.\n\nBlog - http://rudelulu.blog.me\n____________________________\n\n* 사용제품',585,0,NULL,'2013-12-20 05:55:54',NULL,NULL),(5301,'Ask Mish','http://www.youtube.com/embed/VGZGUE1F4tc',NULL,'http://img.youtube.com/vi/VGZGUE1F4tc/0.jpg','5',NULL,'2013-12-22 08:45:29','2013-12-22 08:45:29','VGZGUE1F4tc','Hullo cuties! Hope you all are staying warm & cozy! A few weeks ago, I asked you guys to send me your questions. My friend randomly selected a bunch and asked me on camera while filming my response :) I didn\'t want to be prepped or know the questions in advance. \n\nIf you have any questions or if you\'re seeking advice, send them my way via twitter or instagram and #AskMish so I can answer them in my next Ask Mish video! ILY ♥  Happy Holidays!\n\nMy own makeup line! http://www.emcos