tics Brow Set Gel\n10. Maybelline Master Smoky, Scorching Brown\n11. Majolica Majorca Lash Expander Edge Meister\n12. YSL Liptint, 09\n13. Laneige Lipstick, Pink Garden',466,0,NULL,'2013-12-30 01:47:39',NULL,NULL),(5340,'크리스마스 이브, 발칙한루루가 했던 아이메이크업','http://www.youtube.com/embed/sYGJtx7Sufo',NULL,'http://img.youtube.com/vi/sYGJtx7Sufo/0.jpg','2',8,'2013-12-31 05:38:47','2014-01-02 06:38:21','sYGJtx7Sufo','2013.12.24\n발칙한루루가 했던 아이메이크업 \n\n사실 파티 메이크업 영상을 찍었는데요. 크리스마스 이브를 위한 메이크업이어서 지금 업로드하기엔 너무 뒤늦은 감이 있는 것 같아서 아이메이크업 부분만 따로 보여드려요. ㅎㅎㅎ 다른 날보다 꼼꼼하게 아이메이크업을 했거든요. (베이스메이크업도 완전 꼼꼼하게 했었는데~ ㅠㅡㅠ) \n\n다른날보다 꼼꼼하게 메이크업을 한 이유?\n크리스마스 이브니까! \n\n그래서 눈썹 그리는 것도 꼼꼼하게 해주고, 아이라이너도 젤 아이라이너와 리퀴드 아이라이너 두 가지를 사용해서 좀 더 깊고 진한 눈매를 만들어주려고 노력했고요. 평소에는 깔끔하게 한 올 한 올 속눈썹을 올리는 메이크업을 주로 했다면, 이브에는 볼륨감을 더해줄 볼륨마스카라를 사용해줬어요. 그에 비해 섀도우 컬러는 무난하게 가긴 했지만 ㅎㅎㅎㅎ 저는 마음에 들었어요. 히히히힛\n\n이제 파티의 계절은 끝나고,\n새로운 한 해가 시작되니까. \n\n다음엔 봄맞이 메이크업을 해봐야겠어요. ^^\n뜬금없지만, 제 블로그에도 놀러오세용~~\nhttp://rudelulu.blog.me',834,0,NULL,'2013-12-30 16:24:58',1,'--173'),(5341,'CATRICE - CAMOUFLAGE CREAM : 컨실러를 쓰면 잡티가 가려지는군요!','http://www.youtube.com/embed/aZGt960hUM8',NULL,'http://img.youtube.com/vi/aZGt960hUM8/0.jpg','2',3,'2013-12-31 05:38:48','2014-01-01 11:01:14','aZGt960hUM8','CATRICE CAMOUFLAGE CREAM \n캐트리스 컨실러로 잡티 가리고 깨끗한 피부 만들기 \n\n저는 그냥 잡티 한 두개쯤은 있어도 된다고 생각하고 컨실러를 잘 사용하지 않는 편이었는데요. (물론 게을러서 ㅎㅎㅎㅎ 컨실러로 잡티 가리는데 시간이 걸려서 안쓴 것도 이유 중에 하나지만 ^^;;) 캐트리스 캐머플라지 크림 (컨실러) 를 마음 먹고 사용해보니까 오오오오오오! 뾰루지가 올라와서 붉은 잡티는 물론이고, 까맣게 변해버린 여드름 자국도 컨실러도 쉽게 가릴 수 있더라고요.\n\n샵에서 메이크업 받으러 가면 꼭 컨실러를 사용해주시던데, 뾰족한 브러쉬로 말이죠. 저는 손으로 주로 메이크업 하는 사람이라 마땅한 브러쉬는 없고, 파운데이션 바르던 브러쉬로 사용해줬는데요. 그냥 손으로 바르는게 더 나은 것 같아요. 손으로 콕 찍어서 잡티 위에 바르고, 경계가 생기지 않도록 가볍게 살살 펴바르기!\n\n암튼 저는 연말에 파티가 많아서 메이크업 꼼꼼히 신경써서 하느냐고 아주 잘 사용하고 있는 컨실러에요. 잡티 없이 깨끗해보이는 피부를 만들고 싶다면, 컨실러는 필수였어요. (뒤늦은 깨달음 ㅋㅋㅋㅋ) 여러분도 잡티가 고민이라면 파운데이션에 의존하지 말고 좋은 컨실러 하나를 들여놓아보세요. :D\n\n캐트리스 캐머플라지 크림의 자세한 리뷰는 발칙한루루의 블로그 http://rudelulu.blog.me 에서 곧 확인하실 수 있답니다. 놀러오세요~ 뿅!',182,0,NULL,'2013-12-30 13:05:00',1,'catrice-camouflage-cream'),(5342,'Celebrity Style#8: 미래의 선택 윤은혜 헤어 - How to Get Yoon Eunhye\'s \"Mirae\'s Choice\" Hairdo (without iron!)','http://www.youtube.com/embed/4oN04TN2F8g',NULL,'http://img.youtube.com/vi/4oN04TN2F8g/0.jpg','23',9,'2013-12-31 05:40:00','2014-01-02 04:38:38','4oN04TN2F8g','눈 코 뜰 새 없이 바쁜 라이프스타일을 반영하는 듯한, 부스스하면서도 귀엽고 실용적인 \"미래의 선택\" 헤어스타일! 대충 묶은 듯하지만 손이 많이 가는 이 헤어스타일을 고대기로 시도하다가 아픈 손목과 너무나 많이 걸리는 시간에 낙담하셨을 분들께, 정샘물 아티스트 그룹의 승열T의 깨알팁! 무거운 고대기 대신, 깃털처럼 가벼운 젓가락 몇 쌍으로 연출하는 미래의 선택 포니 테일! 함께 알아볼까요? :)  \n\nYoon Eunhye\'s new role in the drama \"Mirae\'s Choice\" comes with her slightly-crazy-yet cute pony-tail that suggest her hectic professional life. Ever wondered how to twist-curl the hair without having to go after each and every hair strand - if yes, let\'s see how Seung-yeol, the hairstylist from Jungsaemmool Artist Group, simply uses a few pair of chopsticks to dramatically simplify the process! :)',150,0,NULL,'2013-12-31 03:27:41',1,'celebrity-style-8-how-to-get-yoon-eunhye-s-mirae-s-choice-hairdo-without-iron'),(5343,'NYE Jennifer Lawrence Smokey Makeup Tutorial + Detailed Tips and Tricks','http://www.youtube.com/embed/SVSePJz3LA8',NULL,'http://img.youtube.com/vi/SVSePJz3LA8/0.jpg','30',5,'2013-12-31 05:40:26','2014-01-02 03:14:51','SVSePJz3LA8','MY YEAR IN PHOTOS ♡ http://bit.ly/1cHULvV\nFULL PRODUCT LIST & BLOGPOST ♡ http://bit.ly/1apiM6B\nHey beautiful ones,\nI can\'t believe the end of the year has come so quickly! 2013 has been a truly epic year for me and oppa, and I\'m SO glad that we did it together with you guys! Thank you for all your sweet comments and ongoing support, it truly means so much to me!\n\nI have really been adoring Jennifer Lawrence recently and thus this tutorial is a rendition of her signature smokey eyed makeup. It\'s a deep, exotic makeup look with the right amount of shimmery sparkly element for your New Year\'s Eve (or any other occasion). Since I\'ve been doing lots of quick and brief tutorials of recent, I thought I\'d go for a change and offer you guys some real meat - this isn\'t a short tutorial but I do go in depth into tips, tricks and advice for makeup on asian (and non-asian) features, from false eyelash tips to how the way you hold your brush can affect the end result. I hope it\'s useful and informative.\n\nAs usual, the full list of products used will be on my blog, with behind-the-scenes pics: http://www.meejmuse.com\nGoodbye Panda Eyes Blogpost: http://bit.ly/1fBe6kK\n\nI hope you\'ve all had a wonderfullll end to the year 2013, I love you all very very much! Huge virtual hugs from me to you - Welcoming in the new year of 2014. Happy New Year everyone!!\n\nLove Jen xox\n\n\nP.S. Our special announcement will be made early next month!\nP.P.S. Don\'t forget to let me know down in the comments what kind of tutorial you prefer best! Live, voice over, or no voice over! \nP.P.P.S. Stay in contact with me by following me on Facebook, Twitter, Instagram or my blog! Check out where oppa and I recently went on Boxing Day - our favourite day-trip destination in New South Wales - http://www.meejmuse.com/2013/12/hunter-valley-daytrip-with-oppa.html\n\n- - - -\n\nMUSIC:\nThank you again Tim Be Told! Featured songs were Rest Easy, Humanity and Gravity.\nhttp://www.youtube.com/timbetold\nhttp://www.timbetold.com\n\n- - - -\n\nCOUPON CODES⇨ Enter these at checkouts for an awesome deal!\n\nSigma Brushes▸ http://bit.ly/1b10FX5\nDecember 10% off Coupon Code: DEC2013\n\nEye Amore▸ http://bit.ly/1gwlmPf\n10% off coupon code: MJMUSE\n\nLight in the Box Makeup, Accessories, Clothes▸ http://litb.me/Meejmuse\n\nPinky Paradise Lenses, Circle Lenses▸ http://www.pinkyparadise.com/\nFree animal lens case with each pair of lens purchased \nCode: meejmuse\n\nAbhair Hair Extensions, Weaves, Wigs▸ http://www.abhair.com/\n15% off Code: Meej15 - 15% off\nFree Worldwide Shipping Code: LCOLOR/DCOLOR\n\nWishtrend Korean Beauty Products▸ http://bit.ly/Hp9D5K\n5% off orders over $20 code: meejmuse5\n\n- - - -\n\nFOLLOW ME⇨\nWebsite/B